(58, '202558', 'सौ.कल्याणी राकेश चौधरी', '7721986105', 'रा.देवेंद्र नगर ,मातोश्री रेसिडेन्सी,ग्राउंड फ्लोअर', 'जळगाव ता.जि जळगाव', 8, 'अश्लील शिवीगाळ करून जीवे मारण्याची धमकी  दिल्याने आरोपी विरुद्ध दखल पात्र गुन्ह्याची   नोंद होण', 'आरोपी न.1ते3यांनी संगनमत करून साकेगांव येथील शेत गट नं.२२५/१या शेत मिळकतीचा आरोपी न.4 व 5 सोबत व्यवहार घडवून दरम्यान सुरूवातीला आरोपी न.4 व 5 यांनी ते आरोपी न.1 ते 3 यांना ओळखत नसल्याचा बनाव केला परंतु नंतर फिर्यादिस हस्ते परहस्ते असेही समजले की आरोपी न.1ते 3 हे परस्पर शेत गट नं.२२५/१ चा व्यवहार करण्याच्या तयारीत असून त्याबाबत फिर्यादी व भाऊ देवेन्द्र यांनी आरोपी न.4 व 5 यांच्याकडे जावून चौकशी करून विचारणा केली असता त्यावेळी आरोपी न.1ते 3 हे हजर होते त्यावेळी मी व माझा भाऊ यांनी आम्हाला तुमच्यासोबत कोणताही व्यवहार करावयाचा नाही तुम्ही आम्हाला कोणतीही रक्कम दिलेली नाही त्यावेळी वरील सर्व आरोपी न. 1 ते 5 यांनी माझा भाऊ  व मला आरोपी न. 4 व 5 यांच्या सांगण्यावरून आरोपी न. 1 याने माझा भाऊ यास मारहाण करून त्याचे डोळ्यास दुखापत केली व त्यावेळी संदीप जावळे याने आरोपी न.4 व 5 यांच्या सांगण्यावरून जीवे मारण्याची धमकी दिली की आम्ही खून करून आल्यावर कोणी आमच्या केसलाही धक्का लावत नाही ,तुला उता-यावरून काय जिंदगी तून संपवून टाकू असे बोलून मला देखील संदीप जावळे याने किरण महाजन यांच्या सांगण्यावरून तुम्ही यापुढे भुसावळ येथे दिसू नका नाहीतर तुम्हाला संपवून टाकू व तुमच्या शेतीचे कोणतेच पैसे तुम्हाला मिळणार नाही तुमच्याने जे होईल ते करून दाखवा,तसेच संदीप जावळे याने मला तुझ्या मायची चुत, तुझी चुत फाडून टाकीन ,तुला इथेच झवून टाकेन तुझ्या आईला परायणात झवून टाकेन साली रंडी अश्या अश्लील भाषेत शिवीगाळ केली', 'complaint 1.pdf', '/uploads/complaint_files/2025-02-28/20250228144353/complaint 1.pdf', '2025-02-28 14:43:53', 1, 'sadar complaint babat bhusawal bazarpeth ps che pso LHC/1494 SUMAN RATHOD MOB- 9075261494 yana call karun mahiti devun tatkal madat karnyas sangitle aahe karita nond', 21, '2025-02-28 15:55:10'),
