(75, '202575', 'विजय जोशी', '9209879393', 'वाकडी', 'जळगाव', 27, 'सासरवडीच्यालोकांकडूनटोरचार', 'मी विजय शालिग्राम जोशी रा वाकडी ता जामनेर जिल्ला जळगाव\r\nविषय. सासरवडीच्या लोकांकडून होणारा त्रास\r\nमहाशय .माज लग्न दि.20/11/2019 रोजी झालेले असून त्या पच्यात मला 2 मुलं आई वडील व ऐक मतिमंद भाऊ आहे\r\nमहाशय.गेल्या 3 वर्षा पासुन मझ्या सासरचे लोक मला मानसिक रित्या त्रास देतात व कुठलही कारण नसताना माझ्या पत्नीला तिच्या माहेरी ठेऊन घेतात.असे घेल्या 3 वर्षा पासून सुरू आहे आली मला सांगतात की तू त्या ठिकाणी न राहता माझ्या माहेरी राहण्या साठी ये असे टॉर्चर करतात तरी या सर्व त्रासाला कंटाळून मी माझे जीवन संपवण्याचे निर्णय घेतला होता आणि दि 21/02/2025 मी विष पिऊन  अहत्मत्या करण्याचे \r\nप्रयत्न केला होता तरी या संकटातून मी बचावलो तरी माझी मानसिकता या लोकांनी खालून टाकली आहे मझ्या मनात  पण हेच विचार आहे \r\nकारण या लोकांमुळे माझ्यात व मझ्या मुलांमध्ये दुरावा निर्माण होत आहे आणि ते लोक मझ्या मुलांच्या मनात मझ्या बद्दल क्रूर विचार भरत आहे तरी या सर्व घटनेची तक्रार मी फत्तेपुर पोलीस ठेशन या ठिकाणी दिली आहे पण 12 दिवस उलटून गेले तरीही त्या लोकांविरुद्ध कुठलीही अक्षन घेतली गेली नाही मला मझ्या मुलांची खूप कलिजी वाटत आहे व मी त्यांना 15 दिवसापासून भेटलो नाही व ते लोक मला भेटू देत नाहीत माझी आपणास ऐक विनंती आहे की मझ्या मुलांचं सिक्षनिक भविष  व माज पारिवारिक भविश अंधारात आहे असं मला वाटत कारण कायदा हा फ्कत्त स्त्रिया साठी आहे मझ्या लक्ष्यात आले आहे \r\nम्हणून मी या नर्क जीवनातून मोक्ष मिळवणे बरे समजतो आता हा माझा शेवटचा प्रयत्न राहील जर मझ्या या पण प्रयत्नावर मला येश नाही मिळाले व न्याय मिळाला नाही तर मी माझी जीवन संपवण्याचे निर्णय घेईल.याला जवाबदार माझी सासू . नामे देवकाबाई उत्तम.  येदमळ.सासरा.उत्तम किसन येदमळ साला जीवन उत्तम येदमळ. साली.अनिता दिलीप जोशी हे असतील \r\nमी दि.06/05/2025 पर्यंत वाठ पाहिलं अन्यथा माझे जीवन संपवेल कारण मला या लोकांनी मला हे करण्या साठी मजबूर केले आहे', '', '', '2025-03-04 09:05:40', 1, 'sadr mahit pahur poste pso asi prakash patil yana dili ahe', 21, '2025-03-04 09:45:43'),
