(81, '2025812813', 'TULSABAI DAYARAM RATHOD', '9766047266', 'Varasade Tanda', 'Varsade Tanda', 25, 'पिंपळगाव हरे पोलिस स्टेशन येथे माझी फिर्याद नुसार फोजदारी गुन्हा दाखल करीत नाही म्हणून  आमरण उपोषण', 'फिर्याद-पिंपळगाव हरे पोलिस स्टेशन येथे माझी फिर्याद नुसार फोजदारी गुन्हा दाखल करीत नाही म्हणून  पिंपळगाव हरे पोलिस स्टे. विरोधात मा.  जिल्हाधिकारी कार्यकाळ जळगाव येथे आमरण उपोषण सुरु करणार आहे. फिर्याद नुसार पिंपळगाव हरे पोलिस स्टेशन येथे माझी फिर्याद नुसार फोजदारी गुन्हा दाखल करण्याचे आदेश करावे', 'फिरयाद पिपळगांव हरे.pdf', '/uploads/complaint_files/2025-03-06/20250306222813/फिरयाद पिपळगांव हरे.pdf', '2025-03-06 22:28:13', 1, 'SADAR QR TAKRAR BABAT HC 2882 SHANTILAL BABULAL PAGARE YANNA MAHITI DILI ASSUN SADAR TAKRAR PS CHA EMAIL LA SEND KELI AAHE', 20, '2025-03-06 22:46:45'),
(82, '2025824736', 'Paresh Narendra Patil', '9665168015', 'Dhule', 'Dhule', 32, 'Cognizable offense non bailable', 'That the accused persons gave a threat to lodge false complaint in respect of sexual harrasment and rape in order compel complaint to get married with Dipali so also accused persons cheated the complaint for marriage', 'Fir.pdf', '/uploads/complaint_files/2025-03-07/20250307084736/Fir.pdf', '2025-03-07 08:47:36', 1, 'sadar takrar babat chopda ps che pso HC 2445/ jitendra chauhan v,office hajar dyuti aslele aamaldar pc 503/ amo pawar yanna kalvale ahe.te pudhil karvai karit ahe.', 21, '2025-03-07 09:19:55'),
(83, '2025833046', 'देविदास कांडेलकर', '9518333921', 'थेरोळा ता. मुक्ताईनगर', 'थेरोळा कुऱ्हा (काकोडा )', NULL, 'अवैध्य वाळू तस्करी रोखन्या बाबत', 'मा.\r\n     जिल्हा पोलीस अधिक्षक साहेब \r\nपोलीस मुख्यालय जळगांव \r\nजि. जळगांव\r\n \r\nअर्जदार :---देविदास श्रीराम कांडेलकर ग्रा.पं सदस्य रा. थेरोळा ता. मुक्ताईनगर जि. जळगांव \r\n\r\nविषय :--माझ्या गावात थेरोळा ता. मुक्ताईनगर येथे अवैध्यवाळू वाहतूक बंद करुन, कारवाई करणे बाबत \r\n\r\nवरील विषयनवे विंनती करतो की माझ्या गावत थेरोळा ता. मुक्ताईनगर येथे दररोज रात्री पूर्णा नदीपात्रातून शेकडो ब्रास वाळू ही चोरून नेली जात आहे, दिवसा वाळू काढून साठवण केली जाते व रात्रीच्या वेळेस जवळ जवळ 30 ते 40 वानहे रात्रभर चोरटी वाहतूक करीत आहे. असे हे 3 महिने झाले चालु आहे, यामुळे शासनाचा लाखोरुपयाचा महसूल बुडत आहे. या लोकांनी वाळूचे शेकडो ब्रासचे डेपो साठवून ठेवलेले आहेत,आम्ही वारंवार तहसीलदार साहेब, तसेच प्रांत साहेब यांना फोन करुन तसेच चोरट्या वाहतुकीचे फोटो टाकून सावध केले परंतु त्याचा काहीही उपयोग झाला नाही, त्यांच्यावर एकदाही कारवाई झाली नाही,हया धंद्यामुळे तरुण मुले ही गुन्हेगारी प्रवृत्ती कडे वळत आहेत, पैसा येत असल्यामुळे हे लोक दादागिरी व हाणामारी करतात यामुळे गावामध्ये भीतीचे वातावरण मिर्मान झाले आहे, \r\n      तरी महाशय आपणास माझी विंनती आहे की आपण अचानक येऊन या ठिकाणी छापा टाकून यांना पकडावे, आणि यांच्यावर योग्य ती कारवाई करावी ही विंनती....\r\n                  \r\n          आपला विश्वासु \r\nदेविदास कांडेलकर ग्रा.पं. सदस्य रा थेरोळा ता. मुक्ताईनगर जि. जळगांव \r\n\r\nप्रत रवाना :--1) मा. आमदार एकनाथरावजी खडसे \r\n2) मा.मंत्री गुलाबरावजी पाटील.. पालकमंत्री जळगांव \r\n3)  मा. मंत्री चंद्रशेखर बावनकुळे..महसुलमंत्री महाराष्ट्र राज्य\r\n4) मा. जिल्हधिकारी साहेब जळगांव', 'IMG_20250307_122444.jpg', '/uploads/complaint_files/2025-03-07/20250307123046/IMG_20250307_122444.jpg', '2025-03-07 12:30:46', 1, 'muktainagar ps che pso pn 2996/ ganesh late yanna takrardar yanchi mahiti dili ahe.te pudhil karvai karit ahe.', 21, '2025-03-07 12:51:54'),
(84, '2025845634', 'राजेश दिलीप तागवाले', '9822328054', 'प्लॉट न २२ सज्जन हौसिंग सोसायटी करगाव रोड चाळीसगाव', 'चाळीसगाव', 19, 'वाहन बाबत', 'मी चाळीसगाव  येथील रहिवाशी असून माझ्याकडे अल्टो चार८४१६ चाकी वाहन क्रमांक  MH-20 BY-8416 आहे . सदरचे वाहन हे सुस्थित असून दिनांक २०/०२/२०२५ ते २५/०२/२०२५ या कालावधीत सदर वाहनाने तालुका व जिल्हाबाहेर कुठेही प्रवास केलेला नाही सदर वाहन्बाबत दिनांक २२/०२/२०२५ रोजी सकाळी ९.४६ वाजता सदरचे वाहन हे अहमदनगर - सोलापूर महामार्गावरील भान पिंपरी टोल प्लाझा येथील टोल नाक्या वरून गाडी गेल्या बाबतचे आयडीएफसी  Fast Tag चे रकम रु १३०/- टोल कपात झाले बाबत सकाळी ९.४७ मी मोबईल वर मेसेज आलेला आहे. सदरचे वाहनाने सदर कालावधीत कुटेही प्रवास केलेला नसतानाही व वाहन घरी असताना माझ्या वाहन क्रमांकावर दुसरे वाहन असल्याचे समजते. तरी भविष्यात याबबात कोणताही अनुचित प्रकार घडू नाही यासाठी आपल्या स्तरावरून चौकशी व्हावी  हि नम्र विनंती .', 'jalgaon.pdf', '/uploads/complaint_files/2025-03-07/20250307125634/jalgaon.pdf', '2025-03-07 12:56:34', 1, 'sadar tkrar poste la fon karun pso psi arun bavisar yana mahiti kalvili aahe', 21, '2025-03-07 15:37:26'),
(85, '2025852427', 'नरेंद्र patil', '8830360967', 'bhusawal', 'bhusawal', 10, 'राष्ट्रीय महामार्ग क्रमांक 53 वरचुकीच्या दिशेने येऊन शिवीगाळ करणे मग गाडी अंगारांनी', 'आज सात रोजी सकाळी साडेदहा ते 11 वाजेच्या सुमारास नशिराबाद कडून जळगाव कडे येत असताना समोरून डंपर डंपर येऊन अचानक गाडीच्या समोर आल्याने त्याला विचारले असता तुला कोणाला काय सांगायचं सांग हा माझा रस्ता आहे कारण मला एअरपोर्ट कडे जायचंय त्याच्या गाडीच्या मागे कोणतीही नंबर प्लेट नव्हती डंपर हे नवीन होते', '', '', '2025-03-07 14:24:27', 1, 'nashirabad pso lhc 2920 sunita lele yana sadar  takrar babat mahiti dili', 21, '2025-03-07 15:22:11'),
(86, '2025861834', 'विवेक गजानन देवकर', '9960600999', 'आदर्शनगर', 'जळगाव', 35, 'पाळधी बुद्रूक गट नं ८४/१ व ८४/२ मधील गव्हाचे उभे पीक ८४/१ मधील विहीरी वरील इलेक्ट्रिक पंप चोरीला गेला अशी खोटी तक्रार असलम शेख त्याचा मुलगा , किरण नन्नवरे यांनी पाळधी दूरक्षेत्र पोलीस ठाणे देऊन ६० ते ७० पोते गहू चोरून नेले.', 'मी तक्रारदार विवेक गजानन देवकर पाळधी बुद्रूक ता.धरणगाव गट नं ८४/१ व ८४/२ बाबत पाळधी दूरक्षेत्र पोलीस ठाणे पाळधी येथे दि.१९/०२/२०२५ रजिस्टर पोस्टाने तक्रार केली कोणतीही कार्यवाही आरोपींवर झाली नाही म्हणून पोलीस अधिक्षक जळगाव यांना भेटून तक्रार अर्जाची प्रत व अधिक्षक कार्यालयात प्रत दि.४ मार्च २०२५ ला दिली. आरोपींवर लवकरात लवकर कार्यवाही होऊन गुन्हा दाखल व्हावा माझ्या जिवाला धोका आहे मी वरिष्ठ नागरिक आहे.तक्रारदार विवेक देवकर वय 62', '20250305_065215.jpg', '/uploads/complaint_files/2025-03-07/20250307161834/20250305_065215.jpg', '2025-03-07 16:18:34', 1, 'paldhi op che pso HC 3379/ vittal yuvraj patil yanna sadar takrari aaja baddal phone karun mahiti dili ahe.te,pudhil karvai karit ahe.', 21, '2025-03-07 16:51:42'),
(87, '2025871712', 'Aniket lekhraj badlani', '7507575272', 'Jalgaon', 'Faizpur', 13, 'माझ्या दुकानात घडलेल्या मारहाणी, तोडफोड, चोरी आणि जीवे मारण्याच्या प्रयत्नाबाबत तक्रार', 'मी, अनिकेत लेकराज बदलनी, राहणार फैजपूर, माझे ‘राजकमल मोबाईल्स’ नावाचे दुकान फैजपूर येथे आहे.\r\n\r\nदिनांक ०५/०३/२०२५ रोजी, माझ्या दुकानात आशीष रवि कापड़े राहनार शिव कॉलोनी फ़ैज़पुर            मो.99702 85112 केतन रवि कापड़े आणि रवि कापड़े, किंवा तीन अज्ञात व्यक्ती आल्या. काही महिन्यांपूर्वी मी त्यांना उधारीवर वस्तू देण्यास नकार दिला होता, त्यामुळे त्यांनी दुकानात येऊन माझ्यासोबत वाद घातला आणि मला शारीरिक इजा होईल अशा प्रकारे मारहाण केली.\r\n\r\nया आरोपींनी दुकानात गोंधळ घालत गुंडागर्दी केली आणि मुद्दामहून दुकानातील फ्रीज व टी.व्ही. फेकून दिले. तसेच, त्यांनी दुकानातील मोबाईल अ‍ॅक्सेसरीज आणि इतर मौल्यवान वस्तू चोरल्या.\r\n\r\nया हल्ल्यात, माझ्या गळ्यातील सुमारे २० ग्रॅम वजनाची सोन्याची चेन देखील गहाळ झाली आहे. मारहाणीच्या गोंधळातच ती चोरी झाली असण्याची शक्यता आहे.\r\n\r\nयाशिवाय, त्यांनी मला जीवे मारण्याचा प्रयत्न केला, आणि वारंवार धमक्या देत आहेत. त्यामुळे माझ्या जीवितास धोका निर्माण झाला आहे.\r\n\r\nतरी, आपण याची त्वरित दखल घेऊन FIR दाखल करावी व दोषींवर कठोर कारवाई करावी. तसेच, चोरीस गेलेल्या सोन्याच्या साखळीचा शोध लावून ती मला परत मिळवून द्यावी, अशी मी आपणास विनंती करतो.\r\n\r\nधन्यवाद!\r\n\r\nतक्रारदार:\r\nअनिकेत लेकराज बदलनी\r\nफैजपूर\r\n७५०७५७५२७२', '', '', '2025-03-07 17:17:12', 1, 'yatil takrardar yanchi mahiti faizpur ps che  PSO LHC/ 2669 madina tadvi yanna phone karun kalvale ahe.te pudhil karvai karit ahe.', 21, '2025-03-07 18:00:26'),
