(94, '2025942817', 'मुकुंदा जगन्नाथ आंबोडकर', '9850798663', 'शांती नगर -भुसावळ', 'भुसावळ', 7, NULL, 'मी आयुध निर्मानी भुसावळ येथे नोकरीला आहे. कामावर जात असताना माझे ड्युटी पंचिंग कार्ड गिरीजा हॉस्पिटल ते आयुध निर्मानी भुसावळ या रस्त्यामध्ये हरवले आहे.', '', '', '2025-03-10 18:28:17', 1, 'BHUSAWAL CITY PS CHE PSO HC/2090 SANJAY SONAWANE YANNA PHON KARUN  QR COD  COMLENT BABAT MAHITI KALAVILE AHE V TE YOGY TI KARWAI KARIT AHE BABAT KALAVILE AHE', 21, '2025-03-10 19:19:16'),
