(97, '2025970758', 'विवेक गजानन देवकर', '9960600999', 'आदर्शनगर', 'जळगाव', 35, 'पाळधी गट नं ७६ मधील उभे पिकांची चोरी करण्यासाठी किरण नन्नवरे रा.पाळधी व असलमशेख जेऊ व त्याचा मुलगा यांनी संगनमत कृरून कट कारस्थान रचून धाक दडपशाही फसवणूक करण्ण्या हेतूने अमर बारेला याच्याकडून जबदस्तीने पुरावा नष्ट करण्याच्या हेतूने बियाणे, खते, मजुरी च्या पावत्या ताब्यात घेतली आहे. चौकशी होऊन कायद्यानुसार गुन्हा दाखल व्हावा', 'नमस्कार सर,\r\nपाळधी बुद्रूक गट नं 76 हा ता.धरणगाव येथील व माझा सख्खा भाऊ श्री विनोदचंद्र गजानन देवकर रा.मुंबई यांच्या नावावर आहे सोबत 7/12 चा उतारा देत आहे. श्री विनोदचंद्र मुंबईला राहात असल्यामुळे शेती मी व माझा सर्वात मोठा भाऊ  श्रीनाथ बघतो.\r\nश्री किरण नन्नवरे ने अवैध मार्गाने गट नं 66/2 मधील 2000 फूट जागेवर अवैध कब्जा केल्यामुळे त्याला अनुसरून कट कारस्थान रचून सरकारी कर्मचारी लोकांना प्रलोभन देऊन माझी शेती गट नं 76 असलम शेख व त्याचा मुलगा आमच्या शेतीचा सर्व खर्च करतो असे सत्याचा भास निर्माण करण्याचा प्रयत्न करत आहे. त्यासाठी अनेक वर्षापासून शेतावर देखरेख व मजुरी ची कामे करणारा श्री अमर बारेला याला जीवे मारण्याची \" सर काट दूंगा\"  असे असलम शेख किरण नन्नवरे उपस्थित असताना धमकी दिली. अमर बारेला वर धाक दडपण निर्माण करून जबरदस्तीने माझ्या व श्रीनाथ यांच्या शेतीची पेरणी करतांना लागणारी  बियाणे खरेदी, खते, मजुरी च्या पावत्या हे पुरावा नष्ट करण्याच्या हेतूने किरण नन्नवरे ने अमर बारेला कडून ताब्यात घेतली व त्याला मोठी रक्कम दिली व तो किरण नन्नवरे व असलम शेख यांच्या विराधात बोलणार नाही हे श्री गजानन देवकर यांना समजल्यावर अमर बारेला ला शेताच्या देखभाल व मजुरी देऊन कामावरून काढून टाकले आहे. अमर बारेला त्याचा मुलगा विकी व दुसऱ्या मुलाचे नाव माहीत नाही हे सर्व बायको मुलांसह गट नं 66/2 मधील भिंतीला लागून एका झोपडीत राहतात असे जयश्री हाॕटेल चे मालक श्री जगदीश यांनी मला फोनवरून सांगितले. अमर बारेला माझा फोन घेत नाही व माझ्याशी  संपर्क करत नाही माझ्या गट नं 76 बाबतीतील सर्व माहिती जाणूनबुजून लपवून ठेवत आहे ह्यात किरण नन्नवरे याचे कट कारस्थान करून माझ्या शेतातील गट नं 76 मधील पिकाची चोरी गट नं 84/1 व 84/2 प्रमाणे करायची हाच उद्देश आहे. किरण नन्नवरेला सल्ला पोलीस दूरक्षेत्र पाळधी मधील हे.काॕ.खंडारे यांचेकडून मिळतो असे नेहमीच असलमशेख म्हणायचा आमच्यावर कारवाईच होणार नाही असे आत्मविश्वासाने म्हणतो. असलम शेख जवळ नक्कीच पुरावा असण्याची शक्यता आहे. तक्रारदार विवेक देवकर जळगाव दि.12/03/2025', '20250312_210605.jpg', '/uploads/complaint_files/2025-03-12/20250312210758/20250312_210605.jpg', '2025-03-12 21:07:58', 1, 'sadar takrar babat dharnagao ps che pso hc/ ishwar shinde mob- 9552567740 yana call karun mahiti dili aahe tasech dharnagaon police  station la email kela aahe karita nond', 21, '2025-03-13 07:18:39'),
