(100, '20251002908', 'ANAVAR RAFIKSHAHA FAKIR', '9595476876', 'VASAI ROAD', 'susari', 17, 'लेखी फिर्याद वरंगाव पोलिस स्टेशन', 'लेखी फिर्याद वरंगाव पोलिस स्टेशन', 'add लेखी फिर्याद वरंगाव पोलिस स्टेशन.pdf', '/uploads/complaint_files/2025-03-13/20250313112907/add लेखी फिर्याद वरंगाव पोलिस स्टेशन.pdf', '2025-03-13 11:29:08', 1, 'SADAR FIRYAD BABAT VARANGAON PS CHE PC/962 BHUSHAN MALI YANNA MAHITI DILI AAHE', 21, '2025-03-13 12:02:37'),
(101, '20251013119', 'दीपक रमेश करोसिया', '9370160010', 'संचार नगर, ढाकेवाडी शेजारी जळगाव', 'जळगाव', 6, 'खोटी तक्रार दाखल केल्याबद्दल चौकशी करणे बाबत', 'माननीय पोलीस अधीक्षक साहेब,\r\nजळगाव शहर \r\n\r\nविषय: खोटी तक्रार दाखल केल्याबद्दल चौकशी करणे बाबत.\r\n\r\nअर्जदार: श्री. दीपक रमेश करोसिया,\r\n(जिल्हा क्राईम रिपोर्टर बुलंद पोलीस टाइम्स) रा.संचार नगर, ढाकेवाडी शेजारी जळगाव.\r\nमो. 9370160010 \r\n\r\nमाननीय महोदय,\r\nदिनांक 23-फेब्रुवारी-2025 च्या दिव्य मराठी सिटी पेज पेपर मधील बातमीनुसार श्री. परेश रामकृष्ण सनन्से, मो. 9422276667 रा. संचार नगर जळगाव यांची पेपर मधील बातमी वाचली. सदर काच फोडण्याचा गुन्हा दाखल करणे व पेपर मध्ये बातमी देणे हे दोन्ही विषय बनावट व पूर्णपणे असत्य असल्याचे कारण म्हणजे मी दीपक रमेश करोसिया उपरोक्त परेश सनन्से च्या शेजारी राहत असून माझ्या सीसी टीव्ही फुटेज मध्ये कारची काच फुटल्याचा किंवा असा कुठलाही अनुचित प्रकार घडला असावा असे दिसत नाही.\r\n\r\nउपरोक्त परेश सनन्से नाहकपणे संचार नगर मधील नागरिकांवर खोटे आरोप करून समाजामध्ये भ्रम, दहशत व घबरावटीचे वातावरण निर्मिती करत आहे असा दाट संशय आहे आणि पेपर मध्ये खोटी बातमी प्रसिद्ध केली. असा दाट संशय असण्याचे कारण म्हणजे मी स्वतः पूर्ण सीसी टीव्ही फुटेज दिनांक 12-फेब्रुवारी-2025 पासून ते आज दिनांक 11-मार्च-2025 पर्यंत तपासले त्यामध्ये असा कुठलाही प्रकार घडल्याचे दिसून येत नाही.\r\n\r\nसंचार नगरच्या रहिवाशांना देखील कारची काच फुटली याबद्दल माहिती नाही. दिनांक 10 ऑक्टोबर-2024 चा पण काच फोडल्याची तक्रार खोटी आहे. कारण याच दरम्यान नगरच्या नगरपालिकेच्या रस्त्याचे काम दहा दिवस सुरू होते. त्यामुळे संचार नगर कॉलनीच्या कोणत्याही व्यक्तीची सायकल, मोपेड, चारचाकी व इतर वाहन संचार नगरच्या मुख्य गेटच्या बाहेर (देविदास कॉलनी समोर) लागून होत्या. उपरोक्त परेश रामकृष्ण सनन्से याची कार ही बीएसएनएल ऑफिसच्या आवारात 10 दिवस पार्किंग मध्ये होती.\r\n\r\nत्यामुळे आम्ही सर्व विनंती करतो की, या सर्व विषयाची सखोल चौकशी करण्यात यावी व संबंधितावर खोटी कारवाई खोटी तक्रार केल्याबद्दल व दिव्य मराठी वरही खोटी बातमी प्रसिद्ध केल्याबाबत बद्दल कारवाई करावी कारवाई करावी ही नम्र विनंती.\r\n\r\nआपला सुज्ञ नागरिक\r\nदीपक रमेश करोसिया\r\nमो. 9370160010', 'DM.pdf', '/uploads/complaint_files/2025-03-13/20250313123118/DM.pdf', '2025-03-13 12:31:19', 1, 'SADAR COMPLAINT BABAT MIDC PS CHE PSO  ASI/792 ADHIKAR PATIL YANA MAHITI DILI ASUN TYANA PUDHIL KARVAI KARNE BBAT SANGITALE AHE..MIDC PS LA EMAIL KELA AHE..', 21, '2025-03-13 13:43:57'),
(102, '20251021527', 'Akshay Madan Pawar', '9767909668', 'Sonai Nivas, Near Sai Pathology, Shivaji Nagar Bus Stand Road, Pachora', 'Pachora', 24, 'Complaint Regarding Lost Driving License', 'Dear Sir/Madam,  \r\n\r\nI, Akshay Madan Pawar, S/o Madan Shankar Pawar, residing at Shivaji Nagar Pachora, would like to report the loss of my driving license. The details of my lost driving license are as follows:  \r\n\r\n- License Number: MH19 20160016503   \r\n- Date of Loss: 08/03/2025  \r\n- Place of Loss: Near around Nagarpalika, Station Road , Pachora . \r\n  \r\nI shall be grateful for your assistance.  \r\n\r\nThank you.  \r\n\r\nSincerely,  \r\nAkshay Pawar', 'Driving Licence.pdf', '/uploads/complaint_files/2025-03-13/20250313151527/Driving Licence.pdf', '2025-03-13 15:15:27', 1, 'SADAR EVENT CHI SAVISTAR MAHITI PACHORA PS CHE PSO ASI / SONAVANE YANA DILI AHE.', 20, '2025-03-13 15:53:54'),
