(104, '20251041504', 'Irfan Taslim Pathan', '9167109832', 'BAB-E-REHMAT Apartment Near Ashok Kirana chauk', 'Mehrun', 6, 'atikraman\" (encroachment)', 'In front of Our Apartment there is Encroachment of Hawkers and PAN TAPRI shop due to which there is too much traffic in chauk as well as due to PAN TAPRI there is increment of local goons that is not good for healthy society. Request you to take immediate action.', '', '', '2025-03-14 15:15:04', 1, 'sadar event chi mahiti midc pi sir sandip patil ani hc / pradip patil yana phone dware mahiti dili ahe', 20, '2025-03-14 19:59:41'),
(105, '20251050207', 'Nilesh Namdeo Ubhale', '8329984521', 'Bhoje', NULL, 25, 'Complaint against API PRAKASH KALE', 'Complaint against API PRAKASH KALE-पिपळगांव हरे पोलिस स्टेशन अंतर्गत सुरु आहेत ,अवैध धंधे-सत्ता,पत्ता,मटका,गावठी दारू,चकरी,अवैध गौन खनिज उत्तखनन,अवैध रुक्ष तोड़, API PRAKASH KALE यांच्या विरोधात शिस्तभंग कार्यवाही करुण विभागिय चौकशी करुण सेवेतून बड़तर्फ़ न्यायिक आहे.', 'Complaint against API PRAKASH KALE.pdf', '/uploads/complaint_files/2025-03-15/20250315110206/Complaint against API PRAKASH KALE.pdf', '2025-03-15 11:02:07', 1, 'pimpalgaon hare.pn/1903 gorbanjara mob no 9511256228 yana mahiti dili asun email kela ahe..', 21, '2025-03-15 11:13:09'),
(106, '20251060932', 'Sonawane Sagar Popat', '9096193556', 'Vill- Pandhrad, Tal- Bhadgaon', 'JALGAON', 21, 'Documents Loss', 'When I went to Bhadgaon weekly market, my pocket wallet fell somewhere in the market, my army canteen smart card, aadhaar card, driving license was lost in that wallet, I want to recreate these documents, for that I need FIR copy.', '', '', '2025-03-15 13:09:32', 1, 'SADAR COMPLAINT BABAT BHADGAON PS CHE PSO HC/3173 VIJAY JADHAV  MOB NO. 8237629986 YANA MAHITI DILI AHE..', 21, '2025-03-15 13:27:28'),
(107, '20251070720', 'Nilesh Namdeo Ubhale', '8329984521', 'Bhoje', 'Bhoje', 25, 'Firyad', 'प्रति,\r\nसहायक पोलिस निरीक्षक पिंपळगाव हरे. पो.स्टे.\r\n\r\nफिर्यादी –निलेश नामदेव उभाळे, वय -३३, व्यवसाय-सामाजिक कार्य  \r\n        मो. नं.८३२९९८४५२१ \r\n        रा.भोजे, ता. पाचोरा, जि. जळगाव. (महाराष्ट्र)-४२४२०३ \r\n     -विरुध-\r\nआरोपी –1) प्रकाश काळे (सहायक पोलिस निरीक्षक पिंपळगाव हरे. पो.स्टे.)\r\n	    2) धनंजय येरुळे (उप विभागीय पोलीस अधि.पाचोरा सो, पाचोरा भाग \r\n                      पाचोरा)\r\n               3) अतिरिक्त पोलीस अधीक्षक पोलिस अधीक्षक कार्यकाल जळगाव  \r\n        आपले सरकार पोर्टल नोडल ऑफिसर \r\n    4) उप-अधिक्षक (गृह) विभाग पोलिस अधीक्षक कार्यकाल जळगाव   \r\n        आपले सरकार पोर्टल शाखा अधिकारी         \r\n   5) महेश्वर रेड्डी (पोलिस अधिक्षक जळगाव)\r\n     \r\nआरोपी क्र.1  विद्यमान सहायक पोलिस निरीक्षक पिंपळगाव हरे. पो.स्टे. \r\nआरोपी क्र.2  विद्यमान उप विभागीय पोलीस अधि.पाचोरा सो, पाचोरा भाग पाचोरा\r\nआरोपी क्र.3  विद्यमान आपले सरकार पोर्टल नोडल ऑफिसर \r\n         अतिरिक्त पोलीस अधीक्षक पोलिस अधीक्षक कार्यकाल जळगाव \r\nआरोपी क्र.4  विद्यमान आपले सरकार पोर्टल शाखा अधिकारी  उप-अधिक्षक (गृह) \r\n                       विभाग पोलिस अधीक्षक  कार्यालय जळगाव\r\nआरोपी क्र.5 विद्यमान पोलिस अधिक्षक जळगाव जिल्हा जळगाव \r\n\r\nमी  फिर्यादी  विनंतीपुर्वक लेखी फिर्याद देतो की, \r\nमी वरील ठिकाणी माझी पत्नी शुभांगी सोबत राहतो व मी समाजीक कार्य करतो.\r\nमी समाजीक कार्यकर्ता असल्याने, मी दी.06.03.2025 रोजी पुरावे निशि व शासन GR प्रमाने जबाबदार व्यक्ति आणी अधिकारी विरोधात फोजदारी स्वरूपाचा गुन्हा दाखल करण्यासाठी लेखी फिर्याद ईमेल द्वारे व आपले सरकार पोर्टल टोकन नंबर COM/HOMD/2025/637 द्वारे दाखल केलेली अस्तानी आरोपी नंबर १ कड़े वरिष्ठ अधिकारी मार्फ़त कार्यवाही साठी आलेली होती. परंतु आरोपी नंबर १ ची जबाबदारी व कर्तव्य असून देखिल त्यांनी कायदेशीर रित्या माझ्या फिर्याद प्रमाने फोजदारी स्वरूपाचा गुन्हा दाखल करुण वरिष्ट अधिकारीना केलेल्या फोजदारी कार्यवाही चा अहवाल सादर करने जबाबदारी व कर्तव्य होते, परंतु आरोपी नंबर १ नी पदाचा दुरुपयोग करुण जाणीव पूर्वक कर्तव्य कसूर केलेले आहे.व फोजदारी गुन्हा दाखल न करता फोजदारी कार्यवाहीसाठी असलेली माझ्या “फिर्याद” ला “अर्ज” म्हणून दी.8.3.2025 रोजी आरोपीं नंबर १ ने चुकीचे उत्तर दिले “सदर आर्जाची चौकशी मा. उप विभागीय पोलीस अधि. पाचोरा सो, पाचोरा भाग पाचोरा यांच्या आदेशान्वये मा. पोलीस निरीक्षक सो, पहुर पोलीस स्टेशनला देण्यात आली असुन ते पुढील कारवाई करीत आहेत’-असे चुकीचे उत्तर देऊन आरोपी नंबर १ नी आपले सरकार पोर्टल चे टोकन  नंबर COM/HOMD/2025/637 त्याच्या स्तरावर निकाली काढून आपले सरकार पोर्टल साठी असलेले शासन निणर्य चा भंग केलेला आहे. जाणीव पूर्वक कर्तव्य कसूर केलेल आहे, पदाचा दुरूपयोग केलेला आहे आरोपींना फोजदारी कार्यवाही पासून वाचवन्यासाठी असे बेकायदेशीर कृत्य केलेले आहे.\r\nलगेच मी दी.8.3.2025 रोजी  आपले सरकार पोर्टल वरील टोकन नंबर अपील करुण पुन्हा टोकन ओपन केले वरिष्ट अधिकारी (आरोपी नंबर 2,3,4,5) यांनी त्याच्या स्तरावर आरोपीं नंबर १ विरोधात शिस्तभंग कार्यवाही तसेच कर्तव्य कसूर केले म्हणून BNS २०२३ चे कलम १९८ प्रमाने कार्यवाही  करुण माझ्या फिर्याद प्रमाने फोजदारी गुन्हा दाखल करुण जिल्हा स्तरावर “शाखा अधिकारी” च्या वतीने आपले सरकार पोर्टल चे टोकन बंद करने हे आरोपी नंबर 2,3,4,5 चे कर्तव्य व जबाबदारी होती. परंतु आरोपी नंबर 2,3,4,5 यांनी पोर्टल टोकन पुन्हा आरोपी नंबर १ कड़े पाठवले व आरोपी नंबर १ नी दी.15.3.2025 रोजी मा. प्रांतधिकारी सो, पाचोरा भाग पाचोरा यांच्या कडे वर्ग करुण आपले सरकार पोर्टल चे टोकन  नंबर COM/HOMD/2025/637 त्याच्या स्तरावर निकाली काढून जाणीव पूर्वक कर्तव्य कसूर केलेल आहे, पदाचा दुरूपयोग केलेला आहे आरोपींना फोजदारी कार्यवाही पासून वाचवलेले आहे.\r\n\r\nआपले सरकार पोर्टल शासन निर्णय क्र.संकीर्ण-२०१६/प्र.क्र.१३०/१८(र. व का.) दी.२४ औगष्ट २०१६ मधील ब(5) नुसार आरोपी नंबर 5 व्यक्तिषा जबाबदार आहे. तसेच, आरोपी नंबर 2,3,4,5 यांची आरोपी नंबर १ च्या कामकाजावर कायदेशीर नियंत्रण ठेवणे, तसेच आपले सरकार पोर्टल टोकन “शाखा अधिकारी” च्या स्तरावर कायदेशीरित्या फिर्याद प्रमाने फोजदारी गुन्हा दाखल करुण टोकन “शाखा अधिकारी” च्या स्तरावर बंद करने न्यायिक होते. \r\nतसेच मी दी.8.3.2025 रोजी केलेले अपील नुसार टोकन हे वरिष्ट स्तरावर निराकरण करने हे आरोपी नंबर 2,3,4,5 चे कर्तव्य व जबाबदारी होती. \r\n \r\nकायदेशीर रित्या, शासन निणर्य प्रमाने काम करने हे आरोपी क्र.1 ते 5 यांची जबाबदारी व कर्तव्य असून देखिल आरोपींना वाचवन्यासाठी जाणीव पूर्वक कर्तव्य कसूर केलेले आहे.पदाचा दुरुपयोग केलेला आहे.\r\n \r\nम्हणून माझी आरोपी नंबर 1,2,3,4,5 यांच्या विरोधात BNS २०२३ चे कलम १९८ व अन्य कलमा अंतर्गत लेखी फिर्याद आहे. आरोपीन विरुध फोजदारी गुन्हा दाखल करण्यात यावा.\r\n\r\n\r\n	     धन्यवाद...\r\n                 निलेश नामदेव उभाळे (फिर्यादी)\r\n                 ईमेल द्वारे - nileshnubhale@gmail.com \r\n	      दि. 16/3/2025                                                                        \r\n              टिप-सर्व आवश्यक माहिती,डॉक्यूमेंटस, शासन निर्णय सोबत जोडलेले आहे\r\n   \r\n  प्रत:-\r\n1)	मुख्य सचिव महाराष्ट्र राज्य\r\n2)	पोलीस महासंचालक महाराष्ट्र राज्य\r\n3)	पोलीस महानिरीक्षक नाशिक रेज\r\n4)	म.पोलिस अधिक्षक,जलगाँव,		\r\n5)	म.विभागीय आयुक्त नाशिक विभाग', 'Firyad againt Police.pdf', '/uploads/complaint_files/2025-03-16/20250316030720/Firyad againt Police.pdf', '2025-03-16 03:07:20', 1, 'sadar qr code varil camplent babat pimpalgaon ps che pso pn/1903 pandurang gorbanjara yanna mahiti dili asun  sadar pdf pimpalgaon ps che gmail a/c var pathavleli aahe', 21, '2025-03-16 08:57:53'),
(108, '20251081945', 'Jayprakash Ratilal Jain', '9422775310', 'Pimplagaon Hare', 'pimpalgaon', 25, 'स.पो.नी.प्रकाश काळे यांच्या विरोधात कार्यवाही साठी व मुद्दे माल वसूली साठी तपास LCB जलगाव यूनिट कड़े पाठवन्यासाठी.', 'स.पो.नी.प्रकाश काळे यांच्या विरोधात कार्यवाही साठी व मुद्दे माल वसूली साठी तपास LCB जलगाव यूनिट कड़े पाठवन्यासाठी.', 'against API Kale.pdf', '/uploads/complaint_files/2025-03-16/20250316031944/against API Kale.pdf', '2025-03-16 03:19:45', 1, 'sadar qr code varil camplent babat pimpalgaon ps che pso pn/1903 pandurang gorbanjara yanna mahiti dili asun  sadar pdf pimpalgaon ps che gmail a/c var pathavleli aahe', 21, '2025-03-16 08:58:02'),
(109, '20251095512', 'संजिवनी गोरखनाथ झिंगे', '9665116446', 'रूम नो. ३४ मिल चाल भडगाव रोड', 'चाळीसगाव', 19, 'माझ्या मालमत्तेचे अनधिकृत पद्धतीने पाडकाम व धमकावण्याबाबत तक्रार', 'प्रति,\r\nपोलीस निरीक्षक,\r\nपोलीस अधीक्षक कार्यालय - जळगाव,\r\nनवीन बसस्थानक समोर, जिल्हा पेठ, जळगाव, महाराष्ट्र 425001.\r\n\r\nविषय: माझ्या मालमत्तेचे अनधिकृत पद्धतीने पाडकाम व धमकावण्याबाबत तक्रार\r\n\r\nमाननीय महोदय,\r\n\r\nमी संजिवनी गोरखनाथ झिंगे, सध्या रूम नंबर -६, Sunflower Residency,नारायण बापू नगर, जेल रोड, नाशिक येथे वास्तव्यास आहे. माझ्या Room No. 34 at Ground Floor, Mill Chawl, भडगाव रोड, चाळीसगाव, जि. जळगाव या मालमत्तेवर काही अज्ञात व्यक्तींनी अनधिकृतपणे अतिक्रमण करून पाडकाम केले आहे.\r\n\r\nसदर व्यक्तींनी मला दूरध्वनीद्वारे (फोनद्वारे) संपर्क साधून या घटनेची माहिती दिली आणि मला मानसिक दबाव आणला तसेच धमकावण्याचा प्रयत्न केला.\r\n\r\nसध्या मी प्रकृती अस्वास्थ्यामुळे नाशिक येथे असल्याने घटनास्थळी उपस्थित राहू शकत नाही. माझ्या पतीच्या निधनानंतर मी एकटीच राहते आणि माझे उदरनिर्वाह केवळ अल्प निवृत्तीवेतनावर  चालते. त्यामुळे ही मालमत्ता माझ्यासाठी अत्यंत महत्त्वाची आहे.\r\n\r\nया अनधिकृत व बेकायदेशीर कृत्याची तातडीने दखल घेऊन संबंधितांवर कठोर कारवाई करावी. तसेच, माझ्या मालमत्तेचे संरक्षण करण्यात यावे व मला आवश्यक ती मदत आणि सुरक्षा पुरवावी.\r\n\r\nआपली तत्काळ मदत अपेक्षित आहे.\r\n\r\nतक्रारदार: संजिवनी गोरखनाथ झिंगे\r\nसंपर्क क्रमांक: 9665116446\r\nसध्याचा पत्ता: रूम नंबर -६, Sunflower Residency,नारायण बापू नगर, जेल रोड, नाशिक\r\nमालमत्तेचा पत्ता: Room No. 34 at Ground Floor, Mill Chawl, भडगाव रोड, चाळीसगाव, जि. जळगाव \r\nदिनांक: 16/03/2025', '', '', '2025-03-16 14:55:12', 1, 'sadar QR code takrar babat 40gaon city ps che pso asi ajay malche yanna mahiti dili asun ps cha email var send kele aahe babat nond', 21, '2025-03-16 15:05:55'),
(110, '20251101416', 'Nilesh Namdeo Ubhale', '8329984521', 'Bhoje', 'BHOJE', 25, 'भोजे येथील संत सावता वक्रतुंड स्वामिल च्या मालका विरोधात व सर्व जबाबदार व्यक्ति अधिकारी विरोधात फोजदारी गुन्हा दाखल करण्याबाबत', 'भोजे येथील संत सावता वक्रतुंड स्वामिल च्या मालका विरोधात व सर्व जबाबदार व्यक्ति अधिकारी विरोधात फोजदारी गुन्हा दाखल करण्याबाबत', 'वक्रतुंड स्वमिल FIR.pdf', '/uploads/complaint_files/2025-03-16/20250316181415/वक्रतुंड स्वमिल FIR.pdf', '2025-03-16 18:14:16', 1, 'SADAR COMPLAINT BABT PIMPALGAON PS CHE PSO HC/ATUL PAWAR YANA MAHITI DILI ASUN EMAIL SUDHA KELA AHE..', 21, '2025-03-16 18:27:29'),
(111, '20251112210', 'भावेश गणेश पाठक', '9405791960', 'अमळनेर', 'अमळनेर', 28, 'सायबर क्राईम', 'माझा बँक अकाउंट मधून रू. १ लाख परस्पर फसवणूक करून ऑनलाईन काढण्यात आले तरी ते रिकव्हरी करून मिळावे.', 'Police Station FIR.pdf', '/uploads/complaint_files/2025-03-17/20250317232209/Police Station FIR.pdf', '2025-03-17 23:22:10', 1, 'sadar QR cose complant babat amalner ps che pso hc kailash shinde yanna mahiti dili asun ps la email kela aahe', 21, '2025-03-17 23:46:48'),
(112, '20251125652', 'कुलदीप प्रकाश राउत', '9028812007', 'राष्ट्रमाता कॉलनी बी भडगाव रोड पाचोरा जळगाव', 'पाचोरा', 24, 'बँक खाते चेक बुक गहाळ झाले आहे', 'माझे जळगाव जनता सहकारी बँक लि शाखा पाचोरा या बँकेत असलेले बचत खात्याचे कोर्या धनादेशावर सही असलेले चेक बुक गहाळ झाले बाबत  खाते बुक क्र ०३७७०६ ते चेक क्र ०३७७३५ हे चेक बुक मी दिनांक १०/०३/२०२५ वार सोमवार रोजी सकाळी मोटरसायकल ने बँकेत असताना भुयारी मार्ग ते शिवाजी महाराज चौहुली  या दरम्यान गहाळ झाले ....चेकबुक चा गैर वापर त टाळण्यासाठी माझा तक्रारी अर्ज स्विकारण्यात यावा .', 'arj.pdf', '/uploads/complaint_files/2025-03-18/20250318145652/arj.pdf', '2025-03-18 14:56:52', 1, 'SADAR GHATNEBABAT HC 324 DILIP WANKHEDE, MOB.:- 9765739124,  YANNA MAHITI DEUN PUDHIL KARVAYI KARNE BABAT SANGITALE AAHE', 21, '2025-03-18 17:56:13'),
(113, '20251134350', 'विवेक गजानन देवकर', '9960600999', 'आदर्शनगर', 'जळगाव', 35, 'पाळधी गट नं ७६ मधील उभे पिकांची चोरी करण्यासाठी किरण नन्नवरे रा.पाळधी व असलमशेख जेऊ व त्याचा मुलगा यांनी संगनमत कृरून कट कारस्थान रचून धाक दडपशाही फसवणूक करण्ण्या हेतूने अमर बारेला याच्याकडून जबदस्तीने पुरावा नष्ट करण्याच्या हेतूने बियाणे, खते, मजुरी च्या पावत्या ताब्यात घेतली आहे. चौकशी होऊन कायद्यानुसार गुन्हा दाखल व्हावा', 'वडील श्री गजानन देवकर यांनी जळगाव न्यायालयात स्पे.दावा क्र १४० माझ्या विरूध्द  दाखल केला आहे न्यायालयात श्रीनाथ देवकर यांनी मला सुचित केले की किरण नन्नवरे व त्याचे साथीदार पाळधी गट नं ७६ मधील उभे पिक चोरण्याच्या तयारीत आहे. तू  सर्व फौजदारी तक्रारी श्री गजानन देवकर , सनिल देवकर व देवकर एक्सपोर्ट प्रा.ली या संबधित काढून घे अन्यथा गट नं ८४/१ व ८४/२ मधील पिकांची चोरी केली त्याप्रमाणे पाळधी बुद्रूक ७६ रेल्वे गेट जवळील शेतात किरण नन्नवरे व असलम शेख व त्याचा मुलगा पिक चोरणार आहेत. पिक बियाणे खते मजुरी ची बील आमर बारेला कडे आहेत .तू जर फौजदारी तक्रारी काढून घेतल्या नाहीतर परिणाम वाईट होईल अशी धमकी दिली आहे. या अगोदरच हे.काॕ.. खंडारे याना मी दि.२३/२/२०२५ सकाळी ९:४२ वा भ्रमणध्वनी वरून टेक्स संदेश केला होता याबद्दल श्री खंडारे सा यांनी चौकशी केली नाही.  तक्रारदार विवेक देवकर १८/०३/२०२५', '20250312_210605.jpg', '/uploads/complaint_files/2025-03-18/20250318204350/20250312_210605.jpg', '2025-03-18 20:43:50', 1, 'PSO HC 2181 SANDIP KHANDARE YANNA SADAR QR  COMPLAINT BADDAL MAHITI DEVUN PUDHIL YOGYA TI KARVAI KARNYAS SANGITLE AAHE', 21, '2025-03-18 21:21:03'),
(114, '20251141115', 'कल्पेश धनराज पाटील', '7507247933', 'जवखेडे', 'जवखेडे', 28, 'गाय चोरीला गेली आहे', 'नमस्कार सर आज दिनांक १९/३/२५ रोजी वावडे रोड, जवखेडे गावाजवळच्या खळ्यामधून माज्यासोबत दादाभाऊ आत्माराम पाटील यांची पण 1 गाय असे एकूण 2 जनावरे आहेत ते साधारणतः दिनांक 19/3/25 रात्री १ ते २ वाजेच्या सुमारास चोरीस गेले आहेत. आपण दखल घ्यावी ही  आपणास नम्र विनंती.', 'IMG-20250319-WA0004.jpg', '/uploads/complaint_files/2025-03-19/20250319091115/IMG-20250319-WA0004.jpg', '2025-03-19 09:11:15', 1, 'sadar amalner ps che pso hc/406 pramod patil  yanna phon karun mahiti kalavile ahe v te karwai karit ahet babat kalavile ahe', 20, '2025-03-19 10:39:45'),
(115, '20251150815', 'संजीवनी गोरखनाथ झिंगे', '9665116446', 'रूम नो. ३४ मिल चाल भडगाव रोड', 'चाळीसगाव', 19, 'माझ्या मालमत्तेचे अनधिकृत पद्धतीने पाडकाम व धमकावण्याबाबत तक्रार', 'प्रति,\r\nपोलीस निरीक्षक,\r\nपोलीस अधीक्षक कार्यालय - जळगाव,\r\nनवीन बसस्थानक समोर, जिल्हा पेठ, जळगाव, महाराष्ट्र 425001.\r\n\r\nविषय: माझ्या मालमत्तेचे अनधिकृत पद्धतीने पाडकाम व धमकावण्याबाबत तक्रार\r\n\r\nमाननीय महोदय,\r\n\r\nमी संजिवनी गोरखनाथ झिंगे, सध्या रूम नंबर -६, Sunflower Residency,नारायण बापू नगर, जेल रोड, नाशिक येथे वास्तव्यास आहे. माझ्या Room No. 34 at Ground Floor, Mill Chawl, भडगाव रोड, चाळीसगाव, जि. जळगाव या मालमत्तेवर काही अज्ञात व्यक्तींनी अनधिकृतपणे अतिक्रमण करून पाडकाम केले आहे.\r\n\r\nसदर व्यक्तींनी मला दूरध्वनीद्वारे (फोनद्वारे) संपर्क साधून या घटनेची माहिती दिली आणि मला मानसिक दबाव आणला तसेच धमकावण्याचा प्रयत्न केला.\r\n\r\nसध्या मी प्रकृती अस्वास्थ्यामुळे नाशिक येथे असल्याने घटनास्थळी उपस्थित राहू शकत नाही. माझ्या पतीच्या निधनानंतर मी एकटीच राहते आणि माझे उदरनिर्वाह केवळ अल्प निवृत्तीवेतनावर  चालते. त्यामुळे ही मालमत्ता माझ्यासाठी अत्यंत महत्त्वाची आहे.\r\n\r\nया अनधिकृत व बेकायदेशीर कृत्याची तातडीने दखल घेऊन संबंधितांवर कठोर कारवाई करावी. तसेच, माझ्या मालमत्तेचे संरक्षण करण्यात यावे व मला आवश्यक ती मदत आणि सुरक्षा पुरवावी.\r\n\r\nआपली तत्काळ मदत अपेक्षित आहे.\r\n\r\nतक्रारदार: संजिवनी गोरखनाथ झिंगे\r\nसंपर्क क्रमांक: 9665116446\r\nसध्याचा पत्ता: रूम नंबर -६, Sunflower Residency,नारायण बापू नगर, जेल रोड, नाशिक\r\nमालमत्तेचा पत्ता: Room No. 34 at Ground Floor, Mill Chawl, भडगाव रोड, चाळीसगाव, जि. जळगाव \r\nदिनांक: 16/03/2025', '', '', '2025-03-19 10:08:15', 1, 'sadar qr cod chi complent  babat chalisgaon cit ps che pso / hc /2739 eshwar patil yanna phon karun mahiti kalavile ahe v te yogy ti karwi karit aheat babat  kalavile ahe', 20, '2025-03-19 10:42:07'),
(116, '20251162942', 'कल्पेश धनराज पाटील', '7507247933', 'जवखेडे', 'जवखेडे', 28, 'गाय चोरीला गेली आहे', 'नमस्कार सर.. आज दिनांक १९/३/२०२५ रोजी पहाटेच्या 2 ते 3 वाजेच्या सुमारात वावडे रोड, जवखेडे रोडच्या लगत असलेल्या खळ्यामधून आमच्या सोबत दादाभाऊ आत्माराम पाटील यांची पण गाय चोरीस गेली असून एकूण २ जनावरे चोरी झाली आहे तरी माननीय साहेबांनी लवकरात लवकर दक्षता घेऊन सहकार्य करावे ही आपणास नम्र विनंती.', 'IMG-20250319-WA0004.jpg', '/uploads/complaint_files/2025-03-19/20250319102942/IMG-20250319-WA0004.jpg', '2025-03-19 10:29:42', 1, 'sadar amalner ps che pso hc/406 pramod patil  yanna phon karun mahiti kalavile ahe v te karwai karit ahet babat kalavile ahe', 20, '2025-03-19 10:39:18'),
(117, '20251173445', 'Aniket lekhraj badlani', '7507575272', 'Faizpur', 'Faizpur', 13, 'विषय: मारहाण, दुकानाची तोडफोड, चोरी व पोलीस निरीक्षकांकडून अन्याय', 'महाशय,\r\n\r\nमी, Aniket lekhraj badlani, राहणार sindhi colony faizpur, माझे “राजकमल मोबाईल्स” नावाचे दुकान आहे. दिनांक 05/03/2025 रोजी एक इसम माझ्या दुकानात आला आणि उधारीवर मोबाईल देण्याची मागणी केली. मी उधारी देण्यास नकार दिल्याने त्याने मला मारहाण केली, दुकानाची तोडफोड केली आणि चोरी करून पळून गेला.\r\n\r\nघटनेचा संक्षेप:\r\n	1.	आरोपीने माझ्या दुकानात येऊन उधारीवर वस्तू मागितली, मी नकार दिल्यावर त्याने माझ्यावर हल्ला केला आणि मारहाण केली.\r\n	2.	दुकानातील सामानाची तोडफोड करून टीव्ही फोडला, तसेच बाहेर ठेवलेला फ्रीज जमिनीवर आपटून तोडला.\r\n	3.	मझ्या गल्यातील  २ तोळे सोन्याची चैन चोरी करून फरार झाला.\r\n	4.	संपूर्ण घटना माझ्या दुकानातील CCTV कॅमेऱ्यात कैद झाली आहे.\r\n\r\nमी फैजपूर पोलीस ठाण्यात तक्रार दाखल करण्यासाठी गेलो असता, पोलीस निरीक्षक रमेश्वर दगडूजी मोटाळे यांनी राजकीय दबावाखाली माझ्यावर तक्रार मागे घेण्यासाठी दबाव टाकला. तसेच, ते नेहमी पोलीस ठाण्यात उपस्थित नसतात, त्यामुळे माझ्या तक्रारीची दखल घेतली जात नाही.\r\n\r\nमाझ्या मागण्या:\r\n	1.	या घटनेचा FIR त्वरित दाखल करण्यात यावा.\r\n	2.	CCTV फुटेजच्या आधारे आरोपीवर कठोर कारवाई करण्यात यावी.\r\n	3.	पोलीस निरीक्षक रमेश्वर दगडूजी मोटाळे यांच्यावर कर्तव्यचुकारपणाचा आरोप ठेवून योग्य चौकशी करण्यात यावी.\r\n\r\nमी आपल्याला विनंती करतो की, या संपूर्ण प्रकरणाची योग्य चौकशी करून मला न्याय द्यावा.\r\n\r\nआपला विश्वासू,\r\nअनिकेत लेखराज बदलनी \r\n7507575272\r\naniketbadlani6161@gmail.com', 'C9C2DABD-42EE-4A28-99EA-58964F9EEAC4.jpeg', '/uploads/complaint_files/2025-03-19/20250319113445/C9C2DABD-42EE-4A28-99EA-58964F9EEAC4.jpeg', '2025-03-19 11:34:45', 1, 'sadar QR cod comlent  babat faizpur ps che pso hc/ 2186 dhyneshwar  chawdhari  yanna phon karun  mahiti kalavile ahe v te yogy ti karwai karit ahet babat kalaavile ahe', 20, '2025-03-19 11:58:40'),
(118, '20251183335', 'विनोद सपकाळे', '9823755226', 'जुने जळगाव', 'जळगाव', 1, 'व्यजनी पेस्से घेतले', 'व्यजनी पेस्से घेतले शनिपेठ पोलीस ला गेले असता त्यानी कॅपलेट नाही घेत नाही', '', '', '2025-03-19 15:33:35', 1, 'sadar ghante baddal shanipeth ps che LHC 2918/ pratibha patil yanna vicharle asta tyani kalvile ki caller he ps la aahe.hote v,te mhanale ki aamche khajgi prakaran aslyane aamhi notri karit aahe.aamhi takrar karit nahi.', 21, '2025-03-19 16:53:19'),
(119, '20251194416', 'Nilesh Namdeo Ubhale', '8329984521', 'Bhoje', 'Bhoje', 25, 'प्रथम खबर रिपोर्ट FIR दाखल करण्याबाबत', 'वन परिक्षेत्र अधिकारी पाचोरा, वनपाल नांन्द्रा,भोजे येथील वक्रतुंड स्वामिल मालक गणेश भिका पाटिल व अन्य सर्व जबाबदारव्यक्ति,अधिकारी विरोधात  फोजदारी गुन्हा दाखल करण्याबाबत', 'अपील फाइनल पोलिस वक्रतुंड Swamil.pdf', '/uploads/complaint_files/2025-03-19/20250319194416/अपील फाइनल पोलिस वक्रतुंड Swamil.pdf', '2025-03-19 19:44:16', 1, 'SADAR QR CODE TAKRAR BABAT PIMOALGAON PS CHE PSO ASI/ ARVIND MORE YANNA MAHITI DILI ASUN PIMPALGAON PS CHE GMAIL VAR MAHITI PATHAVLELI AAHE', 21, '2025-03-19 19:55:21'),
(120, '20251202835', 'विवेक गजानन देवकर', '9960600999', 'आदर्शनगर', 'जळगाव', 1, 'पाळधी गट नं ७६ मधील उभे पिकांची चोरी करण्यासाठी किरण नन्नवरे रा.पाळधी व असलमशेख जेऊ व त्याचा मुलगा यांनी संगनमत कृरून कट कारस्थान रचून धाक दडपशाही फसवणूक करण्ण्या हेतूने अमर बारेला याच्याकडून जबदस्तीने पुरावा नष्ट करण्याच्या हेतूने बियाणे, खते, मजुरी च्या पावत्या ताब्यात घेतली आहे. चौकशी होऊन कायद्यानुसार गुन्हा दाखल व्हावा', 'मी विवेक गजानन देवकर वय ६२ दि. १७/०२/२५ जळगाव न्यायालयात श्री गजानन देवकर यांनी माझ्या विरोधात दाखल केलेला स्पे. दिवाणी दावा क्र.१४० ची सुनावणी कोर्ट ५वे सिव्हिल जज सिनियर डिव्हीजन येथे सुनावणी होती. जज साहेब रजेवर असल्यामुळे मी उपस्थिती नोंद करून बाहेर आल्यावर भाऊ श्रीनाथ देवकर व सनील देवकर यांनी मला जळगाव फौजदारी न्यायालयात दाखल असलेल्या स्त्रीधन बद्दल चा दावा माझी पत्नी रूपा देवकर हिचा असलेला फौजदारी दावा , देवकर एक्सपोर्ट प्रा. ली जळगाव ची जबरदस्तीने अमलात आणलेला माझ्या सदनिका क्र १७२ मुंबईत बाबत वर्ष २०१७ चा भाडेकरारनामा बाबत ची तक्रार कफपरेड पोलीस ठाणे व सदनिका क्र १७२ बनावट दस्तऐवज तयार करण्यात आल्या बद्ल ची तक्रार तसेच सदर कंपनीने माझी फसवणूकी बद्दलचे तक्रारी/फौजदारी दावे जळगाव व मुंबई येथून काढून घेण्यासाठी माझ्या पाळधी येथील गट नं ८४/१ व ८४/२ मधील गव्हाचे पीक किरणा नन्नवरे व त्यांचे साथीदार असलम शेख व त्याचा मुलगा यांच्यामार्फत ८४/१ मधील विहीरीवरून इलेक्ट्रिक पंपाची चोरी मी केली अशी खोटी पाळधी दूरक्षेत्र पाळधी ता.धरणगाव तक्रार करून गव्हाचे उभे गव्हाचे पीक चोरून घेतले व तसेच गट नं ७६ पाळधी बुद्रूक येथील कांदे , गहू कपाशी पिकाची चोरी त्याच प्रमाणे करण्यात येईल तसेच तू जर तक्रारी काढून घेतल्या नाहीतर वाईट परिणाम होईल अशी धमकी जळगाव न्यायालयात दिली. मी आज दि.१९ वार बुधवार माझ्या शेतात गेलो असता किरण नन्नवरे चा साथीदार असलम शेख जेबूर शेख व त्याचा मुलगा रा. नग्मा काॕलनी मशिदी जवळ पाळधी मो. ९०४९८२३१२९ यांनी मला गट नं ७६ मध्ये श्रीनाथ व गजानन देवकर यांच्या सांगण्यावरून मला शेतात येण्यासाठी रोखले आलास तर बघतो जीवे मारण्याची धमकी असलम शेख व मुलगा नाव माहीत नाही यांनी दिली. तक्रार पाळधी येथे दिली होती पण घटना जळगाव न्यायालयात घडल्यामुळे जळगाव शहर पोलीस ठाणे जळगाव येथे देत आहे.   तक्रारदार विवेक देवकर दि.१९/०३/२०२५', '20250312_210605.jpg', '/uploads/complaint_files/2025-03-19/20250319202835/20250312_210605.jpg', '2025-03-19 20:28:35', 1, 'SDAR TAKRAR BABAT JALGAON CITY PS CHE PSO ASI/854 SANJAY ZALTE MOB- 9665773463 YANA CALL KARUN MAHITI DILI AAHE TASECH JALGAON CITY PS EMAIL ID VAR PATHAVILI AAHE KARITA NOND', 21, '2025-03-19 21:27:39'),
