(125, '20251250246', 'विवेक गजानन देवकर', '9960600999', 'आदर्शनगर', 'जळगाव', 35, 'पाळधी गट नं ७६ मधील पांढऱ्या कांद्याचे उभे पीक, कपाशी, गव्हाचे उभे पीक असलम शेख व त्याचा मुलगा जबरदस्ती काढून घेणार याबद्दल ची सुचना श्री श्रीनाथ देवकर व सनिल देवकर यांनी जळगावला न्यायालयात दि. १७/०3/ २०२५ च्या सुनावणी च्या दिवशी दिली.    ,', 'मी जळगाव शहर पोलीस ठाणे जळगाव येधे तक्रार क्र २०२५१२०२८३५ दि. १९/०३/२०२५ दिलेली आहे. त्यानुसार श्री  श्रीनाथ देवकर व त्याचा मुलगा सनील यांनी आधीच सुचित केले की असलम शेख व त्याचा मुलगा किरण नन्नवरे यांच्या मदतीने गट नं ७६ मधील पांढऱ्या कांद्याचे उभे पीक , गव्हाचे पीक व कपाशी माझे नुकसान करण्याच्या हेतूने चोरून नेणार आहेत. सदर शेत माझ्या व माझा भाऊ मुंबईला राहात असलेला श्री विनोदचंद्र गजानन देवकर यांच्या नावावर आहे.  दि. १९/०३/२०२५ मी गट नं ७६ मध्ये जात असताना रस्त्यात   असलमशेख व त्याचा मुलगा यांनी श्री श्रीनाथ देवकर यांच्या सांगण्यावरून शेतात जाण्यापासून रोखले. बियाणे , पावत्या खत संबधी बील श्रीनाथ देवकर यांचेकडे आहेत रागाने सांगितले. ही घटना पाळधी येथे घडली       तक्रारदार विवेक देवकर', '20250312_210605.jpg', '/uploads/complaint_files/2025-03-21/20250321150246/20250312_210605.jpg', '2025-03-21 15:02:46', 1, 'PC 492 DYANESHAWAR SONVANE PALDHI OP YANA MAHITI DILI AHE', 20, '2025-03-21 15:52:10'),
