(127, '20251270812', 'Tulsabai Dayaram Rathod', '9766047266', 'Varsada Tanda Number 1', 'Varsade Tanda', 25, 'आपले सरकार पोर्टल वरील तक्रार शाखा अधिकारी जळगाव जिल्हा स्तरावर आदेश पारित करावे', 'आम्हाला मानसिक त्रास देण्यासाठी पोलिस स्टेशन ला बोलउन बसउन ठेवत आहेत- पिंपळगाव हरे पोलिस तपास योग्य करीत नाही,तपास स्थानिक गुन्हा शाखा(एल.सी.बी.) जळगाव कड़े द्यावा- मी जिल्हाधिकारी कार्यकाळ जळगाव येथे आमरण उपोषण सुरु करणार आहे. माझ्या मुलीची ,माझ्या जिवितास हानी झाली असता सर्वस्वी जबाबदारी ही जळगाव जिल्हा पोलिस प्रशासन ची असणार. FIR-००९ पिंपळगाव हरे. पोलिस स्टे.', '1 तक्रारीचा मागोवा घ्या.pdf', '/uploads/complaint_files/2025-03-21/20250321210812/1 तक्रारीचा मागोवा घ्या.pdf', '2025-03-21 21:08:12', 1, 'SADAR QR CODE COMPLANT BABAT PIMPALGAON PS CHE PSO HC 1833 SHAILESH CHAVHAN YANNA MAHITI DILI AAHE BABAT NOND', 20, '2025-03-21 21:17:13'),
(128, '20251280932', 'Tulsabai Dayaram Rathod', '9766047266', 'Varsada Tanda Number 1', 'Varsade Tanda', 25, 'आपले सरकार पोर्टल वरील तक्रार शाखा अधिकारी जळगाव जिल्हा स्तरावर आदेश पारित करावे', 'आम्हाला मानसिक त्रास देण्यासाठी पोलिस स्टेशन ला बोलउन बसउन ठेवत आहेत- फिर्याद पिंपळगाव हरे पोलिस स्टेशन येथे माझी फिर्याद नुसार फोजदारी गुन्हा दाखल करीत नाहित म्हणून पिंपळगाव हरे पोलिस स्टेशन विरोधात मा. जिल्हाधिकारी जळगाव येथे आमरण उपोषण सुरु करणार आहे. फिर्याद नुसार पिंपळगाव हरे पोलिस स्टेशन येथे फोजदारी गुन्हा दाखल करण्याचे आदेश व्हावेत.', '2.pdf', '/uploads/complaint_files/2025-03-21/20250321210932/2.pdf', '2025-03-21 21:09:32', 1, 'SADAR QR CODE COMPLANT BABAT PIMPALGAON PS CHE PSO HC 1833 SHAILESH CHAVHAN YANNA MAHITI DILI AAHE BABAT NOND', 20, '2025-03-21 21:16:55'),
