(131, '20251314827', 'Tulsabai Dayaram Rathod', '9766047266', 'Varsada Tanda Number 1', 'Varsade Tanda', 25, 'Maharashtra State Commisssion for Women Bandr', 'Maharashtra State Commisssion for Women Bandra यांनी घेतलेली दाखल- मी जिल्हाधिकारी कार्यकाळ जळगाव येथे आमरण उपोषण सुरु करणार आहे. माझ्या मुलीची ,माझ्या जिवितास हानी झाली असता सर्वस्वी जबाबदारी ही जळगाव जिल्हा पोलिस प्रशासन ची असणार. FIR-००९ पिंपळगाव हरे. पोलिस स्टे.', 'GMAILA~1.PDF', '/uploads/complaint_files/2025-03-21/20250321214827/GMAILA~1.PDF', '2025-03-21 21:48:27', 1, 'SADAR QR CODE COMPLANT BABAT PIMPALGAON PS CHE PSO HC 1833 SHAILESH CHAVHAN YANNA MAHITI DILI AAHE BABAT NOND', 20, '2025-03-21 21:55:46'),
