(135, '20251354053', 'विजय राजाराम भिरुड', '9422776172', '३२ विद्या नगर जळगाव', 'जळगाव', 5, 'खरेदीखत हरविल्याबाबत', 'मी वरील ठिकाणी राहात असून माझेकडील ओरिजनल कागदपत्रे खरेदीखत दस्त क्र. 1189, 1190 CTS no. 2117/8 घर क्र. 207 नवीपेठ, जळगाव शहर येथील असलेले खरेदीखत हे माझे कडून दि.  02/10/2011 रोजी रिंगरोड कडून जात असताना हरविले आहे. तरी सदर कागदपत्रांचा शोध घेतला असता मला आढळून आले नाही. त्यामुळे मी ही तक्रार नोंदवत आहे', 'original kharedi(2)navi peth.pdf', '/uploads/complaint_files/2025-03-23/20250323194053/original kharedi(2)navi peth.pdf', '2025-03-23 19:40:53', 1, 'sadar QR CODE COMPLANT BABAT RAMANAND PS CHEWHC GAYKWAD YANNA MAHITI DILI AAHE', 21, '2025-03-23 20:11:10'),
(136, '20251365748', 'Aniket lekhraj badlani', '7507575272', 'Faizpur', 'Faizpur', 13, 'No FIR TAKEN AND INSPECTOR RAMESHWAR  MOTHADE UNDER POLITICAL PRESURE THIS IS MY 3rd QR CODE COMPLAINT STRICT ACTION TO BE TAKEN URGENTLY', 'महाशय,\r\n\r\nमी, Aniket lekhraj badlani, राहणार sindhi colony faizpur, माझे “राजकमल मोबाईल्स” नावाचे दुकान आहे. दिनांक 05/03/2025 रोजी एक इसम माझ्या दुकानात आला आणि उधारीवर मोबाईल देण्याची मागणी केली. मी उधारी देण्यास नकार दिल्याने त्याने मला मारहाण केली, दुकानाची तोडफोड केली आणि चोरी करून पळून गेला.\r\n\r\nघटनेचा संक्षेप:\r\n	1.	आरोपीने माझ्या दुकानात येऊन उधारीवर वस्तू मागितली, मी नकार दिल्यावर त्याने माझ्यावर हल्ला केला आणि मारहाण केली.\r\n	2.	दुकानातील सामानाची तोडफोड करून टीव्ही फोडला, तसेच बाहेर ठेवलेला फ्रीज जमिनीवर आपटून तोडला.\r\n	3.	मझ्या गल्यातील  २ तोळे सोन्याची चैन चोरी करून फरार झाला.\r\n	4.	संपूर्ण घटना माझ्या दुकानातील CCTV कॅमेऱ्यात कैद झाली आहे.\r\n\r\nमी फैजपूर पोलीस ठाण्यात तक्रार दाखल करण्यासाठी गेलो असता, पोलीस निरीक्षक रमेश्वर दगडूजी मोटाळे यांनी राजकीय दबावाखाली माझ्यावर तक्रार मागे घेण्यासाठी दबाव टाकला. तसेच, ते नेहमी पोलीस ठाण्यात उपस्थित नसतात, त्यामुळे माझ्या तक्रारीची दखल घेतली जात नाही.\r\n\r\nमाझ्या मागण्या:\r\n	1.	या घटनेचा FIR त्वरित दाखल करण्यात यावा.\r\n	2.	CCTV फुटेजच्या आधारे आरोपीवर कठोर कारवाई करण्यात यावी.\r\n	3.	पोलीस निरीक्षक रमेश्वर दगडूजी मोटाळे यांच्यावर कर्तव्यचुकारपणाचा आरोप ठेवून योग्य चौकशी करण्यात यावी.\r\n\r\nमी आपल्याला विनंती करतो की, या संपूर्ण प्रकरणाची योग्य चौकशी करून मला न्याय द्यावा.\r\n\r\nआपला विश्वासू,\r\nअनिकेत लेखराज बदलनी \r\n7507575272\r\naniketbadlani6161@gmail.com', '', '', '2025-03-24 10:57:48', 1, 'SADAR QR CODE COMPLANT FAIJPUR PC CHE ASI 2613 PRABHAKAR CHAUDHARY YANNA MAHITI DILI AAHE V PS LA EMAIL SEND KELA AAHE', 20, '2025-03-24 12:31:40'),
(137, '20251371348', NULL, NULL, 'भुसावळ', 'भुसावळ', 8, 'रस्त्यामध्ये दुकाने लावून बॅरिगेट्स लावून घराकडे जाण्याचा मार्ग बंद करणे', 'खडका रोड या भागात मोठ्या प्रमाणात रस्त्यावर दुकाने लावण्यात आलेली आहे त्यामुळे घरी जाण्याचा लाल बिल्डिंग जोडून जाण्याचा मार्ग बेरिगेट लावून बंद करण्यात आलेला आहे व तेथे असलेले नागरिक दुसऱ्या रस्त्याने जाण्याच्या सूचना देत आहेत बाजारपेठणे परवानगी दिल्याचे ते सांगत आहे', '', '', '2025-03-24 20:13:48', 1, 'IMFORMED TO BHUSAWAL BAZRPETH PSO PRASHANT DESHMUKH', 21, '2025-03-24 20:55:51'),
(138, '20251381801', NULL, NULL, 'भुसावळ', 'bhusawal', 8, 'रस्त्यात बॅरिगेट लावून घरी जाण्याचा मार्ग बंद करून दुसऱ्या मार्गाने जाण्याचे सूचना करणे सर्वसामान्य नागरिकांना रस्ता बंद करणे', 'खडका रोड येथे अमरदीप चौक पासून रजा टावर रजा टावर पासून बजाज बिल्डिंग पर्यंत रस्त्याच्या दोन्ही तर्फे दुकाने लावण्यात आलेली आहे यामुळे रस्त्यावर चांगले मुश्किल झालेले आहेत त्यामुळे वाहतूक शाखेचे बॅरिकेट सर्वसामान्य नागरिक त्या ठिकाणी लावत आहे व या भागात राहणाऱ्या नागरिकांना त्यांच्या घरी जाण्यासाठी रस्ता मिळत नाहीये त्यामुळे त्यांना दुसऱ्या रस्त्याने फिरून जावे लागत आहे या अडचणींचा सामना करावा लागत आहे त्यांना कोणी विचारले ते बाजारपेठ ने परवानगी दिल्याचे ते सांगतात योग्य ती कारवाई करावी यांना खरीच परवानगी देण्यात आलेली आहे का रस्ता बंद करण्याची दुकाने लावण्याची', '', '', '2025-03-24 20:18:01', 1, 'IMFORMED TO BHUSAWAL BAZRPETH PSO PRASHANT DESHMUKH', 21, '2025-03-24 20:55:57'),
(139, '20251393341', 'भागवत हिलाल पाटील', '9158202025', 'कठोरा', 'चोपडा', 33, 'दाखलपात्र गुन्हा अतिक्रमण आणि गृह अतिक्रमण करणे', 'गजेंद्र युवराज सूर्यवंशी, युवराज तुळशीराम सूर्यवंशी व आणखीन ३ ते ४ व्यक्ती फिर्यादी चे घरात जबरदस्तीने प्रवेश केला व फिर्यादीस शिवीगाळ केली तसेच कुख्यात गुन्हेगार गजेंद्र युवराज सूर्यवंशी याने फिर्यादीस त्याचे जवळील पिस्टोल (बंदूक) फिर्यादीचे डोक्याला लावण्याचा प्रयत्न केला. तसेच भूमिका निवृत्ती पाटील हिने फिर्यादी व त्याचे परिवारावर खोट्या केसेस करण्याच्या धमक्या दिल्या व सुसाईड नोट मध्ये त्यांची नावे टाकण्याची धमकी दिली', 'Screenshot_20250324_203244_Drive.jpg', '/uploads/complaint_files/2025-03-24/20250324203341/Screenshot_20250324_203244_Drive.jpg', '2025-03-24 20:33:41', 1, 'IMFORMED TO CHOPADA RURAL PSO KOLI', 21, '2025-03-24 20:59:40'),
(140, '20251403545', 'हरिष संजय फिरके', '8484902191', 'नारायण हाउसिंग सोसायटी, नंदनवन कॉलोनी', 'भुसावळ', 8, 'पाकीट (wallet) हरविले बाबत तक्रार', 'माझे पाकीट (wallet) सोमवार दिनांक २४-मार्च-२०५ रोजी सायंकाळी 7 ते 7:३० वाजेच्या दरम्यान सावदा येथे लग्न मिरवणुकीत हरविले आहे. पाकिटात (wallet मध्ये) माझे डॉक्युमेंट जसे आधार कार्ड, पॅन कार्ड, ड्रायव्हिंग लायसन्स, २ डेबिट कार्ड, २ क्रेडिट कार्ड, ₹-७०० रोख हरवले आहे. तरी माझ्या पाकीट (wallet) आणि वरील नमूद डॉक्युमेंट हरविण्याच्या तक्रारीची नोंद करावी अशी विनंती.', '', '', '2025-03-25 11:35:45', 1, 'sadr takrari babat pso hc 956 magarkhan pthan yana caler bababt sampurn mahiti dili ahe', 21, '2025-03-25 11:54:54'),
