(142, '20251420111', 'Jayprakash Ratilal Jain', '9422775310', 'Pimplagaon Hare', 'Pimpalgaon bk', 25, 'DYSP पाचोरा यांचा दी.१९.3.२०२५ रोजीचे चुकीचे आदेश केलेले आहे', 'DYSP पाचोरा यांचा दी.१९.3.२०२५ रोजीचे चुकीचे आदेश केलेले आहे सर्व मुद्दे नुसार अहवाल नसतानी बेकायदेशीर पदाचा दुरूपयोग करुण अहवाल सादर पोलिस अधिक्षक यांना सादर केलेले आहे,तसेच शाखा अधिकारी जिल्हा स्तरावर सर्व मुद्दे नुसार अहवाल सादर करुण चौकशी ही LCB जळगाव यांच्या कड़े न पाठवता DYSP पाचोरा यानी त्यांच्या स्तरावर आपले सरकार पोर्टल टोकन निकाली काढून कर्तव्य कसूर केलेले आहे ते BNS २०२३ चे कलम १९८,223 प्रमाने गुन्हा आहे, \r\nतसेच आपले सरकार पोर्टल शासन निर्णय क्र.संकीर्ण-२०१६/प्र.क्र.१३०/१८(र. व का.) दी.२४ औगष्ट २०१६ मधील ब(5) नुसार Additional SP jalgaon aaple sarkar Nodal Officer -Complaint against API Kale and शाखा ऑफिसर आपले सरकार पोर्टल हे शाखा अधिकारी स्तरावर सर्व मुद्दे निहाय निराकरण करने न्यायिक होते परन्तु एपीआई काले याने त्याच्या स्तरावर मुद्दे निहाय अहवाल दिलेला नाही ,आपले सरकार पोर्टल टोकन शाखा स्तरावर', '11zon_merged-PDF (7).pdf', '/uploads/complaint_files/2025-03-26/20250326130111/11zon_merged-PDF (7).pdf', '2025-03-26 13:01:11', 1, 'SADAR TAKRAR BABAT PIMPALGAON PS CHE PSO ASI/ARVIND MORE YANA MAHITI DILI ASUN EMAIL KELA AHE..', 21, '2025-03-26 13:35:40'),
(143, '20251431909', 'ANAVAR RAFIKSHAHA FAKIR', '9595476876', 'VASAI ROAD', 'susari', 17, 'लेखी फिर्याद वरंगाव पोलिस स्टेशन', 'SP जळगाव यांचा दी.१७ .3.२०२५ रोजीचे चुकीचे आदेश केलेले आहे, लेखी फिर्याद वरंगाव पोलिस स्टेशन येथील असून फोजदारी गुन्हा दाखल करुण आपले सरकार पोर्टल नोडल अधिकारी शाखा अधिकारी यांच्या स्तरावर निकली काढ़ने न्यायिक असुन देखिल SP जलगाव यांनी त्यांच्या स्तरावर आपले सरकार पोर्टल टोकन निकाली काढून कर्तव्य कसूर केलेले आहे ते BNS 2023 चे कलम 198,223 प्रमाने गुन्हा आहे,\r\nInbox', 'फिर्याद प्रमाने गुन्हा दाखल केला नाही शाखा अधिकारी स्तरावर निराकरण नाही.pdf', '/uploads/complaint_files/2025-03-26/20250326131909/फिर्याद प्रमाने गुन्हा दाखल केला नाही शाखा अधिकारी स्तरावर निराकरण नाही.pdf', '2025-03-26 13:19:09', 1, 'SADAR TAKRAR BABAT VARANGAO PS CHE PSO HC/24 PREMCHAND SAPKALE YANA MAHITI DILI ASUN EMAIL KELA AHE..', 21, '2025-03-26 13:34:57'),
(144, '20251441135', 'यासिन तांबोळी', '9284244104', 'तरवडे बु . चाळीसगाव', 'तरवाड़े', 20, 'सायबर क्राइम', 'क्रिप्टो करेंसी च्या नवाने माझ्या कदून 10000 रुपए मांगिटले आनी माला पैसे डबल करुण दयचे म्हानुन्न माझे पैसे घेउन्न माला ब्लॉक केले आनी माझ्या सोबत 10000 चा घोटाला केला. 8690256655 हा तयाचा नंबर आहे', 'Screenshot_20250326-171013.PhonePe.png', '/uploads/complaint_files/2025-03-26/20250326171135/Screenshot_20250326-171013.PhonePe.png', '2025-03-26 17:11:35', 1, 'sdar takrar babat chalisgaon rural ps che pso yana mahiti dili aahe karita nond', 21, '2025-03-26 17:40:06'),
(145, '20251453728', 'उर्वशा अशोक पाटील', '7020153296', 'घोडगाव', 'चोपडा', 33, 'मार्कशीट एफ वाय बी ए', 'माझे फर्स्ट इयर्स आर्टस् मार्क शीट हरवले आहे', '20250326_183504.mp4', '/uploads/complaint_files/2025-03-26/20250326183727/20250326_183504.mp4', '2025-03-26 18:37:27', 1, 'sadar takrar babat chopda rural ps che PSO NPC/ NITIN NANNVARE YANA MAHITI DILI AAHE KARITA NOND', 21, '2025-03-26 19:36:41'),
(146, '20251460903', 'विवेक गजानन देवकर', '9960600999', 'आदर्शनगर', 'जळगाव', 35, 'विवेक गजानन देवकर व विनोदचंद्र गजानन देवकर रा.मुंबई  यांची पाळधी बुद्रूक गट नं ७६ मधील उभे पिक किरण नन्नवरे ची गुंड माणूस चोरून नेणार आहे .', 'विवेक गजानन देवकर व विनोदचंद्र गजानन देवकर रा.मुंबई यांच्या मालकीहक्क असलेली पाळधी बुद्रूक गट नं ७६ ची खरेदी वडिलोपार्जित अंशिक वाटणी झालेल्या उत्पन्नाच्या मिळकती तून खरेदी झालेली आहे. त्यामधील पेरणी आमच्या शेतातील रखवालदार/ मजूर अमर बारेला यांच्याकडून पांढरा कांदा , कपाशी, गहू ची पेरणी करून घेतली होती. तसेच अमर बारेला श्री श्रीनाथ देवकर यांच्या स्वतःच्या मालकीहक्क असलेल्या शेताची पेरणी करत होता. या तिन्ही शेतांचा हिशोब श्री श्रीनाथ देवकर कडेच होता व अमर बारेला चा पगार ही श्री श्रीनाथ देवकर देत होते व मजूरीसह अमर बारेला याने फसवणूक केल्यामुळे अमर बारेला याला श्रीनाथ देवकर यांनी काढून टाकले. आमर बारेला कडून काही हिशोबाचे कागदपत्रे किरण नन्नवरे व असलमशेख जेऊ शेख चा मुलगा याने धमकी देऊन काढून घेतले. मी जळगाव शहर पोलीस स्टेशनला तक्रार क्र २०२५१२०२८३५  दि.१९/०३/२०२५ वेळ २०.२८.३५ दिलेली आहे. ती सोबत देत आहे. मला सुचना मिळाल्याप्माणे किरण नन्नवरे व त्याचा गुंड साथीदार असलमशेख गट नं ७६ मधील उभे पांढरा कांद्याचे पिक गहू व कपाशी चोरणार आहे. त्याबद्दल योग्य ती कारवाई करावी ही विनंती. माझ्या गट नं मधील ८४/१ व ८४/२ मधील उभे गव्हाचे पिक किरण नन्नवरे व असलम शेख व त्याचा मुलगा याने माझ्या शेतातील गट नः ८४/१ मधील विहीरीवरून इलेक्ट्रिक पंप मी चोरला अशी तक्रार हे.काॕ. खंडारे यांच्याकडे दिली होती. मी १९/०३/२५ वार बुधवार गेलो असता मला शेतात असलम शेख जेऊ शेख व त्याच्या मुलाने शेतातील बांधावर अडवले व मला किरण नन्नवरे माझ्यावर अट्राॕसिटीची तक्रार करेल व मला अडचणीत आणेल व परत शेतात आला तर वाईट परिणाम होईल अशी धमकी दिली. योग्य ती कारवाई करावी ही विनंती करत आहे. तक्रारदार विवेक देवकर', 'Complaint Jalgaon city .pdf', '/uploads/complaint_files/2025-03-26/20250326210903/Complaint Jalgaon city .pdf', '2025-03-26 21:09:03', 1, 'SADAR TAKRAR BABAT DHARANGAON PS CHE PSO HC/2907 ISHWAR SHINDE YANA MAHITI DEVUN DHARANGAON PS LA EMAIL KELA AHE..', 21, '2025-03-26 22:03:24'),
