(149, '20251490323', 'RAHUL SUNIL PAYGHAN', '7020787758', 'SAVDA TAL RAVER DIST JALGAON', 'SAVDA', 18, 'FIR REGARDING LOST OF DOCUMENTS', 'LOST MY DL MH37 20170001642 AND RC BOOK OF VEHICLE 25BH 6657A ON 25/03/2025 AT NEW MAHINDRA DHABA SAVDA', 'scan Mar 30, 2025.pdf', '/uploads/complaint_files/2025-03-30/20250330150323/scan Mar 30, 2025.pdf', '2025-03-30 15:03:23', 1, 'SADAR QR CODE TAKRAR BABAT SAVDA PS CHE PSO HC/1239 UMESH PATIL YANNA MAHITI DILI AAHE V PUDHIL KARYAVAHI KARNE BABAT KALVILE AAHE', 21, '2025-03-30 15:20:29'),
(150, '20251503859', 'विवेक गजानन देवकर', '९९६०६००९९९', 'आदर्शनगर', 'जळगाव', 35, 'पाळधी बुद्रूक गट नं ७६ मधील पिकाची चोरी किरण नन्नवरे व असलमशेख जेऊरशेख व त्याचा मुलगा अशपाक यांनी  आग लावून नष्ट केले.', 'मला जळगाव न्यायालयात श्री श्रीनाथ देवकर व सनील देवकर यांनी सुचित केले की किरण नन्नवरे असलमशेख जेऊ शेख व त्याचा मुलगा अशपाक यांनी गट नं ७६ मधील पिकाची चोरी केली आहे. मी दि.४ एप्रिल रोजी शेतात गेलो असता गव्हाचे पिक आग लावून नष्ट केले होते व कापूस चोरून नेला होता. मी पाळधी दूरक्षेत्र पोलीस ठाणे पाळधी येथे लेखी तक्रार हे.काॕ.विठ्ठल पाटील यांच्याकडे दिली आहे. पण दुसऱ्या प्रतीवर सही केली नाही. ते माझ्यासोबत येऊन गट नं ७६ येथे येऊन फोटो काढले आम्ही चौकशी करून तुम्हाला पोलीस स्टेशला यायला सांगतो. ताबडतोब गुन्हा दाखल व्हावा पांढरा कांद्याचे पिक तयार परिस्थितीत आहे अन्यथा ते चोरी होऊ शकते. २ तारखेला पोलीस अधिक्षक जळगाव यांच्याकडे तक्रार केली होती. तक्रारदार विवेक देवकर', '20250404_184334.jpg', '/uploads/complaint_files/2025-04-08/20250408003859/20250404_184334.jpg', '2025-04-08 00:38:59', 1, 'sadar qr code takrar hi dharngaon ps yanchya email var pathavleli aahe', 20, '2025-04-08 01:01:01');
INSERT INTO `complaints` (`CMP_ID`, `CMP_Track_ID`, `CMP_Name`, `CMP_Mobile`, `CMP_Area`, `CMP_Town`, `CMP_PS_ID`, `CMP_Nature`, `CMP_Brief`, `CMP_File_Name`, `CMP_File_Path`, `CMP_Added_On`, `CMP_Status`, `CMP_Resolved_Remark`, `CMP_Resolved_By`, `CMP_Resolved_On`) VALUES
(151, '20251515121', 'विवेक गजानन देवकर', '९९६०६००९९९', 'आदर्शनगर', 'जळगाव', 1, 'जळगाव न्यायालयात श्री गजानन देवकर यांच्या मार्फत श्रीनाथ व सनिल यांनी धमकी दिली.', 'पोलीस निरीक्षक सा.\r\nजळगाव शहर पोलीस स्टेशन जळगाव\r\nनवी पेठ, जळगाव \r\n03/04/2025\r\n\r\nमी शहर पोलीस स्टेशनला आलो मला समजले की दि.03/04/2025 चा वेळ 18:47 वाजता केलेला इमेल मिळाला नाही म्हणून परत पाठवीत आहे.माझ्या  तक्रार अर्जाची चौकशी संगीता खांडरे मॕडम पोलीस अधिकारी करत आहे.\r\nमी विवेक गजानन देवकर, वय 62 ,रा. प्रतिक अपार्टमेंट फ्लॅट नं 1 व 2, आदर्शनगर जळगाव .\r\nआज परत  दि.03/04/2025  जळगाव न्यायालयात वडील श्री. गजानन देवकर यांनी माझ्या विरोधात दाखल केलेला स्पे.दिवाणी दावा क्र.140 ची सुनावणी कोर्ट 5वे सिव्हिल जज सिनियर डिव्हीजन येथे होती. मी दाखल केलेल्या अर्जाचा निकालाबद्दल सुनावणी होती. मी माझी मे.न्यायालयात उपस्थिती दाखवून बाहेर आल्यावर माझा भाऊ श्री.श्रीनाथ देवकर व त्याचा मुलगा श्री. सनिल दिसले व रागाने मला बोलावून सांगितले की श्री. गजानन देवकर(वडील) श्रीनाथ देवकर व त्याचा मुलगा , सनिल देवकर यांच्यावरील पोलीस तक्रारी काढून घे. माझी पत्नी रूपा हिचे दागिन्या (स्त्रीधन )ची फौजदारी न्यायालयात दाखल असलेली फौजदारी किरकोळ अर्ज क्र. 102/2021 व देवकर एक्सपोर्ट प्रा.ली. कंपनीची च्या संदर्भातील फौजदारी जळगाव न्यायालयात दाखल असलेले फौ.अपील क्र. 80/2021 तसेच दिवाणी दावा क्र. 252/2023 व तुझी मुंबईतील सदनिका क्र. 172 चा भाडे करारनामा, उपनिबंधक सहकारी संस्था A विभाग मुंबई येथे केलेल्या तक्रारी , सदनिका क्र 172 संबंधातील शेअर्स सर्टिफिकेट फसवणूकी च्या बद्दल केलेल्या सर्व कफ परेड पोलीस स्टेशन मुंबई येथील तक्रारी, लासलगाव जि.नाशिक च्या गट नं 295 जागे संबधी सर्वच पोलीस तक्रारी व जळगाव न्यायालयात दाखल केलेले दावे इ. सर्व काढून घे ,असे श्री. गजानन देवकर यांनी श्रीनाथ कडून मला परिणाम वाईट होतील अशी जहरी धमकी देण्यात आली आहे. सर्व दावे काढले गेले तरच स्पे.दावा 140 प्रतिक अपार्टमेंट फ्लॅट नं 1 व 2 जळगावतील दावा काढून घेतला जाईल, अन्यथा तुला पाळधी बुद्रूक व खूर्द येथील शेतावर किरण नन्नवरे ची माणसे असलमशेख व त्याचा मुलगा निरनिराळ्या प्रकारच्या तक्रारी किंवा नुकसान करून हैराण करतील .तु पेरलेल्या शेतातील उभे तयार पीक कापून घेऊन जातील, तु सदनिका क्र. 172 श्री गजानन देवकर यांच्या नावावर करून देत नाहीस म्हणून देवकर एक्सपोर्ट प्रा.ली. जळगाव व मुंबई येथील कंपनीतून तुला वर्ष 2019 ला काढलेच आहे. तुझ्या बायकोचे म्हणजेच रूपाचे स्त्रीधन सोने-नाणे दागिने परत कधीही मिळणार नाही. सदनिका क्र.172 चे भाडे वगैरे काहीही मिळणार नाही तसेच तुला श्री गजानन देवकर यांच्या संपत्तीत मधील हिस्सा मिळणार नाही. तु ताबडतोब सदनिका क्र.172 गजानन देवकर म्हणतील त्याप्रमाणे त्यांच्या नावाने करून दे ,तरच तुझे उर्वरीत आयुष्य चांगले जाईल. अशी धमकी श्री गजानन देवकर (वडील) यांनी श्री श्रीनाथ देवकर व श्री सनिल देवकर यांच्याकडून मला दिली. आम्ही कोणत्याही परिस्थितीत सदनिका क्र 172 मुंबईचा भाडेकरारनामा तुला मिळू देणार नाही त्यामुळे सदनिका क्र .172 च्या भाड्याची रक्कम मिळू शकणार नाही. अभिलाषा सोसायटी तील सर्व मॕनेजींग कमेटी मेंबर्स चा पाठिंबा गजानन देवकर यांना आहे. अभिलाषा सोसायटी चे व्यवस्थापकीय सदस्य श्री गजानन देवकर यांच्या विरोधात जाऊ शकतच नाही. तू ही विरोधात जाऊ नको अन्यथा त्याचे वाईट परिणाम होतील. अशी मला जहरी भाषेत धमकी दिली गेली. तुझ्यावर कसा वाईट परिणाम होईल, हे तुला तुझ्या पाळधी बुद्रूक गट नं ८४/१ व ८४/२ च्या अनुभवातुन समजले असेलच. किरण नन्नवरे व असलम शेख तुला योग्य मानसिक त्रास देतअसतात. प्रसंगी हे दोघेही तू शेतावर आल्यास, तुझ्या कारचे नुकसान करतील व तुझ्यावर आक्रमण/पोलीस तक्रारी करतील. तुझ्या शेतातील उभ्या पिकांचे नुकसान करतील. चोरी करतील. आज दि.03/04/2025 ला गट नं 76 मधील पिकांना नुकसान/चोरी झालेली दिसेल असे मला जळगाव न्यायालयात धमकी देऊन सुचित केले आहे.हे समजल्यावर मी दि.4 ता. शेतात गेलो असता कपाशी व गहू पिकाची चोरी झालेली दिसली काही गहू पिकांना आग लावून नष्ट केले.पांढऱ्या कांद्याचे पीक चांगल्या स्थितीत दिसूनआले.श्रीनाथ व सनिल म्हणाले की असलम शेख व किरण नन्नवरे यांच्यावर दाखल केलेला BNS 351(2)(3) याचा त्यांच्यावर काहीही परिणाम होणार नाही. तरी यांच्यावर कायदेशीर कारवाई करावी ही नम्रपणे विनंती करत आहे.\r\nतक्रारदार ,\r\nविवेक देवकर\r\n03/04/2025\r\nसोबत गट नः 76 चा 7/12 चा उतारा देत आहे.', '', '', '2025-04-08 00:51:21', 1, 'SADAR  QR CODE TAKRAR BABAT DHARANGAON PS CHE PSO NILESH BADGUJAR YANNA MAHITI DILI ASUN YA BABAT DHARANGAON PS CHE EMAIL ID VAR TAKRAR PATHAVLELI AAHE', 20, '2025-04-08 08:15:08'),
(152, '20251522246', 'विवेक गजानन देवकर', '९९६०६००९९९', 'आदर्शनगर', 'जळगाव', 35, 'पाळधी दूरक्षेत्र पोलीस स्टेशनला गट नं 76 बाबत पिकाची चोरी व आग लावली बद्दल ची लेखी तक्रार दि.4/4/2025 ला हे.काॕ.श्री विठ्ठल पाटील यांच्याकडे दिली.', 'मे.सहाय्यक पोलीस निरीक्षक \r\nपाळधी दूरक्षेत्र पोलीस ठाणे पाळधी\r\nपाळधी ता.धरणगाव \r\nDt.04/04/2025\r\n\r\nतक्रारदार विवेक देवकर मो.9960600999 रा.प्रतिक अपार्टमेंट फ्लॅट नं 1व 2 जळगाव \r\n\r\nविषय- पाळधी बुद्रूक गट नं 76 मधील उभे गहू व कपाशी पिकाची चोरी किरण नन्नवरे चा माणूस असलमशेख जेऊ शेख व त्याचा मुलगा अशपाक यांनी केली.\r\nसदर गट नं 76 ची मालकीहक्क श्री विवेक गजानन देवकर व विनोदचंद्र गजानन देवकर रा.मुंबई यांची आहे. शेतात पांढरा कांदा, गहू व कपाशी याचे उभे पीक तयार आहे. \r\nदि. 3/4/2025 जळगाव न्यायालयात श्री श्रीनाथ देवकर व सनील देवकर यांनी श्री गजानन देवकर यांच्या सांगण्यावरून मला सुचित केले की सदर गट नं 76 शेतातील पिकाची चोरी किरण नन्नवरे व त्याचा माणूस असलम शेख जेऊ शेख व त्याचा मुलगा अशपाक शेख असलम शेख यांनी केली आहे.\r\nहे समजल्यावर मी दि. 4/4/2025 वेळ 11 वाजता मी व माझा मित्र श्री दिनेश वाणी रा.जळगाव शेतावर गेलो असता मला गहू पिकाची चोरी व काही ठिकाणी आग लावून नष्ट कलेले पिकाच्या काड्या दिसून आल्या. पांढरा कांद्याचे पिके तयार परिस्थितीत दिसून आले. कपाशी ची चोरी करण्यात आली असे दिसून आले. \r\nमी लगेचच पाळधी दूरक्षेत्र पोलीस स्टेशनला गेलो व हे.काॕ. श्री विठ्ठल पाटील यांनी ताबडतोब माझा अर्ज स्वीकारला व माझ्याबरोबर शेतात येऊन शेतात गहू पिके काढल्यानंतर फोटो काढले व आग लावण्यात आलेल्या जागेवरचे ही फोटो काढले. मी पण फोटो काढले. कांद्याच्या पिकाचे व कपाशी चे फोटो काढले आहेत. मी दिलेल्या तक्रारीच्या दुय्यम प्रतीवर सही केली नाही त्यांनी त्याचे कारण सांगितले की आम्ही या तक्रारी अर्ज याबद्दल चौकशी सत्यता पडताळून पाहतो व तुम्हाला पाळधी पोलीस स्टेशनला बोलावून घेऊ. विनंती करीत आहे याची सखोल चौकशी करावी कारण यात माझी फसवणूक झाली व आग लावून पिकाचे नुकसान करण्यात आले आहे. त्वरित गुन्हा दाखल करण्यात यावा. अन्यथा पांढऱ्या कांद्याची चोरी करतील याची नोंद घ्यावी.तसेच या चोरी करण्याबद्दल ची आगाऊ तक्रार या आधीच 29 मार्चला पाळधी पोलीस स्टेशनला केली होती. कारवाई होत नाही म्हणून पोलीस अधिक्षक डाॕ.रेड्डी सा.यांना समक्ष दि. 2/4/2025 दिली होती. मी इमेल तक्रार पाळधी दूरक्षेत्र पोलीस ठाणे पाळधी व धरणगाव पोलीस स्टेशनला केली आहे.\r\n\r\nतक्रारदार \r\nविवेक देवकर \r\nसोबत हे.काॕ. विठ्ठल पाटील यांना दुपारी 12:45 दिलेल्या पत्राचा फोटो.व गट नं 76 7/12 उतारा देत आहे. शेतातील मी काढलेले फोटो देत आहे.\r\n2) पोलीस अधिक्षक जळगाव यांनी स्वीकारले  दि.2/4/2025 चे पत्र', '20250404_184334.jpg', '/uploads/complaint_files/2025-04-08/20250408012245/20250404_184334.jpg', '2025-04-08 01:22:46', 1, 'SADAR  QR CODE TAKRAR BABAT DHARANGAON PS CHE PSO NILESH BADGUJAR YANNA MAHITI DILI ASUN YA BABAT DHARANGAON PS CHE EMAIL ID VAR TAKRAR PATHAVLELI AAHE', 20, '2025-04-08 08:14:57'),
(153, '20251531701', 'विवेक गजानन देवकर', '९९६०६००९९९', 'आदर्शनगर', 'जळगाव', 1, 'स्पे. दिवाणी दावा क्र 140 बाबतीत मी केलेल्या अर्जाची सुनावणी व निकाल कोर्ट ५वे सिव्हिल जज सिनियर डिव्हीजन जळगाव यांच्या न्यायालयात श्री गजानन देवकर यांच्या मार्फत श्री श्रीनाथ देवकर व सनिल देवकर यांनी धमकी दिली.', 'माझी महा पोलीस पोर्टल वरील तक्रार क्र.20251515121 व जळगाव शहर पोलीस ठाणे जळगावला केलेला इमेल दि.05/04/2025 वेळ १४:२०               \r\n स्पे. दिवाणी दावा क्र 140 बाबतीत मी केलेल्या अर्जाची सुनावणी व निकाल कोर्ट ५वे सिव्हिल जज सिनियर डिव्हीजन जळगाव यांच्या न्यायालयात श्री गजानन देवकर यांच्या मार्फत श्री श्रीनाथ देवकर व सनिल देवकर यांनी धमकी दिली. पाळधी गट नं 76 बाबत ची तक्रार मी पाळधी दूरक्षेत्र पोलीस ठाणे पाळधी व पोलीस निरीक्षक धरणगाव येथे पोलीस ठादि.04/04/2025 येथे केलेली तक्रार आपणांस पाठवीत (Forward करीत) आहे. या अनुषंगाने योग्य कार्यवाही श्रीनाथ देवकर , सनिल देवकर , किरण नन्नवरे आसलम शेख जेऊ शेख अशपाक शेख असलम शेख यांच्यावर गटनं ७६ मधील गव्हाचे पीक आग लावून नष्ट केले. शेतातील कापूस चोरून नेला माझे आर्थिक नुकसान केले. जळगाव शहर पोलीस ठाणे जळगाव यांना आग लावून नष्ट पिकांचे फोटो इमेल ने पाठविले आहे. याबद्दल गुन्हा दाखल करावा ही विनंती. तक्रारदार विवेक देवकर.', '', '', '2025-04-08 21:17:01', 1, 'SADAR QR COMLENT BABAT JALGAON CITY PS CHE PSO ASI / SANJAY ZAALTEY  YANNA PHON KARUN MAHITI KALAVILE AHE', 20, '2025-04-08 22:33:58'),
(154, '20251543537', 'सुवर्णा अमोल दाभाडे', '8766800041', 'हिरापूर ता. चाळीसगाव जी. जळगाव', 'हिरापूर ता. चाळीसगाव', 20, 'शिवी गाळी करणे महिलेला', 'मला शिवी गाळी केली मला फोन वर धमकी देण्यात आली व खूप घाण शिव्या दिल्या व जीवाशी मारण्याची धमकी देण्यात आली', 'Snapchat-588140388.jpg', '/uploads/complaint_files/2025-04-09/20250409153537/Snapchat-588140388.jpg', '2025-04-09 15:35:37', 1, 'SADAR COMPLAINT BABAT 40 RURAL PS CHE PSO HC/2804 PRAVIN SAPKALE YANA MAHITI DEVUN TATKAL KARVAI KARNE BABAT SANGITALE AHE..', 21, '2025-04-09 18:14:30'),
(155, '20251551811', 'विवेक गजानन देवकर', '९९६०६००९९९', 'आदर्शनगर', 'जळगाव', 35, 'पाळधी बुद्रूक गट नं८४/१ मधील शेतातील विहिरीच्या नुकसान बाबत', 'मी विनंती पूर्वक अर्ज करतो की माझे पाळधी बु ता.धरणगाव शिवारात शेत गट नं ८४/२ ८४/१, ७६ मधील शेती करून कुटुंबाचा उदरनिर्वाह भागवितो.पाळधी शिवारातील गट नं ८४/१ च्या असलेल्या विहीरीवर विद्युत पुरवठा घेतलेले नाही. माझ्या शेताजवळ असलेल्या साईनाथ ढाब्याचा मालक किरण त्र्यंबक नन्नवरे हे बेकायदेशीर पणे माझ्या शेतातील विहिरीवर पाईप लाईन करून त्याच्या हाॕटेलसाठी पाणी वापरणार असल्याचे समजले आहे. तसेच पाळधी बुद्रूक शिवारातील गट नं७६ मध्ये पांढऱ्या कांद्याचे पीक आहे.सदर पिकाचे असलम शेख जेऊ शेख व त्याचा मुलगा अशपाक शेख व किरण नन्नवरे असे नुकसान करणार असल्याचे मला समजून आले आहे. तरी सदर इसमांनी शेत गट नं ८४/१ मधील माझ्या शेतातील विहिरीवर पाईप लाईन टाकू नये तसेच माझ्या शेतातील विहिरीवर येऊ नये. तसेच माझ्या इतर शेत गटात असलम शेख मुलगा आशपाक शेख व किरण नन्नवरे येऊ नये व मला त्रास देऊ नये यासाठी त्यांना आपल्या वतीने योग्य ती समज देण्यात यावी ही विनंती करत आहे. अर्जदार विवेक देवकर दि.०९/०४/२०२५', '', '', '2025-04-09 22:18:11', 1, 'SADR TAKRARA BABT PALDHI OP LA PSO HC SOPAN PATIL YANA KADVILE AHE', 21, '2025-04-09 23:08:38'),
(156, '20251563952', 'Sushma Mukesh ठाकूर', '9309407977', 'भुसावळ', 'भुसावळ', 2, 'हामोबाईल हिसकवणे', 'सदर फिर्यादी ही आरोपी नामे ज्ञानेश्वर उर्फ चोपड्या याच्या वीट भट्टीवर भोकर तालुका जिल्हा जळगाव येथे कामाला होते सदर वीट भट्टी मालक याचे कडून पैसे घेतले होते ते पैसे फिर्यादी यांनी कामावर पूर्ण फेडले आहे तरीसुद्धा वीट भट्टी मालक हा सदर फिर्यादीकडे पैसे असण्याचा दावा करीत आहे म्हणून त्याने फिर्यादीचा मोबाईल फिर्यादीच्या कब्जातून हिसकावून घेतला आहे फिर्यादी यांचे महत्त्वाचे कागदपत्र मोबाईल मध्ये आहे तरीसुद्धा विविध भट्टी मालक हा फिर्यादीचा मोबाईल देण्यास तयार नाही', '', '', '2025-04-14 08:39:52', 1, 'sadar event babat jalgaon taluk aps che pso hc dnyaneshwar koli yanna mahiti dili aahe ', 21, '2025-04-14 09:22:02'),
(157, '20251570027', 'Kishor Badgujar', '9730043224', 'Ayodhya Nagar, MIDC', 'Jalgaon', 6, 'Stolen Rear Number Plate of Car', 'Dear Sir, This is to inform you that on 14th April 2025: I was travelling from Mumbai to Jalgaon. During my journey, I took a halt 2-3 times. during the travel, rear number plate of my car got stolen. My car number is - MH19EG4632. I ordered a new number plate for my car. I am concerned that it should not get miss used anywhere. Hence, I am informing in advance. Thank you!', '', '', '2025-04-16 01:00:27', 1, 'SADAR EVENT BABAT MIDC PSO HC / 414 KIRAN PATIL YANA MAHITI DILI AHE', 20, '2025-04-16 07:35:39'),
(158, '20251582048', 'अनुष्का soni', '86230 7736', 'लाठी शाळे जवळ जळगाव', 'Jalgaon', 1, 'मानसिक त्रास', 'मी माझ्या माहेरी आली आहे आणि मला माझ्या सासरी जायचं नाही आहे मी असं बोलली तर सासरी वाले सगळे माझ्या महेर चे सगळ्या लोकांना शिवीगाळ करताय मानसिक त्रास देताय मला त्यांच्या कडे नाही जायचं आहे ते लोक खूप त्रास देताय मला .माझा देवर आणि नवरा शिवीगाळ करता आहे मी खूप त्रासली आहे प्लीस मला न्याय द्या ...', '', '', '2025-04-16 11:20:48', 1, 'SIMILAR TAKRAR 20251593837', 20, '2025-04-16 12:00:07'),
(159, '20251593837', 'अनुष्का सोनी', '8623077366', 'लाठी शाळा जळगाव', 'जळगाव', 1, 'मानसिक त्रास', 'मी अनुष्का सोनी माझ्या माहेरी आली आहे .मी माझ्या नवऱ्ययाला (दिलीप  सोनी) याना सांगितले कि मला नाही यायचं आहे तर ते आणि देवर  (निखिल सोनी) यांनी मला आणि माझ्या माहेरच्या लोकांना खूप शिवीगाळ केलीय ..माझी सासू (neeta soni)पण मला पैसे साठी खूप त्रास देते ..तुझ्या माहेरून पैसे आन असं तास ..माझा देवर पण बोलतो कि मी तुझी बदनामी करेल जर माझं नाही ऐकलं तर त्याची पण नियत खराब आहे माझ्या वर धमकी देतो कि माझं नाही ऐकलं तर तुला बदनाम करेल ...मी खूप त्रासली आहे प्ली मला न्याय dya....', '', '', '2025-04-16 11:38:37', 1, 'SADAR TAKRAR BABAT JAL CITY PS CHE PSO HC/WANKHEDE YANA MAHITI DEVUN PUDHIL KARVAI KARNE BABAT SANGITALE AHE..', 20, '2025-04-16 12:01:15'),
