(161, '20251611804', 'Ajitkumar Chandrakant Baviskar', '9421514790', '21/ B Mitra Nagar , Near Khwajamiya Darga , Jalgaon', 'Jalgaon - 425001', 5, 'Fraud & Theft  about Two Wheeler - MH19AD7671', 'Fraud & Theft  about Two Wheeler - MH19AD7671 ,  Fraudy - Mr Milind Nikam- Prop Sarthak Auto old Bhusawal - Jalgaon Road , Bhusawal Mob no - 9923303964 , 7875909393 ,(Broker of Two wheeler & four wheeler) for showing the vehicle to the customer he took from my home the vehicle on 6th April 2025 till now he neither returning the vehicle nor giving money of vehicle. And not giving the details to whom he sold the bike. Request you need your support /help for my bike back to me', 'MH 19 AD 7671.pdf', '/uploads/complaint_files/2025-04-16/20250416211803/MH 19 AD 7671.pdf', '2025-04-16 21:18:04', 1, 'sdar takrar babat jilhapeth ps che pso wpn/3146 suvarna tayde mob- 9850483146 yana call karun mahiti dili aahe karita nond ', 21, '2025-04-16 21:36:01'),
(162, '20251621636', 'संत श्री बाबा महाहंसजी महाराज', '8459326392', 'संत कुटिया मनुदेवी रोड सातपुडा जंगल परिसर', 'आडगाव तालुका यावल', 14, 'जळगाव येथील धर्मादाय उपायुक्त यांच्या कार्यालयातून तक्रारदार यांचे मनुदेवी मंदिराचे नोंदणी प्रकरण चौ अ क्रमांक २३२३/२०१७ चे निशाणी ५२ मधील युक्तिवादाचे गहाळ झालेल्या (परिशिष्ट) मुळ कागदपत्रांची फौजदारी चौकशी होऊन मिळणे बाबत.', 'तक्रारी निवेदन \r\n                                                                                       दिनांक १७/०४/२०२५\r\nप्रति, \r\nमा श्री महेश्वर रेड्डी साहेब \r\nपोलिस अधीक्षक जळगाव \r\nयांच्या सेवेशी \r\n\r\nआदरणीय महोदय !\r\n    मौजे आडगाव तालुका यावल येथील सुप्रसिद्ध श्री मनुदेवी मंदिर या देवस्थानाची कायदेशीर नोंदणी झालेली नाही असे माहिती अधिकारद्वारे प्राप्त कागदपत्रांवरून कळून आले तदनुषंगानेच तक्रारदार यांनी मा धर्मादाय उपायुक्त साहेब सार्वजनिक न्यास नोंदणी कार्यालय जळगाव यांच्या कार्यालयी \"श्री मनुदेवी मंदिर चॅरिटेबल ट्रस्ट आडगाव तालुका यावल जिल्हा जळगाव\" या नावाने सदर मंदिराचा नोंदणी प्रस्ताव दाखल केला आहे. त्याचा चौकशी अर्ज क्रमांक २३२३/२०१७ असा आहे. या प्रकरणातील अर्जदार यांनी  ७४ पृष्ठांच्या लेखी युक्तीवाद दाखल केलेला आहे, त्यासोबत परिशिष्ट म्हणून दाखल केलेले अत्यंत महत्त्वाचे मुळ ५ अभिलेख दस्तऐवज सदर  प्रकरणातून गहाळ केलेले दिसून येत आहेत. हे खूप गंभीर धोकादायक गुन्हे कृत्य आहे. \r\n     सदर मंदिराचा प्रस्ताव हा दिनांक 17 जून 2021 रोजी तत्कालीन मा धर्मादाय उपायुक्त साहेब जळगाव यांनी मंजूर केला होता त्यातील आदेशानुसार सदर मंदिराचा नोंदणी क्रमांक ए1367 / जळगाव असा नोंदविण्यात आलेला होता परंतु नाशिक येथील मा. धर्मादाय सह आयुक्त यांच्याकडून अ क्र 57/2021 च्या आदेशातील काही तांत्रिक बाबींमुळे सदर प्रकरणाची सदर कार्यालयी मा सहायक धर्मादाय आयुक्त 1 जळगाव यांच्याकडे पुन्हा फेर चौकशी सुरू आहे. तथापि अर्जदार यांनी सदर मा धर्मादाय सह आयुक्त नाशिक यांच्याकडील आदेशास मा उच्च न्यायालय, खंडपीठ छत्रपती संभाजी नगर (औरंगाबाद) येथे आव्हान दिलेले आहे. त्याची चौकशी सुरू आहे.\r\n      या न्यायिक चौकशीच्या परिस्थितीत सदर मंदिराला कायदेशीर नोंदणी पासून वंचित ठेवण्याच्या दूषित हेतूने हरकत घेणाऱ्यांची (सातपुडा निवासिनी श्री मनुदेवी सेवा प्रतिष्ठान जळगाव, या जि जळगाव नोंदणी क्रमांक ई५५४, या गैरधार्मिक तथा शैक्षणिक सामाजिक ट्रस्टच्या लोकांची) पाठराखण करणाऱ्या व त्यांना पाठीशी घालणाऱ्या सदर धर्मादाय कार्यालयातील काही अधिकारी कर्मचारी यांनी सदर प्रकरणातील अर्जदार यांच्या युक्तीवादातील सदर महत्त्वपूर्ण दस्तऐवज गहाळ केलेले आहेत. ही खूप मोठी धक्कादायक अत्याचार व अन्यायकारक तथा न्याय घातक गुन्हे स्वरूपाची बाब आहे. म्हणून त्याविरुद्ध माझी तक्रारदाराची तीव्र तक्रार आहे.\r\n    यास्तव विनंती असे की, सदर दस्ताऐवज कोणी? केव्हा? कोणाच्या सांगण्यावरून? का गहाळ केलेत? व कुठे नेऊन ठेवलेत किंवा नष्ट केलेत? तसेच नष्ट केले तर कसे नष्ट केलेत ? तसेच ते गहाळ करण्यात कोण कोण सामील होते व आहेत? वगैरे वगैरे या सर्व बाबींची सखोल फौजदारी चौकशी व्हावी व त्या अनुषंगाने पुढील गुन्हे कार्यवाहीचे आदेश व्हावेत ही नम्र विनंती.\r\n(टीप- सदर धर्मादाय कार्यालय हे जळगाव येथील जिल्हा पेठ पोलीस स्टेशनच्या हद्दीत येते मात्र अर्जदार हे यावल पोलीस स्टेशनच्या हद्दीत वास्तव्य करतात. योग्य त्या कार्यवाही व माहितीस्तव सविनय सादर.)', '', '', '2025-04-17 07:16:36', 1, 'sadar takrar babat yaval ps che pso yana call karun mahiti dili aahe karita nond ', 21, '2025-04-17 08:09:22'),
(163, '20251633310', 'Manoj Bhandarkar', '9322255787', 'Bhalerao Nagar', 'Amalner', 28, 'Lost of vehicle registration certificate', 'I have lost my vehicle registration certificate on amalner ST bus stand please do needful help.', 'MH19Q2528.jpg', '/uploads/complaint_files/2025-04-17/20250417133309/MH19Q2528.jpg', '2025-04-17 13:33:10', 1, 'AMALNER PS CHE PSO HC/2756 SANDIP PATIL YANA MAHITI DEVUN PUDHIL KARVAI KARNE BABAT SUCHIT KELE AHE..', 21, '2025-04-17 13:40:05'),
(164, '20251641456', 'विवेक गजानन देवकर', '९९६०६००९९९', 'आदर्शनगर', 'जळगाव', 1, 'आज परत दि. १७/०४/२०२५ ला जळगाव न्यायालयात चेअरमन श्री गजानन देवकर यांच्या सांगण्यावरून श्री श्रीनाथ देवकर व सनील देवकर यांनी धमकी दिली', 'पोलीस निरीक्षक \r\nजळगाव शहर पोलीस ठाणे जळगाव \r\nफुले मार्केट समोर जळगाव \r\n दि.17/04/2025\r\n\r\nअर्जदार :-विवेक गजानन देवकर मो.9960600999 \r\nरा. प्रतिक अपार्टमेंट फ्लॅट नं 1व 2 डीमार्ट जवळ आदर्शनगर जळगाव \r\n\r\nसविनय तक्रारी अर्ज करीत आहे की,..\r\nस्पे. दिवाणी दावा क्र 140 बाबतीतील कोर्ट ५वे सिव्हिल जज सिनियर डिव्हीजन जळगाव यांच्या जळगाव  न्यायालयात आज वेळ स. 11:35 च्या दरम्यान श्री गजानन देवकर यांच्या मार्फत परत श्री श्रीनाथ देवकर व सनिल देवकर यांनी धमकी दिली व सांगितले की श्री गजानन देवकर यांनी रू 10 करोड रूपये मागितले आहे.अन्यथा किरण नन्नवरे ची माणसे असलम शेख जेऊर शेख त्याची दोन मुले एक अशपाक शेख व दुसऱ्या मुलाचे नाव माहीत नाही हे त्रास देतील तुला तुझ्या शेतावर येऊ दिले जाणार नाही. आताच त्यांनी तू तक्रार केल्यामुळे गट नं 84/1 च्या विहीरी च्या कठड्याला किरण नन्नवरे व असलम शेख यांनी मोठा खड्डा पाडला आहे. शेत गट नं 76 मधील पांढऱ्या कांद्याचे पिकांचे नुकसान केलेले दिसून येईल वडील श्री गजानन देवकर यांनी त्वरित रू 10 करोड ची रक्कम मागितली आहे तू जर रक्कम न दिल्यास तुला कोणतीही संपत्ती मिळणार नाही. तुझ्या मुलांवर ही रक्कम खर्च झाली आहे रक्कम न दिल्यास किरण नन्नवरे ची माणसे व असलम शेख तुला त्रास देतील. तुझ्या शेतातील मालाचे नुकसान करतील. शेतावर गेल्यास प्रसंगी आग लावून तुझ्यावरच आळ घेतील. तुझ्या शेतात मजूर मेहबूब पठाण आला होता  त्याला मारायला घरी किरण नन्नवरे व असलम शेख त्याचे नातेवाईक सर्वांसह  गेले होते. त्याला संजू देशमुख ने मध्यस्थी केली म्हणून वाचला. हीच परिस्थिती रोशन शाॕ ची झाली होती. तू जर रू 10 करोड रूपये दिले नाहीतर तुझ्या सदनिका क्र 172 मध्ये तुला कुटुंबासहित येऊ दिले जाणार नाही तुझ्या बायकोचे रूपाचे दागिने ही मिळणार नाही.देवकर एक्सपोर्ट प्रा.ली. कंपन्यांच्या तक्रारी ताबडतोब काढून घे.\r\n\r\nउपनिबंधक सहकारी संस्था A विभाग मुंबई येथे तुला जाऊन मिळालेल्या सदनिका क्र 172 च्या बाबतीत चे अभिलाषा सोसायटी मुंबई चे दस्तऐवज कोणालाही दाखवायचे नाहीत अन्यथा परिणाम वाईट होतील अशी श्रीनाथ चा मुलगा सनिल देवकर हा अंगावर धावून आला व धमकी दिली. योग्य कार्यवाही करावी मला या घडलेल्या घटनेचा प्रचंड धक्का बसला आहे. मी याआधी तक्रार केली होती. आज परत शहर जळगाव पोलीस ठाणे जळगाव येथे ईमेल 16:06 वाजता केला आहे याची नोंद घेण्यात यावी ही विनंती करीत आहे.\r\nतक्रारदार \r\nविवेक देवकर\r\n17/04/2025', '', '', '2025-04-17 16:14:56', 1, 'JAL CITY PS CHE PSO HC/ 3179 SONY YANA MAHITI DEVUN EMAIL KELA AHE', 21, '2025-04-17 17:59:55'),
(165, '20251650027', 'Abdul Razzak', '9021210307', 'Faizpur', 'Faizpur', 13, 'Fraud of money transfer', 'Some one send me Phone pay scanner  and tell me to send urgent money ,so I send 10000 from upi scanner from my current account', 'IMG-20250417-WA0134.jpg', '/uploads/complaint_files/2025-04-17/20250417190027/IMG-20250417-WA0134.jpg', '2025-04-17 19:00:27', 1, 'sadar call chi mahiti faizpur ps che mahila pso LHC 2917/ harsha chaudhari yanna tyanchya whats aap var send keli ahe.te pudhil karvai karit ahe.', 21, '2025-04-17 20:00:45'),
(166, '20251665417', 'राजेश देविदास देसाई', '7038961890', 'खोटे नगर', 'चांदसर तालुका धरणगाव', 1, 'शेती सोलर पंप फसवणूक', 'दोन वर्षे झाले पैसे घेऊन सोलर पंप दिवे नाही शैती साठी उद्या देतो आतापर्यंत दिले नाही', '', '', '2025-04-18 10:54:17', 1, 'HC / दिनेश चव्हान पी. एस. ओ .  यांना माहिती देवून पुढील योग्य ती  कारवाई करण्यास सांगितले आहे ', 21, '2025-04-18 11:33:16'),
(167, '20251674418', 'विवेक गजानन देवकर', '९९६०६००९९९', 'आदर्शनगर', 'जळगाव', 35, 'पाळधी बुद्रूक गट नं ८४/१ मधील किरण नन्नवरे , असलम शेख व अशपाक यांनी विहीरीच्या कठड्याला भगदाड पाडले व गट नं ७६ मधील पांढऱ्या कांद्याचे नुकसान केले.', 'जळगाव न्यायालयात श्री श्रीनाथ देवकर व सनिल यांनी मला दि.१७/०४/२०२५ वेळ ११:३५ वाजता सुचित केले की मी तक्रार किरण नन्नवरे , असलम शेख यांची तक्रार केल्यामुळे त्यांनी गट नं ८४/१ मधील विहिरी च्या कठड्याचे नुकसान केले आहे व गट नं ७६ मधील पांढऱ्या कांद्याच्या पिकाचे नुकसान केले आहे. हे पाहण्यासाठी मी शेतावर गेलो असता विहिरीच्या कठड्याला मोठे भगदाड पाडलेले दिसले. तसेच गट नं ७६ मधील पांढऱ्या कांदा पिकाचे नुकसान केलेले दिसून आल्यावर मी पाळधी दूरक्षेत्र पोलीस ठाणे येथे लेखी तक्रार केली. व फोटो ही दाखल केले आहेत.तक्रारीच्या अर्जावर हे.काॕ. श्री विठ्ठल पाटील सही केली. व सोनोवणे यांनी सांगितले की सदर आरोपी विरूद्ध आधीच्या तक्रारीबाबत तहसिलदार प्रतिबंधक कारवाई साठी तजवीव करण्यात ठेवले आहे. तक्रार करूनही किरण नन्नवरे , असलम शेख यांच्यावर परिणामकारक बदल झालेला नाही. सदर आरोपींवर सक्त कारवाई करून गुन्हा दाखल करावा.तक्रारदार विवेक देवकर', '', '', '2025-04-18 16:44:18', 1, 'dharangaon ps che pso HC/94 rajendra koli mob no. 9423488576 yana mahiti devun pudhil karvai karne babat sangitale ahe..', 21, '2025-04-18 17:07:49'),
(168, '20251680350', 'Dilip baburao Falak', '9975739690', 'A/p Pal, Khiroda Tal Raver ,Dist Jalgaon Pin code 425504', 'Pal', 11, 'Bada Dost i4TNDD gadichi magchi number plate Tutun padli Gadi No MH19CY7292', 'Bada Dost i4TNDD gadichi magchi and pudchi number plate Tutun padli Gadi No MH19CY7292 cha no P4720 Engine no 1007P', '17449904036398578807360181372613.jpg', '/uploads/complaint_files/2025-04-18/20250418210350/17449904036398578807360181372613.jpg', '2025-04-18 21:03:50', 1, 'saadr event chi mahiti raver pso hc vijay choudhary yana dili ahe', 21, '2025-04-19 10:46:07'),
