(170, '20251701543', 'Rajesh Murlidhar Rane', '9422778204', '05 ,parvati nagar', 'Faizpur', 13, 'Complain against illegal felling of tree without our consent in our premises.', 'To: The Sub divisional Officer\r\nSubject: Illegal Felling of Tree Without Permission\r\n\r\nDear Sir,\r\nI am Rajesh Rane, proprietor of Shree Automobiles (Hero Showroom), located on Savda Road, Post Faizpur.\r\nI am writing to bring to your attention a serious matter involving the unauthorized cutting of an old tree located within the premises of our showroom. The said tree, which is estimated to be approximately 50–60 years old, has stood  in front of our property for decades and holds both ecological and sentimental value.\r\nToday, the owner of the adjacent Meridian Plaza Hotel unlawfully felled this tree without obtaining any form of consent from us. What is more concerning is that this act was carried out with permission obtained from forest officials, who, according to our knowledge, conducted a verification and survey before granting approval. Despite their survey confirming that the tree was not located within the hotel’s premises, permission was still granted. The tree was cut on Friday known that weekly holiday is observed in our showroom , taking it to their benefit , there will be no one to stop them with their deed.\r\nThe permission letter reportedly states that the tree was situated on the Meridian Plaza property, which is factually incorrect. The actual location of the tree was directly in front of our showroom, clearly within our boundary.\r\nThis incident reflects not only a misuse of administrative authority but also a grave lapse in due diligence. We respectfully urge your office to initiate a thorough investigation into the matter and take strict disciplinary action against the responsible forest officials and the individual who misrepresented the facts to obtain permission.\r\nAttached are photographic proofs of the tree when it was cut  down.\r\nWe request your urgent intervention to ensure justice is served and to prevent such unlawful activities in the future.\r\nThank you for your attention to this matter.\r\nSincerely,\r\nRajesh Rane\r\nShree Automobiles (Hero Showroom)\r\nSavda Road, Post Faizpur\r\n 9422778204 .', 'Yesteday 6.jpg', '/uploads/complaint_files/2025-04-19/20250419121542/Yesteday 6.jpg', '2025-04-19 12:15:43', 1, 'sadar QR code cumplaint babat faijpur pso asi/2568 devidas surdas yanna mahiti dili aahe', 21, '2025-04-19 12:40:32'),
