(172, '20251720051', 'Ishwar Shelar', '9579520001', 'Pimplagaon hare', 'Pimpalgaon', 25, 'FIR', 'माझी फिर्याद प्रमाने फोजदारी गुन्हा पिंपळगाव हरे पो.स्टे.येथे नोदविली नाही म्हणून भारतीय नागरिक सुरक्षा संहिता २०२३ चे कलम १७४(४) नुसार माझ्या फिर्याद प्रमाने फोजदारी गुन्हा दाखल करावे.', 'firyad (1).pdf', '/uploads/complaint_files/2025-04-20/20250420100051/firyad (1).pdf', '2025-04-20 10:00:51', 1, 'sadr takrar babat pso yana call karun mahiti dili aahe tasech pipalgaon hareshwar polce station chya email var pdf pathvile aahe karita nond ', 21, '2025-04-20 13:46:36'),
