(175, '20251752854', 'विवेक गजानन देवकर', '९९६०६००९९९', 'आदर्शनगर', 'जळगाव', 35, 'पाळधी बुद्रूक गट नं ८४/१ मधील किरण नन्नवरे , असलम शेख व अशपाक यांनी विहीरीच्या कठड्याला भगदाड पाडले व गट नं ७६ मधील पांढऱ्या कांद्याचे नुकसान केले.', ': विवेक गजानन देवकर\r\n\r\nमोबाईल नंबर\r\n\r\n: ९९६०६००९९९\r\n\r\nनिवासी क्षेत्र\r\n\r\n: आदर्शनगर\r\n\r\nगाव/शहर\r\n\r\n: जळगाव\r\n\r\nपोलीस ठाणे\r\n\r\n: DHARANGAON\r\n\r\nतक्रारीचे स्वरूप\r\n\r\n: पाळधी बुद्रूक गट नं ८४/१ मधील किरण नन्नवरे , असलम शेख व अशपाक यांनी विहीरीच्या कठड्याला भगदाड पाडले व गट नं ७६ मधील पांढऱ्या कांद्याचे नुकसान केले.\r\n\r\nथोडक्यात तक्रार\r\n\r\n: जळगाव न्यायालयात श्री श्रीनाथ देवकर व सनिल यांनी मला दि.१७/०४/२०२५ वेळ ११:३५ वाजता सुचित केले की मी तक्रार किरण नन्नवरे , असलम शेख यांची तक्रार केल्यामुळे त्यांनी गट नं ८४/१ मधील विहिरी च्या कठड्याचे नुकसान केले आहे व गट नं ७६ मधील पांढऱ्या कांद्याच्या पिकाचे नुकसान केले आहे. हे पाहण्यासाठी मी शेतावर गेलो असता विहिरीच्या कठड्याला मोठे भगदाड पाडलेले दिसले. तसेच गट नं ७६ मधील पांढऱ्या कांदा पिकाचे नुकसान केलेले दिसून आल्यावर मी पाळधी दूरक्षेत्र पोलीस ठाणे येथे लेखी तक्रार केली. व फोटो ही दाखल केले आहेत.तक्रारीच्या अर्जावर हे.काॕ. श्री विठ्ठल पाटील सही केली. व सोनोवणे यांनी सांगितले की सदर आरोपी विरूद्ध आधीच्या तक्रारीबाबत तहसिलदार प्रतिबंधक कारवाई साठी तजवीव करण्यात ठेवले आहे. तक्रार करूनही किरण नन्नवरे , असलम शेख यांच्यावर परिणामकारक बदल झालेला नाही. सदर आरोपींवर सक्त कारवाई करून गुन्हा दाखल करावा.तक्रारदार विवेक देवकर\r\n\r\nतक्रारीची स्तिथी\r\n\r\n: निराकरण केले\r\n\r\nनिराकरण टिप्पणी\r\n\r\n: dharangaon ps che pso HC/94 rajendra koli mob no. 9423488576 yana mahiti devun pudhil karvai karne babat sangitale आहे..मी आताच हे.काॕ. रविंद्र कोळी यांच्याशी बोलणे केले त्यांना याबाबत काहीच माहिती नाही. दि.२०/०४/२०२५ ला पाळधी येथील प्रशांत धनगर यांनी पाळधी बुद्रूक गट नं ८४/१ जवळ चारी खडलेली असून फोटो ही पाठविले आहे. तहसिलदार धरणगाव यांच्याकडून गैरअर्जदारांवर प्रतिबंधक कारवाई झाली का?', '', '', '2025-04-21 16:28:54', 1, 'sadr takrari babat pso paldho op yogesh sonavane 1492 