(178, '20251785915', 'परमेश्वर वासुदेव दांडगे', '9049452774', 'गट नं 144 प्लॉट नं 22 श्रीधर नगर गिरणा पंपिंग रोड जळगाव', 'जळगाव', 4, 'मी स्वतः घरात एकटा असताना माझ्या घरात येऊन मला मारहाण केली व व गळा दाबून जीवे मारण्याचा प्रयत्न केला', 'आज दि 23 एप्रिल 2025 रोजी ज्ञानेश्वर वासुदेव दांडगे व त्याची पत्नी मंगला ज्ञानेश्वर दांडगे यांनी मी घरात एकटा असताना मला नळाचे पाणी भरण्याच्या कारणावरून माझ्या राहत्या घरात येऊन मारहाण केली व गळा दाबून जीवे मारण्याचा प्रयत्न केला त्याचे सीसीटीव्ही फुटेज माझ्याकडे आहे', '', '', '2025-04-23 12:59:15', 1, 'SADAR QR CODE TAKRAR BABAT RAMANAND NAGAR PSO HC/15 PRASHANT PATHAK YANNA MAHITI DILI ASUN PUDHIL KARYAVAHI TE KARIT AAHET ', 20, '2025-04-23 13:29:41'),
(179, '20251795839', 'निर्मला वसंत भालेराव', '9096058669', 'संतोष नगर पेन्सिल कंपनी शिवसेना शाखा समोर', 'जिल्हा ठाणे उल्हासनगर ४ २१००४', 2, 'फसवणूक झाली आहे', 'मी शौर्य यात्रा कंपनी हेड ऑफिस शिवाजी नगर रोड राधाकृष्ण नगर जलगांव महाराष्ट्र ४२५००१ यांच्या कडे JANEVARI MAHINYAT नेपाळ ट्रिप ला जाण्यासाठी २२/११/२०२४ रोजी ८०००/- आणि ०२/१२/२०२४ रोजी १५३००/- असे ऐकून २३३००/- रक्कम गुगल पे ने जमा केली होती  नंतर त्यांच्या कडून फोने मासे काहीच आला नाही मी विचारणा केली असता एक एक महिना पुढे ढकलत होते  म्हणून मी पेसे परत मागितले  तर त्यासाठीपण तारीख वर तारीख देत गेले आणि आता तर कॉल हि रेसिइव्ह करत नाहीत. माझ्याकडे कॉल रेकॉर्डिंग आपट वॉट्सप मसग सगळे आहे  विनंती आहे मला माझे पैसे मिळण्यास मदत करावी. यांचे हेड मयुरेश वाघ आहेत त्यांचा मोबाइलला नबर ७०५७५९१२३४ आणि रिफंड हेड चा नंबर ८०१०९७७२१२', 'Payment receipt.jpg', '/uploads/complaint_files/2025-04-23/20250423145838/Payment receipt.jpg', '2025-04-23 14:58:39', 1, 'SADAR TAKAR BABAT PSO YANA CALL KARUN MAHITI DILI AAHE ', 20, '2025-04-23 19:00:28'),
(180, '20251805917', 'विवेक गजानन देवकर', '९९६०६००९९९', 'आदर्शनगर', 'जळगाव', 35, 'पाळधी बुद्रूक ता.धरणगाव येथील गट नं ८४/१ मधील विहिरीला किरण नन्नवरे असलमशेख आशपाक शेख यांनी भगदाड पाडले कलम 126 प्रतिबंधक', 'Dharangaon Police Station (अधिकारी),  12-04-2025 03:22 PM\r\nपनाका रजि.नं.315/2025 भान्यासं कलम 351(2)(3)प्रमाणे धरणगांव पो.स्टेला दाखल करण्यात आलेले आहे.गै.अ.यांना बीएनएस कलम.168 प्रमाणे नोटीस देण्यात आलेली आहे तसेच बीएनएस कलम.126 प्रमाणे प्रतीबंधक कार्यवाही करण्याची तजवीव ठेवण्यात आलेली आहे. कलम १२६ प्रतिबंधक कारवाई न झाल्यामुळे सदर आरोपी गट नं ८४/१ च्या विहिरीवर १७ तारखेनंतर वारंवार येतात. पाळधी रहिवासी प्रशांत धनगर यांनी माझ्या विहिरीवरचे फोटो पाठविले आहे. तसेच मी हे.काॕ.महेंद्र पाटील साहेब व हे.काॕ. योगेश सोनावणे सा. यांना माझ्या मोबाईल वरून टेक्स मेसेज ही केला आहे तो खालीलप्रमाणे नमस्कार ,\r\nमाझ्या पाळधी बुद्रूक  ता.धरणगाव गट नं 84/1 व गट नं 76 बाबतीतील अनेक तक्रारींच्या अनुषंगाने किरण नन्नवरे, असलमशेख, अशपाक यांच्यावर मे. तहसिलदार धरणगाव यांचेकडून प्रतिबंधक कारवाई झाली का?.. माझी मानसिक छळ/छळवणूक होत आहे. विवेक देवकर', '', '', '2025-04-23 14:59:17', 1, 'SADR TAKRAR BABAT PSO YANA CALL KARUN KALVILE AAHE KARITA NOND ', 20, '2025-04-23 18:59:55'),
