(187, '20251875854', 'डॉ किरण पंढरीनाथ गायकवाड', '8080563066', 'भुसावळ ग्रामीण', 'भुसावळ', 9, 'नोकरीचे अमिश दाखऊन पैशाची फसवूणूक', 'माझा लहान भाऊ निकेश पंढरीनाथ गायकवाड रा मोंढाळा ता भुसावळ याला नोकरी लावण्याच्या साठी पैशाची फसवूणूक झाली आहे  मी डॉ किरण गायकवाड भुसावळ येथील नगरपालिका दवाखान्यात डॉ देवर्षी घोशाल यांच्या कडे शिकत असताना प्रॅक्टिस साठी जात होतो तिथे डॉ घोषल यांच्या शी माझी ओळख झाली बरेच वर्षाची ओळख झाली असता डॉ घोषल हे स्वतः आमच्या घरी मोंढाला येथे आले व आमच्या घरी माझे वडील आणि मी माझा भाऊ आम्ही घरीच होतो ते आले असता त्यांनी स्वतःहून सांगितले कि माझे जिजाजी नागपूर गव्हर्मेंट मेडिकल कॉलेज चे डीन आहेत तर तुमच्या लहान मुलगा निकेश यास मी आरोग्य विभागात कलर्क ची नोकरीं लावून देतो आधी फक्त मला याचे १० वि १२वी चे डाकमेंट्स व २ पासपोर्ट फोटो द्या आणि काही दिवसानंतर येऊन कधी ८ लाख तर मुंबई ला १० लाख घरून पुन्हा ५ लाख व अकोला येथे २ लाख अशे २५ लाख रुपये घेतले २ वर्ष व कोरोना आजार आला असता काही काल त्यात निघून गेला आम्ही पैशाची मागणी केले असता टाळा टाळ करत आहे व आता तर फोन रिसिव्ह करत नाही अशा प्रकारे अनेक लोकांना यांनी फसवले आहे मोबाईल चालू असतो पण बोलत नाही सद्या कुठे आहे आम्हाला काही माहित नाही आपण सदर व्यक्ती वर गुन्हा दाखल करून त्याला हजर करा हि नम्र विनंती ९७६६४७०२९७ हा त्यांचा मो न आहे', '', '', '2025-04-29 12:58:54', 1, 'BHUSAVAL TALUKA CHE PSO SHYAMKUMAR MORE MOB NO 9823092509 YANA MAHITI DEVUN EMAIL SUDHA KELA AHE..', 21, '2025-04-29 13:13:29'),
(188, '20251881055', 'गणेश पुरुषोत्तम कोकदे', '7410562554', 'नगरदेवळा', 'नगरदेवळा', 24, 'घरफोडी होण्याबाबद', 'माझे आईवडील २४/०४/२५ या तारखेपासून मुंबई ला लग्न साठी गेले असता २८/०४/२५ रोजी रात्री चोरी झालेली असून पुढच्या घराची खिडकी तोडून कोणी आत म्हध्ये प्रवेश केला असेल सदर चोरी ची माहिती गल्लीतील लोकांनी माझ्या वडिलांना फोन करून माहिती दिली असता आणि एकदा नसून अशी घटना ४ वेळेस झाली असून माझी आपणा कडे विनंती आहे कि आपण सदर घटना वर लक्ष केंद्रित करावं.', 'IMG-20250429-WA0003.jpg', '/uploads/complaint_files/2025-04-29/20250429151054/IMG-20250429-WA0003.jpg', '2025-04-29 15:10:55', 1, 'SADAR QR COD COMLENT BABAT  PACHORA PS CHE PSO  HC/2409 VISHWAS DESHMUKH YANNA PHON KARUN MAHITI KALAVILE AHE ', 20, '2025-04-29 20:42:10'),
(189, '20251894734', 'विवेक गजानन देवकर', '९९६०६००९९९', 'आदर्शनगर', 'जळगाव', 1, 'आज दि.२९/०४/२०२५ ला जळगाव न्यायालयात श्री गजानन देवकर यांचे मार्फत श्रीनाथ देवकर व सनिल देवकर यांनी धमकी दिली आहे.', 'मी विवेक गजानन देवकर वय 62 रा. प्रतिक अपार्टमेंट फ्लॅट नं 1 व 2 आदर्शनगर जळगाव आज दि.29/04/2025 जळगाव न्यायालयात वडील श्री गजानन देवकर यांनी माझ्या विरोधात स्पे.दिवाणी दावा क्र 140 दाखल केलेला आहे. मी दाखल केलेल्या अर्जाच्या निकालाबद्दल सुनावणी आज दि.29/04/2025 होती. मी माझी मे.न्यायालयात उपस्थिती दाखवून बाहेर आल्यावर माझा भाऊ श्री श्रीनाथ देवकर व त्याचा मुलगा श्री सनिल दिसले व रागाने मला बोलावून सांगितले की श्री गजानन देवकर(वडील) श्री श्रीनाथ देवकर व त्याचा मुलगा सनिल देवकर यांच्यावरील पोलीस तक्रारी काढून घे. रूपा विवेक देवकर हिने स्त्रीधन सोन्याचे दागिने ची फौजदारी जळगाव  न्यायालयात दाखल असलेली फौजदारी किरकोळ अर्ज क्र 102/2021 व देवकर एक्सपोर्ट प्रा.ली. कंपनीची च्या संदर्भातील फौजदारी जळगाव न्यायालयात दाखल असलेले अपील क्र 80/2021 तसेच दिवाणी दावा क्र 252/2023 व तुझ्या मुंबईतील सदनिका क्र 172 भाडे करारनामा, उपनिबंधक सहकारी संस्था A विभाग मुंबई येथे केलेल्या तक्रारी , सदनिका क्र 172 संबंधातील शेअर्स सर्टिफिकेट बद्दल केलेल्या सर्व तक्रारी,लासलगाव जिल्हा नाशिक येथील गट नं 295 जागे संबधी सर्व पोलीस तक्रारी व जळगाव न्यायालयात दाखल केलेले दावे ताबडतोब काढून घे असे श्री गजानन देवकर ( वडील) यांनी मला त्यांच्या ज.मु. धारक श्रीनाथ देवकर व सनिल देवकर यांनी धमकी दिली आहे. तू जर ऐकलं तरच  स्पे.दावा 140 प्रतिक अपार्टमेंट फ्लॅट नं 1 व 2 चा दावा काढून घेतला जाईल अन्यथा तूला पाळधी बुद्रूक व खूर्द येथील शेतावर किरण नन्नवरे ची माणसे असलमशेख व त्याचा मुलगा निरनिराळ्या प्रकारच्या तक्रारी किंवा नुकसान करून हैराण करतील तुला व मजूरांना शेतावर येऊ दिले जाणार नाही. तुझ्यामागे पोलीसांचा ससेमिरा लागावा यासाठी पाळधी गट नं 84/1 च्या विहिरीत कुठून तरी चोरीचे पाईप टाकलेले आहेत तू खात्री कर. तू सदनिका क्र 172 श्री गजानन देवकर यांच्या नावावर करून देत नाही म्हणून देवकर एक्सपोर्ट कंपनीतून तुला काढलेच आहे. तुझ्या बायकोचे रूपाचे स्त्रीधन सोने-नाणे परत कधीही मिळणार नाही. सदनिका क्र 172 चे भाडे वगैरे काहीही मिळणार नाही तसेच तुला श्री गजानन देवकर यांच्या संपत्तीत मधील हिस्सा मिळणार नाही. तू ताबडतोब सदनिका क्र 172 दादा (श्री गजानन देवकर ) म्हणतील त्याप्रमाणे त्यांच्या नावाने करून दे किंवा रक्कम रू 10 करोड दे तरच तुझे उर्वरीत आयुष्य चांगले जाईल. तुझ्या कोणत्याही अविभक्त कुटुंबाच्या मालकीच्या संपत्तीचा व जंगम मालमत्ता उल्लेख कुठेही करू नकोस अन्यथा याचा वाईट परिणाम होईल अशी धमकी श्री गजानन देवकर (वडील) यांनी श्री श्रीनाथ देवकर व श्री सनिल देवकर यांच्या मार्फत आज परत जळगाव न्यायालयात वेळ 12:45 दरम्यान मला दिली. आम्ही कोणत्याही परिस्थितीत मुंबईतील सदनिका क्र 172 भाडेकरारनामा तुला मिळू देणार नाही त्यामुळे सदनिका क्र 172 च्या भाड्याची रक्कम मिळू शकणार नाही. अभिलाषा सोसायटी तील सर्व मॕनेजींग कमेटी मेंबर्सचा पाठिंबा दादांना (श्री गजानन देवकर यांना) आहे. तू विरोधात जाऊ नको अन्यथा त्याचे वाईट परिणाम होतील. श्री किरण नन्नवरे व असलम शेख ला तुला मानसिक त्रास देण्यासाठी ठेवले आहे. प्रसंगी हे दोघेही तू शेतावर आल्यास तुझ्या कारचे नुकसान करतील व तुझ्यावर आक्रमण/ पोलीस तक्रारी करतील. आज गट नं 76 मधील पिकांचे नुकसान/चोरी करणार आहेत असे मला सुचित केले आहे. असलम शेख व किरण नन्नवरे यांच्यावर धरणगाव पोलीस स्टेशनवर अनेक पनाका नोंद दाखल केलेले व तहसिलदार धरणगाव यांनी प्रतिबंधक केलेल्या कार्यवाहीचा BNS 351(2)(3) याचा त्यांच्यावर काहीही परिणाम होणार नाही. यांच्यावर परत कायदेशीर कारवाई करावी ही नम्रपणे विनंती करत आहे\r\nतक्रारदार \r\nविवेक देवकर\r\n29/04/2025', '', '', '2025-04-29 19:47:34', 1, 'SADAR QR COD COMPLENT BABAT  JALGAON CITY PS CHE PSO  HC/3196 VIRENDRA SHINDAY YANNA MAHITI KALAVILE AHE ', 20, '2025-04-29 20:39:55'),
(190, '20251900713', 'KANAIYALAL KOHARIMAL LAHORI', '9822191145', 'PLOT NO: 48, NEAR AMBEDKAR MARKET, JILHA PETH, JALGAON 425001', 'JALGAON', 1, 'LOST REPORT', 'Loss of Share certificate as follows Holder Name Kanaiyalal Koharimal Lahori. Company Name Mahindra & Mahindra Limited Folio no K017118 Certificate no 2012859 and 414107 Dist no from 4433285 to 4434884 and 1239135797 to 1239137396 Quantity of Shares 1600 + 1600 Total 3200', '', '', '2025-05-01 14:07:13', 1, 'sadar chi takrar babat jilha peth ps che pi rakesh mangavakar sir yana (8888841988) ya numbvar call karun ', 21, '2025-05-01 14:32:07'),
(191, '20251910332', 'Tulsabai Dayaram Rathod', '9766047266', 'Varsada Tanda Number 1', 'Varsade Tanda', 25, NULL, 'प्रति,\r\nमा.मुख्य सचिव महाराष्ट्र राज्य,\r\n\r\nप्रत कार्यवाहीसाठी:-\r\n१) म.राज्यपाल (महाराष्ट्र राज्य),\r\n२) म.अतिरिक्त मुख्य सचिव सामान्य प्रशासन - सेवा\r\n३) म.मुख्यमंत्री महाराष्ट्र राज्य.\r\n४) म.DGP महाराष्ट्र राज्य\r\n५) म.IG नाशिक\r\n6) म.अध्यक्ष केद्रीय मानव अधिकार आयोग भारत राष्ट्र\r\n७) म.राष्ट्रीय महिला आयोग\r\n\r\nसंदर्भ:- ईमेल सोबत जोडलेले आहे\r\n          आपले सर्कार पोर्टल टोकन COM/HOMD/2025/944 आणि  COM/HOMD/2025/944\r\nविषय:-  4 महिन्याच्या वर झालेल्या फोजदारी गुन्हाची चौकशी ही LCB जळगाव यांच्या कड़े न पाठवता- SP जलगाँव,DYSP पाचोरा,स.पो.नी.प्रकाश काळे यांच्या विरोधात कार्यवाही साठी\r\nसर्व जबाबदार पोलिस कर्मचारी अधिकारी महाराष्ट्र नागरी सेवा (शिस्त व अपील) नियम, १९७९ प्रमाने निलंबन करून मुंबई पोलीस (शिक्षा व अपील) नियम, १९५६ चे नियम ३ तरतुदी नुसार विभागीय चौकशी करुन सेवेतून बडतर्फ करावेत.\r\nमाझ्या मुलीचा व आरोपींचा शोध घेण्यासाठी तपास LCB जलगाव यूनिट कड़े क़ीवा State Crime Investigation Department (CID) कड़े  पाठवन्यासाठी... साडे ५ महीन्याच्या वर तपास FIR-००९/२०२४ पिंपळगाव हरे. पोलिस स्टे. \r\n \r\nमहाशय, \r\nSP जलगाँव,DYSP पाचोरा,स.पो.नी.प्रकाश काळे यांच्या विरोधात कार्यवाही साठी व माझ्या मुलीचा व आरोपींचा शोध घेण्यासाठी तपास LCB जलगाव यूनिट कड़े पाठवन्यात का येत नाही त्याचे स्पष्टीकरण अहवाल मला दिलेले नाही.\r\nसाडे ५ महीन्याच्या वर तपास कालावधी झालेला असून देखिल चौकशी अधिकारी यांनी माझ्या अल्पवयीन मुलीचा व आरोपींचा शोध घेतलेला नाही, तसेच ए.पी.आई. प्रकाश काळे पिंपळगाव हरे पोलिस स्टेशन ने तपास हां LCB जलगाँव कड़े वर्ग केला नाही, वरिष्ट पोलिस अधीक्षक जलगाँव महेश्वर रेड्डी यानी देखील पदाचा दुरूपयोग केलेला आहे.यानी देखील कार्यवाहीसाठी माझ्या अल्पवयीन मुलीचा व आरोपींचा शोध घेण्यासाठी अद्यापही तपास स्थानिक गुन्हा शाखा (एल.सी.बी.) जळगाव कड़े दिलेला नाही व आपले सरकार पोर्टल टोकन बंध करुण कर्तव्य कसूर केलेले आहे. जिल्हा पोलिस प्रशासन प्रमुख म्हणून SP  जबाबदार आहे कारन हेतुपुरस्कार अद्यापही कार्यवाही केलेली नाही. तुमच्या अधिकारातुंन तपास हा स्थानिक गुन्हा शाखा यांच्या कड़े देण्यात यावा किवी स्टेट CID  कड़े पाठवावा. \r\nतसेच प्रकाश काले व चौकशी अधिकारी प्रकाश पाटिल यानी चुकीचे अहवाल अहवाल व सर्व मुद्दे नुसार अहवाल सादर केलेला नाही. सर्व मुद्दे नुसार अहवाल नसतानी बेकायदेशीर पदाचा दुरूपयोग करुण अहवाल पोलिस अधिक्षक जळगाव  यांना सादर केलेले आहे, तसेच शाखा अधिकारी जिल्हा स्तरावर सर्व मुद्दे नुसार अहवाल सादर करुण चौकशी ही 4 महिन्याच्या वर झालेल्या गुन्हाची चौकशी ही LCB जळगाव यांच्या कड़े न पाठवता ठाना प्रभारी प्रकाश काले व चौकशी अधिकारी प्रकाश पाटिल, DYSP पाचोरा यानी त्यांच्या स्तरावर आपले सरकार पोर्टल टोकन निकाली काढून कर्तव्य कसूर केलेले आहे ते BNS २०२३ चे कलम १९८,२२३ प्रमाने फोजदारी गुन्हा आहे, तसेच आपले सरकार पोर्टल शासन निर्णय क्र.संकीर्ण-२०१६/प्र.क्र.१३०/१८(र. व का.) दी.२४ औगष्ट २०१६ मधील ब(5) नुसार Additional SP jalgaon aaple sarkar Nodal Officer -Complaint against API Kale and शाखा ऑफिसर आपले सरकार पोर्टल हे शाखा अधिकारी स्तरावर सर्व मुद्दे निहाय निराकरण करने न्यायिक होते परन्तु एपीआई काले याने त्याच्या स्तरावर मुद्दे निहाय अहवाल दिलेला नाही ,आपले सरकार पोर्टल टोकन शाखा स्तरावर व अपील हे वरिष्ट स्तरावर निराकरण कनेत यावे.\r\nसदरिल सर्व जबाबदार पोलिस कर्मचारी यांच्या विरोधात देखिल शिस्तभंग कार्यवाही करावी.व तुमच्या अधिकारातुंन तपास हा स्थानिक गुन्हा शाखा (एल.सी.बी.) जळगाव कड़े पाठवाला किंवा  State Crime Investigation Department (CID) कड़े  पाठवावा. \r\nआपले सरकार पोर्टल शासन निर्णय क्र.संकीर्ण-२०१६/प्र.क्र.१३०/१८(र. व का.) दी.२४ औगष्ट २०१६ मधील ब(5) नुसार SP व्यक्तिषा जबाबदार आहे. तसेच,Add SP ,नोडल अधिकारी, Home DYSP शाखा अधिकारी यांची  अधिकारी च्या कामकाजावर कायदेशीर नियंत्रण ठेवणे, तसेच आपले सरकार पोर्टल टोकन “शाखा अधिकारी” च्या स्तरावर कायदेशीरित्या दखल घेउन टोकन “शाखा अधिकारी” च्या स्तरावर बंद करने न्यायिक होते. परंतु Home DYSP Pachora Sub Division यांनी टोकन त्यांच्या स्तरावर बंद करुण कर्तव्य कसूर केलेले आहे. BNS २०२३ चे कलम १९८,२२३ प्रमाने फोजदारी गुन्हा आहे त्यानुसार कार्यवाही करावी, जबाबदार जलगाँव SP विरोधात AIS १९६९ चे नियम ३ नुसार निलंबन करावे व विभागीय चौकशी करावी. तसेच सर्व पोलिस कर्मचारी,अधिकारी विरोधात महाराष्ट्र नागरी सेवा (शिस्त व अपील) नियम, १९७९ प्रमाने निलंबन करून मुंबई पोलीस (शिक्षा व अपील) नियम, १९५६ चे नियम ३ तरतुदी नुसार विभागीय चौकशी करुन सेवेतून बडतर्फ करावेत. वेळेत Speaking order मिळावी.\r\nतूळसाबाई दयाराम राठोड,\r\nवय-४६, काम-मजुरी. वरसाडे तांडा, ता. पाचोरा, जि. जळगाव (424202)\r\nमो.नं. ९७६६०४७२६६ दी.०२/०५/२०२५\r\nपाठवले ईमेल द्वारे tulsabaidayaramrathod1979@gmail.com', 'Rathod.pdf', '/uploads/complaint_files/2025-05-02/20250502110332/Rathod.pdf', '2025-05-02 11:03:32', 1, 'pimpalgaon hare pso hc/shantilal pagare yana mahiti devun email kela ahe..', 21, '2025-05-02 11:32:04');
