(192, '20251923712', 'Ishwar Shelar', '9579520001', 'pimpalgon bk424203', 'Pimpalgaon', 25, 'FIR', 'माझ्या कडून पिंपळगाव हरे पोलिस स्टेशन येथे पोलिसांनी जबरदस्तीने जीवी मारण्याची धमकी देऊन खोटे गुन्हे दाखल करण्याची धमकी देऊन खोटे त्यांच्या मनासारखे लिहून घेतलेले आहे. माझ्या कडून सर्व खोटे लिहून घेतलेले आहे, माझी सर्व आरोपींन विरोधात जी मी लेखी फिर्याद दिलेली आहे त्यानुसार फोजदारी गुन्हा दाखल करन्यात यावा तसेच पोलिस स्टेशन प्रभारी यांची चौकशी करून त्यांना कर्तव्य कसूर केले म्हणून निलंबन करण्यात यावेत.यादरम्यान माझी हत्या झाल्यास सर्व आरोपी व ठाना प्रभारी जबाबदार असणार. मला तत्काल पोलीस सुरक्षा मिलावी', 'Ishawar.pdf', '/uploads/complaint_files/2025-05-02/20250502123711/Ishawar.pdf', '2025-05-02 12:37:12', 1, 'PIMPALGAON PS CHE PSO HC/SHANTILALA PAGARE MOB NO.9511881688 YANA MAHITI DILI AHE, PUDHIL KARVAI KARNE BABAT SANGITALE AHE..', 21, '2025-05-02 12:47:25'),
(193, '20251930820', 'Shalaka Kango', '8446519541', 'Mahabal area', 'Jalgaon', 4, 'Lost driving license and Pan card', 'I lost my driving license and PAN Card around 14 April 2025. Below are the details:  DL No. MH19 20240019386  PAN : KZSPK8833A', '', '', '2025-05-04 12:08:20', 1, 'sadar complain chi savisatr mahiti ramanand nagar pso LHC/ 1536 USHA SONVANE yana dili ahe.', 20, '2025-05-04 15:51:22'),
(194, '20251941809', 'यमुना उज्जैन पाटिल', '8668244124', 'तासखेडे', 'अमळनेर', 28, 'एफ आय आर', 'मी यमुना पाटील राहणार तासखेडे  ता अमळनेर जि जळगाव मी आमच्या पाडलेल्या घरी नळाला पाणी येईल म्हणून तिथे गेली असता आमचे शेजारी दगडू चैत्राम पाटील कल्पना दगडू पाटील (मुलगी) कोमल पाटील यांनी तिथे कचरा व तुटलेल्या चपला या पडलेल्या घरात फेकल्या म्हणून मी त्या चपला व कचरा साफ करून बाजूला टाकल्या तर त्यांनी मला शिवीगाळ केली व धमकवले कि तुम्हाला इथे पाय ठेवायला नाही सांगितले आहे ना तु इथे का आली तुम्हाला मागे मारल ते कमी झाल आता जर पुन्हा दिसली तर जिवंत सोडणार नाही अशी धमकी दिली व विचित्र प्रकारच्या शिवीगाळ केल्या', '', '', '2025-05-04 13:18:09', 1, 'SADAR COMPLAIN CHI SAVISTAR MAHITI AMALANER PSO HC/ PRAMOD PATIL YANA DILI AHE.', 20, '2025-05-04 16:14:46'),
(195, '20251955141', 'Nilesh Namdeo Ubhale', '8329984521', 'Bhoje', 'Bhoje', 25, 'BNSS २०२३ चे कलम १७३(१) नुसार तसेच  Sindhu Janak Nagargoje vs The State Of Maharashtra on 8 August, 2023 नुसार में.सुप्रीम कोर्टच्या आदेश प्रमाने सर्व जबाबदार व्यक्ति विरोधात दखलपात्र फोजदारी गुन्हा दाखल करण्यासाठी माझी लेखी फिर्याद आहे, फोजदारी गुन्हा दाखल करून चौकशी करण्यात यावी.', 'वन परिक्षेत्र अधिकारी पाचोरा, वनपाल नांन्द्रा, सहाय्यक वनसंरक्षक(रोहयो व वन्यजीव), उपवनसंरक्षक (DCF), जळगाव,\r\n\r\nभोजे येथील सावता स्वामिल मालक मोहन भिका पाटिल,शेतकरी व अन्य सर्व जबाबदार व्यक्ति,अधिकारी विरोधात BNSS २०२३ चे कलम १७३(१) नुसार तसेच  Sindhu Janak Nagargoje vs The State Of Maharashtra on 8 August, 2023 नुसार में.सुप्रीम कोर्टच्या आदेश प्रमाने सर्व जबाबदार व्यक्ति विरोधात दखलपात्र फोजदारी गुन्हा दाखल करण्यासाठी माझी लेखी फिर्याद आहे, फोजदारी गुन्हा दाखल करून चौकशी करण्यात यावी.', 'BNSS १७३ १  फाइनल पोलिस सावता Swamil.pdf', '/uploads/complaint_files/2025-05-04/20250504175140/BNSS १७३ १  फाइनल पोलिस सावता Swamil.pdf', '2025-05-04 17:51:41', 1, 'SADAR COMPLAINCHI MAHITI PIMPLAGAON PS CHE HC / 1489 PAWAR YANA MAHITI DILI AHE', 20, '2025-05-04 20:18:20'),
(196, '20251963405', 'Nilesh Namdeo Ubhale', '8329984521', 'Bhoje', 'Bhoje', 25, 'BNSS २०२३ चे कलम १७३(१) नुसार तसेच  Sindhu Janak Nagargoje vs The State Of Maharashtra on 8 August, 2023 नुसार में.सुप्रीम कोर्टच्या आदेश प्रमाने सर्व जबाबदार व्यक्ति विरोधात फोजदारी गुन्हा दाखल करण्यासाठी माझी लेखी फिर्याद आहे', 'Chief Conservator of Forests (Territorial), Dhule, सहाय्यक वनसंरक्षक(रोहयो व वन्यजीव) जलगाँव ए.पी.पंडित, उपवनसंरक्षक (DCF), जळगाव Mr.प्रवीण ए. (Nodal Officer) आपले सरकार पोर्टल, व वन परिक्षेत्र अधिकारी पाचोरा अरशद मुलानी, तसेच वनपाल नांन्द्रा यांच्या विरोधात BNS २०२३ चे कलम २२३,१९८ प्रमाने फोजदारी गुन्हा दाखल करण्यात यावा व पदाचा दुरुपयोग बेकायदेशीर कृत्यास सुरु ठेवन्यासाठी आरोपींना कायदेशीर कार्यवाही पासून वाचवनीन्यासाठी सर्वना सह आरोपी करण्यात यावे अन्य कलमाअंतर्गत.\r\n\r\nतसेच माझी स्वामील मालक गणेश भिका पाटिल, यांच्या विरोधात अवैध्य रक्ष तोड़ करुण,चोरी करुण, अवैध्य वाहतुक करुने, तसेच झाडांची रक्षाची तस्करी करने, पर्यावरनाची हानी करने, तसेच खरेदी- विक्री चे रिकॉर्ड न ठेवता टैक्स चौरी करुण सरकारची आर्थिक फसवणुक केल्यामूळ यांच्या विरोधात BNSS २०२३ चे कलम १७३(१) नुसार तसेच  Sindhu Janak Nagargoje vs The State Of Maharashtra on 8 August, 2023 नुसार में.सुप्रीम कोर्टच्या आदेश प्रमाने सर्व जबाबदार व्यक्ति विरोधात फोजदारी गुन्हा दाखल करण्यासाठी माझी लेखी फिर्याद आहे, फोजदारी गुन्हा दाखल करून चौकशी करण्यात यावी.', '11zon_merged-PDF.pdf', '/uploads/complaint_files/2025-05-04/20250504223405/11zon_merged-PDF.pdf', '2025-05-04 22:34:05', 1, 'SADAR TAKRAR PIMPALGAON PS LA EMAIL KELA AAHE', 20, '2025-05-05 10:37:12'),
(197, '20251973224', 'Nilesh Namdeo Ubhale', '8329984521', 'Bhoje', NULL, 25, 'FIR', 'विषय:वन परिक्षेत्र अधिकारी पाचोरा, वनपाल नांन्द्रा, सहाय्यक वनसंरक्षक(रोहयो व वन्यजीव), उपवनसंरक्षक (DCF), जळगाव,\r\nभोजे येथील वक्रतुंड स्वामिल मालक गणेश भिका पाटिल,शेतकरी व अन्य सर्व जबाबदार व्यक्ति,अधिकारी विरोधात BNSS २०२३ चे कलम १७३(१) नुसार तसेच  Sindhu Janak Nagargoje vs The State Of Maharashtra on 8 August, 2023 नुसार में.सुप्रीम कोर्टच्या आदेश प्रमाने सर्व जबाबदार व्यक्ति विरोधात दखलपात्र फोजदारी गुन्हा दाखल करण्यासाठी माझी लेखी फिर्याद आहे, फोजदारी गुन्हा दाखल करून चौकशी करण्यात यावी.', 'BNSS १७३ १  फाइनल पोलिस वक्रतुंड Swamil.pdf', '/uploads/complaint_files/2025-05-05/20250505003224/BNSS १७३ १  फाइनल पोलिस वक्रतुंड Swamil.pdf', '2025-05-05 00:32:24', 1, 'SADAR TAKRAR PIMPALGAON PS LA EMAIL KELA AAHE', 20, '2025-05-05 10:37:06'),
