(199, '20251990122', 'Nilesh Namdeo Ubhale', '8329984521', 'Bhoje', 'BHOJE', 25, 'FIR', 'ग्राम विकास विद्यालय पिंपळगाव हरे. मंडल संचालित “ग्राम विकास विद्यालय पिंपळगाव हरे.” ह्या शिक्षण संस्थेत K.S. पवार प्राथमिक व माध्यमिक वरसाडे-आश्रम शाळेतील मुख्याद्यापक,अध्यक्ष,सचिव आणि स्कूल कमिटी व अन्य  सर्व जबाबदार व्यक्ति अधिकारी विरोधात BNSS २०२३ चे कलम १७३(१) नुसार तसेच  Sindhu Janak Nagargoje vs The State Of Maharashtra on 8 August, 2023 नुसार में.सुप्रीम कोर्टच्या आदेश प्रमाने माझी लेखी फिर्याद आहे, फोजदारी गुन्हा दाखल करून चौकशी करण्यात यावी.', 'To ragisted FIR at Pimplagaon Hare Police station.pdf', '/uploads/complaint_files/2025-05-05/20250505230122/To ragisted FIR at Pimplagaon Hare Police station.pdf', '2025-05-05 23:01:22', 1, 'PIMPALGAON PS LA EMAIL KELA AAHE', 21, '2025-05-05 23:18:37'),
(200, '20252000926', 'किशोर वालचंद जैन', '9420439496', 'मु. पो. पारोळा जी. जळगाव घर न 1043', 'मु. पो. पारोळा जी. जळगाव', 29, 'घरफोडी करून चोरीचा प्रयत्न', 'घरफोडी करून चोरीचा प्रयत्न व कागद पत्र शोधण्याच्या प्रयत्न केले गेले आहे , तात्काळ लेखी तक्रार केली गेली आहे', 'New Doc 05-05-2025 21.57.jpg', '/uploads/complaint_files/2025-05-06/20250506130926/New Doc 05-05-2025 21.57.jpg', '2025-05-06 13:09:26', 1, 'sadar takrari aarja chi mahiti parola ps che pso pn 731/ jayant sapkale yanna phone karun kalvale ahe.te yatil aarj darala phone karu pudhil mahiti ghet ahe.babat kalvale ahe.', 21, '2025-05-06 13:40:26'),
(201, '20252015624', 'विवेक गजानन देवकर', '९९६०६००९९९', 'आदर्शनगर', 'जळगाव', 1, 'आज परत दि.06/05/2025 कोर्ट ५वे सिव्हिल जज सिनियर डिव्हीजन जळगाव यांच्या कोर्ट रूम बाहेर दुपारी 1 वाजे च्या दरम्यान श्री गजानन देवकर यांच्या मार्फत श्री श्रीनाथ देवकर व सनील देवकर यांनी मला (विवेकला ) धमकी दिली', 'ईमेल केला आहे ८/0५/२०२५ वेळ १७:०४ संध्याकाळ \r\nपोलीस निरीक्षक सा.\r\nजळगाव शहर पोलीस ठाणे जळगाव\r\nमहात्मा फुले मार्केट समोर नवी पेठ\r\nजळगाव.\r\n\r\nतक्रारदार/अर्जदार  :- विवेक देवकर \r\nप्रतिकअपार्टमेंट फ्लॕट नं 1व2\r\nआदर्शनगर डी-मार्ट जवळ जळगाव\r\nमो.9960600999 \r\n\r\nतक्रारविरूध्द:- 1) श्री श्रीनाथ देवकर मो. 95036 52734\r\n2) श्री सनिल श्रीनाथ देवकर मो.9970308466\r\n3) श्री गजानन देवकर रा. 203 बळीराम\r\nपेठ, देवकर निवास जळगाव मो.9892430816; 9082260043\r\n4) किरण त्र्यंबक नन्नवरे रा.समता नगर पाळधी ता.धरणगाव मो.91 80075 63580\r\n5) असलम शेख जेऊर शेख रा. 6) अशपाक शेख असलम शेख मशिदजवळ पाळधी ता.धरणगाव मो. 90498 23129\r\n\r\nसविनय तक्रार करत आहे.\r\nसा.वाले क्र.१ हे अर्जदाराचे सख्खा सर्वात मोठा आहे व सा.वाले क्र ३ चे मुखत्यारपत्र धारक आहेत.\r\nसा.वाले क्र २ हे सा.वाले क्र १ चा मुलगा आहे.\r\nसा. वाले क्र.३ हे अर्जदाराचे व सा.वाले क्र १ चे वडील आहेत.\r\nसा. वाले क्र ४ ,५,व क्र ६ यांच्यावर पाळधी दूरक्षेत्र ता.धरणगाव व धरणगाव पोलीस स्टेशनला अदखलपात्र गुन्हा  नोंद असूनही तरी सुध्दा यांचे तक्रारदार यांच्या शेतावर नुकसान करण्यासाठी येणे अद्यापही सुरूच आहे.\r\n\r\nजळगाव न्यायालयात वडील सा.वाले क्र. 3 श्री गजानन देवकर यांनी स्पे.दिवाणी दावा क्र 140 (माझ्या)तक्रारदार  विरोधात दाखल केलेला आहे. तक्रारदार यांनी दाखल केलेल्या अर्जाची सुनावणी दि.06/04/2025 झाली अर्जाची काॕस्ट रू1000/- मे.न्यायालयाने ठरवून मंजुरीची काॕस्ट सा.वाले क्र ३चे श्री गजानन देवकर तर्फे ज.मु.श्री श्रीनाथ देवकर यांनी स्वीकारले ची नोंद करून जळगाव कोर्टरूम मधून बाहेर आल्यावर अंदाजाने वेळ दु 1 वाजता परत सा.वाले क्र ३ श्री गजानन देवकर यांच्या मार्फत व स्वतः श्री श्रीनाथ देवकर व सनील देवकर यांनी धमकी दिली की \" तुझी मुंबईतील सदनिका क्र 172 ही श्री गजानन देवकर यांच्या नावावर करून दे, तसेच तू दाखल केलेले खालील फौजदारी खटले व दिवाणी दावा क्र 252/2023 काढून घे. 1) अर्जदाराची पत्नी सौ रूपा देवकर हिने दाखल केलेला स्त्रीधन बद्दल फौजदारी खटला क्र 102/2021\r\n2) देवकर एक्सपोर्ट प्रा.ली. कंपनीचे जळगाव फौजदारी न्यायालयात दाखल असलेले अपील क्र 80/2021\r\n3) आई कै.सौ.सुनिला गजानन देवकर यांचे मृत्यूपत्र रद्द करणेबाबत चा दिवाणी दावा क्र 252/2023. तसेच \r\nदेवकर एक्सपोर्ट प्रा.ली बद्दल व सा.वाले क्र ३चे श्री गजानन देवकर यांच्या विरोधात जळगाव शहर पोलीस ठाणे व कफपरेड पोलीस ठाणे मुंबई व उपनिबंधक सहकारी संस्था A विभाग मुंबई व कफपरेड मुंबई पोलीस स्टेशनला अभिलाषा प्रि.काॕ-आॕप सोसायटी कफ परेड मुंबई येथील सदनिका क्र 172 बाबतीत केलेल्या सर्व तक्रारी ताबडतोब काढून घे. तरच तुझ्या पत्नी चे सोन्याचे दागिने मिळतील. तसेच सा.वाले क्र.३ श्री गजानन देवकर यांच्या संपत्तीच्या वाटणीत हिस्सा मिळेल. \r\nतू तुझ्या कोणत्याही अविभक्त  कुटुंबाच्या मालकीच्या मालमत्ता व जंगम मालमत्तेचा कुठेही उल्लेख करायचा नाहीस व निकीता अपार्टमेंट फ्लॅट नं 203  बळीराम पेठ या पत्याचा उल्लेख करायचा नाही, नाहीतर याचा अतिशय वाईट व गंभीर परिणाम होईल अशी धमकी सा.वाले क्र 1 श्री श्रीनाथ देवकर व सा.वाले क्र 2 सनिल देवकर यांनी मला जळगाव न्यायालय कोर्टरूम च्या बाहेर दिली. श्री गजानन देवकर यांनी मला दिलेल्या धमकी उल्लेख करून या दोघांनी सुचित केले की,\" पाळधी ता.धरणगाव येथील सा.वाले क्र ४ गुंड किरण त्र्यंबक नन्नवरे , सा.वाले क्र ५ असलम शेख जेबुर शेख व त्याचा मुलगा अशपाक शेख असलमशेख हे तुला पाळधी येथील गट नं 84/1 , 84/2 ,76 व तू 252/2023 च्या दाव्यात उल्लेख केलेल्या गट नं 66/2 व 65 मधील सर्व शेतावर येऊन नुकसान, हैराण करतील. मजूरांना शेतावर येऊ देणार नाहीत. तुझ्यावर खोट्या अॕट्रोसिटी ची तक्रारी पाळधी पोलीस स्टेशनला करतील. ही माणसे शेतावरील मालाला आग लावून तुझ्यावर आळ घेतील. तू शेतावर आल्यास तुझ्या कारचे नुकसान व मारहाण करणार आहेत. तुझ्या शेतातील गट नं 84/1 च्या विहिरीत कुठूतरी पाईप आणून नुकतेच टाकले आहेत व विहिरीत गाळ जमा होण्यासाठी विहीरी जवळ मोठमोठे खड्डे नुकतेच केले आहेत खात्री कर. किरण नन्नवरे व इतर दोघांवर पोलीस तक्रारी चा काहीच उपयोग होणार नाही ते कायम शेतात तुला त्रास व नुकसान करण्यासाठी येतील असे सुचित केले आहे. या सर्वांच्या वर कायदेशीर कारवाई करावी ही नम्रपणे विनंती करत आहे.\r\nतक्रारदार ,\r\nविवेक देवकर\r\n08/05/2025', '', '', '2025-05-08 18:56:24', 1, 'qr compent babat jalgaon city  ps la pso hc/1815 dhandey yanna phon karun mahiti kalavile ahe v emeail dekhil pathola ahe ', 20, '2025-05-08 22:18:40'),
(202, '20252024447', 'मयूर अविनाश हजारे', '8208947453', 'रामेश्वर कॉलनी', 'मेहरून', 6, 'नॉर्मल', 'मला श्री सचिन अरुण नगरे याच्या कडून  मार हान व घाणेरड्या भाषेत बोलण्या आले व संपूर्ण कुटुंब व परिसातील माझ्या एकट्या वर धाऊन आले. माझी काही चूक नसताना आणि जिवे मारण्याची घमकी देण्यात आली स्थळ .भुसावळ नाहटा कॉलगे चौक .जिल्हा जळगाव ..अपेक्षा सामनेवाले यांनी माफी मागावी', '', '', '2025-05-08 19:44:47', 1, 'qr compent babat jalgaon midc ps la pso hc/408 mukund patil yanna phon karun mahiti kalavile ahe v emeail dekhil pathola ahe ', 20, '2025-05-08 22:16:57'),
