(204, '20252040614', 'अमोल', '7721062609', 'अकोला', 'Akola', 6, 'कमावरचे पैसे देत नहीं आहे', 'दीड महिने झाले मी काम करत आहे शौर्य यात्रा कंपनी कडे पगार देत नहीं आहे 5 दिवस झाले तेच्या मग फिरत आहे मी तो खूप त्रास देत आहे पैशे साठी मी काम केलं तेच मोबदला पाहिजे न मग तो खूप सतावत आहे मयुरेश वाघ', '', '', '2025-05-09 18:06:14', 1, 'yatil takrardar yanchi mahiti jalgaon midc ps che pso HC 2735/ ishwar lokhande yanna phone karun dili ahe.te,caller yanna madat karit ahe.baddal tyani kalvale ahe.', 21, '2025-05-09 18:33:45'),
(205, '20252050014', 'Natthu Pandurang Patil', '9665948302', 'Bhoje', 'Bhoje', 25, 'भोजे ग्रामपंचायत हद्दीत माझ्या घरासमोर बेकायदेशीररित्या सरकारी            जमीन वर अतिक्रमण करुण बेकायदा बांधकाम विरोधात तत्काल     परवानगी नसलेले बांधकाम थांबविनयात यावी व आरोपी विट्ठल    दसरत जाधव (भोजे) फोजदारी गुन्हा दाखल करण्यात यावा.', 'भोजे ग्रामपंचायत हद्दीत,भोजे ग्रामपंचायत जवळील माझ्या घरासमोर बेकायदेशीररित्या सरकारी जमीन वर अतिक्रमण करुण बेकायदा बांधकाम भोजे येथील आरोपी विट्ठल दसरत जाधव(मो.९४२१६३५८८४) करीत आहे, म्हणून तत्काल कायदा सुव्यवस्ता राखण्यासाठी तुम्ही तत्काल बांधकाम परवानगी नसलेले बांधकाम थांबवावे व सदरील व्यक्ति विरोधात क्रिमिनल ट्रेसपास केल्यामूळ अवैध्य बांधकाम केल्यामुळ फोजदारी गुन्हा दाखल करावा.नत्थू पांडुरंग पाटिल\r\nरा.भोजे मो.९६६५९४८३०२ दी.12.5.2025', '', '', '2025-05-12 13:00:14', 1, 'PIMPALGAON PSO HC/PANDURANG GORBANJARA YANA MAHITI DEVIN EMAIL SUDHA KELA AHE..', 21, '2025-05-12 13:05:16'),
