(207, '20252073701', 'आशुतोष सुरेश झारे', '9552538010', '१० लक्ष्मी नगर मु जे महा विद्यालय मागे', 'जळगाव', 4, 'वस्तू खरेदी विक्री मध्ये लबाडी आणि आर्थिक मानसिक नुकसान', 'छ. संभाजी नगर येथील ए के इंडस्टीरज , गट न. २४८ , शान्तयी उ द्योग समूह , वाळूज  औद्योगिक वसाहत , छ. अंभजी नगर यांचे मालक अंकुश कुमावत आणि मोनाली अंकुश कुमावत मो. ७७७५९०३३०३ यांनी दि. १५/०४/२०२५ च्या माझ्या निनाद इंजि. या कंपनी साठी ०५ एम एस चे रॅक ड्रॉवर बनवण्याचे काम रु. २१०००/- के मार्फत गेहून करण्याची ऑर्डर घेतली आणि काम  वेळेत पूर्ण केले नाही tasech pasie hi parat karat naahi म्हणून faswanukichi तक्रार.', 'IMG-20250415-WA0021.jpg', '/uploads/complaint_files/2025-05-13/20250513093701/IMG-20250415-WA0021.jpg', '2025-05-13 09:37:01', 1, 'sadar complain chi savistar mahiti ramanand nagar ps che pc / ajij shaha yana dili ahe. ', 20, '2025-05-13 10:03:58'),
