(210, '20252101101', 'Ishwar Shelar', '9579520001', 'Pimplagaon hare', 'Pimpalgaon', 25, '20251923712  ट्रॅकिंग आयडी SHANTILALA PAGARE यांचे विरोधात कार्यवाही करावी', 'PIMPALGAON PS CHE PSO HC/SHANTILALA PAGARE MOB NO.9511881688 YANA MAHITI DILI AHE, PUDHIL KARVAI KARNE BABAT SANGITALE असूल त्यांनी अद्यापही फोजदारी गुन्हा BNSS २०२३ चे कलम १७३ (१) प्रमाने दाखल न करता कर्तव्य कसूर केलेले आहे निलंबन करण्यात यावे..\r\nमाझ्या कडून पिंपळगाव हरे पोलिस स्टेशन येथे पोलिसांनी जबरदस्तीने जीवी मारण्याची धमकी देऊन खोटे गुन्हे दाखल करण्याची धमकी देऊन खोटे त्यांच्या मनासारखे लिहून घेतलेले आहे. माझ्या कडून सर्व खोटे लिहून घेतलेले आहे, माझी सर्व आरोपींन विरोधात जी मी लेखी फिर्याद दिलेली आहे त्यानुसार फोजदारी गुन्हा दाखल करन्यात यावा तसेच पोलिस स्टेशन प्रभारी यांची चौकशी करून त्यांना कर्तव्य कसूर केले म्हणून निलंबन करण्यात यावेत.यादरम्यान माझी हत्या झाल्यास सर्व आरोपी व ठाना प्रभारी जबाबदार असणार. मला तत्काल पोलीस सुरक्षा मिलावी', 'अपील.pdf', '/uploads/complaint_files/2025-05-13/20250513111100/अपील.pdf', '2025-05-13 11:11:01', 1, 'sadar complain chi savistar mahiti pipalgaon ps che pso hc/ pagare yana dili ahe', 20, '2025-05-13 11:36:10'),
(211, '20252112800', 'Natthu Pandurang Patil', '9665948302', 'Bhoje', 'Bhoje', 25, 'पोलिस पांडू हवलदार यांनी कायदेशीर कार्यवाही केले नाही -निलंबन करावे 20252101101', '20252101101 क्र.पांडू  हवलदार यांनी कायदेशीर कार्यवाही केले नाही BNSS चे कलम १७३ (१)नुसार माझा जबाब नोदउन फोजदारी गुन्हा दाखल केला नाही व ग्रामपंचायत कड़े जा असे सांगुन कर्तव्य कसूर केलेले आहे,-जबाबदार पोलिस कर्मचारी चे निलंबन करावे व माझ्या तक्रारी वर तत्काल दखल घेउन कार्यवाही करावी.                                                                                \r\nभोजे ग्रामपंचायत हद्दीत,भोजे ग्रामपंचायत जवळील माझ्या घरासमोर बेकायदेशीररित्या सरकारी जमीन वर अतिक्रमण करुण बेकायदा बांधकाम भोजे येथील आरोपी विट्ठल दसरत जाधव(मो.९४२१६३५८८४) करीत आहे, म्हणून तत्काल कायदा सुव्यवस्ता राखण्यासाठी तुम्ही तत्काल बांधकाम परवानगी नसलेले बांधकाम थांबवावे व सदरील व्यक्ति विरोधात क्रिमिनल ट्रेसपास केल्यामूळ अवैध्य बांधकाम केल्यामुळ फोजदारी गुन्हा दाखल करावा.\r\nनत्थू पांडुरंग पाटिल\r\nरा.भोजे\r\nमो.९६६५९४८३०२', '', '', '2025-05-13 12:28:00', 1, 'sadar complain chi savistar mahiti pipalgaon ps che pso hc/ pagare yana dili ahe', 20, '2025-05-13 12:58:42'),
(212, '20252120249', 'श्री.नचिकेत प्रकाश वाणी', '९१५६९२५९५६', 'रा. ११३, प्रकाश ऑप्टिकल,  नवी पेठ, जळगांव, ता. जि. जळगांव', 'जळगांव, ता. जि. जळगांव', 1, 'फिर्यांदींची नमूद आरोपींनी फसवणूक केल्याने  ताबडतोब गुन्हा दाखल करण्याबाबत', '५)	फिर्यादी यांनी खरेदीखताचे पोटी ठरल्याप्रमाणे व बाजार मुल्या नुसार एकूण रक्कम रुपये ६,००,०००/-लाखपैकी रक्कम रुपये ३,००,०००/-लाख हि फिर्यादी चेक व रोख स्वरुपात दिलेली असून उर्वरित रक्कम रुपये ३,००,०००/-लाख हि दुय्यम निबंधक कार्यालय यांचेकडे खरेदीखत लिहून नोंदणी करतेवेळी द्यावयाची होती दरम्यान आरोपी यांनी खरेदीखतासाठी केलेल्या सौदापावती पोटी रकमा घेवून फिर्यादीची फसवणूक करण्याच्या हेतूने संगनमत करून दिनांक ०८/०८/२०२३ रोजी मिलिंद काशीनाथ टोके व सौ सुरेखा जितेंद्र वानखेडे यांना खरेदीने विक्री केलेली आहे .आरोपी न.१  व २ यांनी दोघांनी मिळून फिर्यादी यांना आर्थिक,मानसिक त्रासात अडकवण्यासाठी संगनमत करून स्वतःच्या फायद्यासाठी व फिर्यादी यांचे नुकसान व्हावे म्हणून कट रचून आरोपी आपसात नातेवाईक असल्याने ते सर्व संगनमताने व एकाच हेतूने  गुन्हा केला', 'police scan 25.pdf', '/uploads/complaint_files/2025-05-13/20250513150249/police scan 25.pdf', '2025-05-13 15:02:49', 1, 'yatil takrardar yanchi mahiti jalgaon city ps che pso ASI/ sangeeta khandre yanna kalvale ahe.te pudhil karvai karit ahe.', 21, '2025-05-13 17:01:50'),
