(219, '20252190231', 'Nilesh Namdeo Ubhale', '8329984521', 'Bhoje', 'bhoje', 25, 'FIR', 'सिंधु जनक नागरगोजे विरुद्ध महाराष्ट राज्य प्रकरण प्रमाने-सुप्रीम कोर्ट, IPC 1860 154(1) and BNSS 2023 under section 173(1) प्रमाने - असिस्टेंट इंजिनियर पिंपळगाव हरे.,उप-कार्यवाही अभियांता पाचोरा उपविभाग-१ शामकांत पांडुरंग खोड्पे , सुनील महादेव माळी शोभना सुनील माळी यांच्या विरोधात फोजदारी गुन्हा दाखल करण्यासाठी..', 'FIR Sunil_11zon.pdf', '/uploads/complaint_files/2025-05-17/20250517150230/FIR Sunil_11zon.pdf', '2025-05-17 15:02:31', 1, 'PIMPALGAON PS LA EMAIL SEND KELA AAHE', 21, '2025-05-17 21:12:52'),
(220, '20252200535', 'Nilesh Namdeo Ubhale', '8329984521', 'Bhoje', 'bhoje', 25, 'RTI एक्ट  नुसार   प्राप्त माहिती-दी.३१.५.२०२४ रोजिचा तपासणी अहवाल नुसार फोजदारी कार्यवाही', 'संधर्भ:RTI एक्ट  नुसार   प्राप्त माहिती-दी.३१.५.२०२४ रोजिचा तपासणी अहवाल नुसार फोजदारी कार्यवाही\r\nग्राहक क्र. 122620824362 (सुनिल माधव माळी) \r\nविषय:  सिंधु जनक नागरगोजे विरुद्ध महाराष्ट राज्य प्रकरण प्रमाने-सुप्रीम कोर्ट, IPC 1860 154(1) and BNSS 2023 under section 173(1) प्रमाने - असिस्टेंट इंजिनियर पिंपळगाव हरे.,उप-कार्यवाही अभियांता पाचोरा उपविभाग-१ शामकांत पांडुरंग खोड्पे , सुनील महादेव माळी शोभना सुनील माळी यांच्या विरोधात फोजदारी गुन्हा दाखल करण्यासाठी..', 'FIR ३१.५.२४ sunil electricity.pdf', '/uploads/complaint_files/2025-05-17/20250517160534/FIR ३१.५.२४ sunil electricity.pdf', '2025-05-17 16:05:35', 1, 'PIMPALGAON PS LA EMAIL SEND KELA AAHE', 21, '2025-05-17 21:11:25'),
(221, '20252212130', 'योगेश सुरेश पाटील', '9823856462', 'गिरडगाव', 'गिरडगाव. तालुका -यावल', 14, 'ध्वनी प्रदूषण.ट्रॅक्टर वरती मॉडिफाईड करून साऊंड सिस्टिम वाजवणे.', 'रिस्पेकटेड सर मी योगेश सुरेश पाटील. गाव -गिरडगाव. माझी तक्रार गावातील नारायण भागवत बोरसे यांच्या मालकीचे फर्ग्युशन ट्रॅक्टर त्या वरती केलेली मॉडिफाईड साऊंड सिस्टिम ने रात्री बे रात्री दिवसा कधी पण मोठा आवाज करून गावात त्याचा मुलगा दिगंबर बोरसे वाजवतो आमच्या घरात15 महिने चे लहान मुलं आहे. व शेजारी ऑपेरेशन झालेले पेशन्ट सुद्धा आहे. पूर्ण मेन रोड ला १ वर्षा पर्यंत चे बाड आहेत आम्ही गावातील १०-१२  जणांनी तोंडी सोरूपात त्याची तक्रार त्याच्या वडिलांना,काका ना करून सुद्धा काही फरक पडला नाही. पोलीस पाटील यांनी त्याला 2-3 वेळ सांगून सुद्धा तो ऐकत नाही आहे शेवटी आम्ही तुमच्या कडे तक्रार करत आहो सर.आमच्या तक्रारी चे निवारन होने ही विनंती', '', '', '2025-05-17 16:21:30', 1, 'YAWAL PS LA EMAIL KELA AAHE', 21, '2025-05-17 21:09:02'),
(222, '20252223549', 'मोमीन मुझम्मिल', '7387231384', 'संगमनेर', 'संगमनेर', 1, 'पायमेन्ट बाकी है', 'है सर मेरा नाम मुझम्मिल मोमीन है माई संगमनेर का गाडी ४ व्हिलर का बुसीन्सस का करता हू आज से ५ महिने पिहले माई ने एक कार जळगाव माई सेल किया था ४ जनुकारी २०२५ को जळगाव का एक कॉस्ट्यूमर हशम जहागीरदार को डील हुआ  कि निल सर्टिफिकेट अणे के बॅड होल्ड पायमेन्ट ५०००० सेंड कर देंगे  माई ने Deal के मुत्तबीक पुरा प्रोसेस किया कार ऊन के नाम.पार ट्रान्सफर किया ऊस के मतबीक उन्हाने सिर्फ ३०००० दिये बाकी या २०००० अब ताक दिया नाही उपर से कॉल मसग बी इग्नोर करते है', '', '', '2025-05-17 23:35:49', 1, 'JALGAON CITY PS LA EMAIL KELA AAHE ', 21, '2025-05-17 23:48:03'),
(223, '20252231404', 'Nutan', '9673379316', NULL, 'उंदीरखेडे', 29, 'घरेलु हिंसा', 'माझा नवरा  मला खूप त्रास देतो मारहाण करतो आज तर  माझ्या लग्न झालेल्या मूली ला मारहाण केली मुलगी २ महिन्याची बाळंतीन  आहे', '', '', '2025-05-18 21:14:04', 1, 'yatil takrardar yanchi mahiti parola ps che pso hc 1388/ kailash salunke yanna phone karun dili ahe.te takrardar yanna madat karit ahe.baddal tyani kalvale ahe.', 21, '2025-05-18 23:16:06'),
