(227, '20252274819', 'विवेक गजानन देवकर', '९९६०६००९९९', 'आदर्शनगर', 'जळगाव', 1, 'दि.06/05/2025 रोजी कोर्ट ५वे सिव्हिल जज सिनियर डिव्हीजन जळगाव यांच्या कोर्ट रूम बाहेर दुपारी 1 वाजे च्या दरम्यान श्री गजानन देवकर यांच्या मार्फत व स्वतः श्री श्रीनाथ देवकर व सनील देवकर यांनी मला (विवेकला तक्रारदाराला)परत गंभीर व वाईटपरिणाम होईल अशी धमकी दिली', 'मी विवेक गजानन देवकर वय ६२ जळगाव शहर पोलीस ठाणे येथे दि. ०८/०५/२०२५ ला रात्री २१:२३ ला तक्रार दिली होती. मी माझ्या पत्नीच्या रूपा विवेक देवकर हिच्या फुफुस (लंग) च्या उपचारासाठी अहमदाबाद येथील झायडस हाॕस्पीटल ला गेलो होतो. मी जळगावला आल्यावर श्री श्रीनाथ देवकर यांनी सुचित केल्याप्रमाणे माझ्या शेतातील पाळधी गट नं ८४/१ येथील विहिरीवर माझा मित्र श्री दिनेश वाणी याच्यासोबत गेल्यावर मला मानसिक त्रास देण्यासाठी व खोटी तक्रार करण्यासाठी किरण नन्नवरे असलम शेख जेऊर शेख व त्याचा मुलगा अशपाक शेख यांनी कुठून तरी चोरीचे पाईप चे बंडल अंदाजे ५ ते ७ बंडल किंमत अंदाजे रू १५०००/- रू पंधराहजारमात्र माझ्यावर खोटी तक्रार दाखल करण्यासाठी टाकलेले आहेत. याबद्दल पाळधी ता.धरणगाव पोलीस ठाणे धरणगाव येथे सुचित करण्यात यावे. माझ्या ईमेल च्या तक्रारीत मी सर्व उल्लेख केलेला आहे. किरण नन्नवरे व असलम शेख हे दोघही माझ्या मागे पोलीसांचा ससेमिरा लागावा यासाठी खोट्या तक्रारी करणार आहे असे मला श्री श्रीनाथ देवकर व सनिल देवकर यांनी श्री गजानन देवकर यांच्या मार्फत आधीच धमकी देऊन सांगितले आहे. पाळधी पोलीस ठाणे व धरणगाव पोलीस ठाणे यांना या व्यक्ती च्या विरोधात सक्त कारवाई करण्यात यावी यासाठी नम्रपणे विनंती करत आहे माझ्या शेतावर मला येण्यासाठी अडथळा आणत आहे. या व्यक्तींचे माझ्याशेतावर येणे चालूच आहे.  तक्रारदार विवेक देवकर २३/०५/२०२५', '', '', '2025-05-23 18:48:19', 1, 'sadr complain babat jlgv city ps la mail kela ahe', 21, '2025-05-23 19:23:46'),
(228, '20252283109', 'प्रा .राहुल निकम', '9823222659', 'प्रताप मिल कंपाऊंड,अमळनेर', 'अमळनेर', 28, 'माझ्या व्हाट्सअप वर बँक ऑफ महाराष्ट्राचा नावाने फ्रॉड संदेश आला.  त्यामुळे व्हाट्सअपअकाउंटकाउंट हॅक झाले परिणामी मी ते बंद केले. माझी फसवणूक करण्याचा प्रयत्न करण्यात आला', 'महोदय दिनांक 21 मे 2025 वार बुधवार रोजी सायंकाळी साडेसात वाजता सुमारास माझ्या व्हाट्सअप वर बँक ऑफ महाराष्ट्राच्या नावाने एक संदेश आला तो संदेश मी ओपन करण्याचा प्रयत्न केला पण मध्येच मी मला फसवणुकीची जाणीव झाल्यामुळे बंद केला पण पुढे माझ्या व्हाट्सअप वरून अनेक लोकांना बँक ऑफ महाराष्ट्राचा फेक संदेश गेला. या संदर्भात मला काही मित्रांकडून फोन आल्यानंतर मी 19 30 या नंबर वर संपर्क करून तक्रार नोंदवण्याचा प्रयत्न केला. माझ्या व्हाट्सअप स्टेटस ला एक जागृती पर मेसेज देखील प्रसारित केला. काही ग्रुपला या फसवणुकी संदर्भात संदेश देखील पाठवले आणि रात्री साडेदहा ते पावणे अकराच्या दरम्यान माझे व्हाट्सअप अकाउंट मी बंद केले. महोदय यासंदर्भात आपण योग्य ती चौकशी करून संबंधितांवर कारवाई करावी ही विनंती.', '', '', '2025-05-24 12:31:09', 1, 'sadar complain babat amalner ps la mail kela ahe', 21, '2025-05-24 13:04:37'),
(229, '20252294320', 'Shaikh azhar shaikh anis', '9960009691', 'Bhusawal', 'Bhusawal', 8, 'bike theft', 'On March 30, a Platina bike was stolen from near Papa Nagar Mosque in Bhusawal', 'IMG_20250525_194158.jpg', '/uploads/complaint_files/2025-05-25/20250525194320/IMG_20250525_194158.jpg', '2025-05-25 19:43:20', 1, 'SADAR QR CODE TAKRAR BABAT BHUSAWAL BAJARPETH PC CHE PSO LHC/1494 SUMAN RATHOD YANNA MAHITI DILI AAHE', 21, '2025-05-25 20:30:11'),
