(231, '20252311603', 'Aananda Shravan Bankar', '9075335716', 'Pimplagaon hare', 'Pimplagaon hare', 25, NULL, 'उप भूमी अधीक्षक कार्यलाय पाचोरा यांच्या कडून सरकारी मोजणी ही माझ्या गट नंबर १२७४ पिंपळगाव बु. ची झालेली असून काल दी.26.5.2025 रोजी उप भूमी अधीक्षक कार्यलाय पाचोरा यांच्या कडून सक्षम अधिकारी  यांनी गटाचे हद्द खुणा निच्हित करुण हद्द मोजणी खुणा गाडलेले आहे परंतू आज दी.27.5.2025 रोजी सकाळी माझ्या घरी राजेंद्र श्रीकृष्ण मालकर(संजय नगर च्या बाजूला राहत असलेला व्यक्ति)  ११ वाजता माझ्या घरी येउन सरकारी खुणा उपटून ताकेंन अशी धमकी दिलेली आहे म्हणून सरकारी खुणा उपटू नये अन्यथा फोजदारी गुन्हा दाखल करण्यात येइल अशी समझ देण्यात यावी. \r\nAananda Shravan Bankar At-Pimpalgaon hare, Tal-Pachora (424203) \r\nCOMPAINT SENT BY EMAIL aanndabankar46@gmail.com', '', '', '2025-05-27 11:16:03', 1, 'pimplegaon hareshwar che pc vikas pawar yenna qr code chi complaint dili aahe', 21, '2025-05-27 14:05:35'),
(232, '20252320044', 'Nilesh Namdeo Ubhale', '8329984521', 'Bhoje', 'Bhoje', 25, 'BNSS २०२३  चे कलम १७३(१) प्रमाने तसेच “Sindhu Janak Nagargoje vs The State Of Maharashtra on 8 August, 2023”व “Lalita Kumari v. State of U.P. & Ors. (2014)” माननीय सर्वोच्च न्यायालयाने दिलेल्या मार्गदर्शन तत्वानुसार   प्रमाने दखलपात्र स्वरूपाचा फोजदारी गुन्हा', 'सर्व जबाबदार व्यक्ति (मुलाचे आई,वडिल,मुलीचे आई वडिल,व लैंगिक संबंध बनवनार्या व्यक्ति व गुन्हा लपवनारी व गुन्हेगारांना कायदेशीर कार्यवाही पासून वाचवनारी मधुबाला प्रशांत मालकर व पदाचा दुरूपयोग करुण  कायद्या, शासन निर्णयचा भंग करणारे व आरोपींना कायदेशीर कार्यवाही पासून वाचवनारे  जळगाव जिल्हा बालकल्याण समिती, जळगाव जिल्हा बालसंरक्षण समिती यांच्या विरोधात फोजदारी कार्यवाही करनेसाठी BNSS २०२३  चे कलम १७३(१) प्रमाने तसेच “Sindhu Janak Nagargoje vs The State Of Maharashtra on 8 August, 2023”व “Lalita Kumari v. State of U.P. & Ors. (2014)” माननीय सर्वोच्च न्यायालयाने दिलेल्या मार्गदर्शन तत्वानुसार   प्रमाने दखलपात्र स्वरूपाचा फोजदारी गुन्हा बालविवाह प्रतिबंध कायदा, POCSO Act 2012, BNS २०२३ चे कलम २२३,१९८  व अन्य कलमा अंतर्गत सर्व जबाबदार व्यक्ति अधिकारी विरोधात फोजदारी गुन्हा दाखल करण्यात यावा. त्यासाठी लेखी फिर्याद दीली असे.', '11zon_merged-PDF (4).pdf', '/uploads/complaint_files/2025-05-28/20250528170043/11zon_merged-PDF (4).pdf', '2025-05-28 17:00:44', 1, 'SADAR QR CODE COMPLAINTS BABAT PIMPALGAON HARESHWAR PS CHE PSO HC/858 TATYABA NAGARE YANNA MAHITI DILI ASUN PS CHYA EMAIL A/C VAR PDF PATHAVLELI AAHE ', 21, '2025-05-28 17:25:04'),
