(238, '20252383206', 'विवेक गजानन देवकर', '९९६०६००९९९', 'आदर्शनगर', 'जळगाव', 1, 'मी जळगाव शहर पोलीस ठाणे जळगाव येथे दिलेल्या तक्रार दि.८/५/२०२५ बाबत कोणतीही कारवाई झालेली नाही.', 'पोलीस निरीक्षक सा.\r\nजळगाव शहर पोलीस ठाणे जळगाव\r\nमहात्मा फुले मार्केट समोर नवी पेठ\r\nजळगाव.\r\n08/05/2025\r\n\r\nतक्रारदार/अर्जदार  :- विवेक देवकर \r\nप्रतिकअपार्टमेंट फ्लॕट नं 1व2\r\nआदर्शनगर डी-मार्ट जवळ जळगाव\r\nमो.9960600999 \r\n\r\nतक्रारविरूध्द:- 1) श्री श्रीनाथ देवकर मो. 95036 52734\r\n2) श्री सनिल श्रीनाथ देवकर मो.9970308466\r\n3) श्री गजानन देवकर रा. 203 बळीराम\r\nपेठ, देवकर निवास जळगाव मो.9892430816; 9082260043\r\n4) किरण त्र्यंबक नन्नवरे रा.समता नगर पाळधी ता.धरणगाव मो.91 80075 63580\r\n5) असलम शेख जेऊर शेख रा. 6) अशपाक शेख असलम शेख मशिदजवळ पाळधी ता.धरणगाव मो. 90498 २३१२९ मी सदर तक्रार दि.८/५/२०२५ वेळ २१:२३वाजता दिली माझा जवाब हे.काॕ विजय निकुंभ सा.यांनी माझा जवाब २४/५/२०२५ ला घेतला आहे. मला सदर गट नं ८४/१ व ८४/२ वर शेत तयार करत असतांना ट्रॕक्टर ड्रायव्हर ला असलमशेख याचा मुलगा मुश्ताक शेख असलम शेख याने ट्रॕक्टर ने टिलर चे काम करत असतांना मारण्याची धमकी दिल्याने शेत करता येत नाही.असा मला मोबाईल प्रशांत धनगर याने जय भोले पाळधी येथून कळविले आहे. तरी विनंती माझ्या तक्रारी बाबत कारवाई करण्यात यावी ही नम्रपणे विनंती करत आहे.तक्रारदार विवेक देवकर जळगाव ३१/०५/२०२५', '', '', '2025-05-31 20:32:06', 1, 'sadr takrari babat hc hc 3186 ajit patil yana dili ramanad poste ', 21, '2025-05-31 22:28:25'),
(239, '20252393830', 'Nilesh Namdeo Ubhale', '8329984521', 'Bhoje', 'Bhoje', 25, 'फोजदारी कार्यवाही करनेसाठी CRPC १९७३ चे कलम १५४(१), BNSS २०२३  चे कलम १७३(१) प्रमाने', 'नंदाबाई विक्रम क्षिरसागर,जगदीश विक्रम क्षिरसागर,सतीश विक्रम क्षिरसागर, लोकसेवक तत्कालीन तहसीलदार पाचोरा (प्रवीण चव्हाणके), सहाय्यक जिल्हा पुरवठा अधिकारी(शीतल राजपूत), उप-आयुक्त (पुरवठा) विभाग नाशिक, जिल्हा पुरवठा अधिकारी(संजय गायकवाड), सहा.विभागीय पुरवठा अधिकारी आयुक्त नाशिक(स्मिता शिवाजीराव दळवी), विभागीय आयुक्त नाशीक, विद्यमान तहसीलदार पाचोरा(विजय शिवाजी बनसोडे), तपासी अंमलदार उप.नीरी.(प्रकाश स.पाटिल), ठाना प्रभारी(प्रकाश काळे), पोलिस उप-अधीक्षक (धनंजय येरूळे), PSO काझी देशमुख, यांच्या विरोधात \r\n\r\nफोजदारी कार्यवाही करनेसाठी CRPC १९७३ चे कलम १५४(१), BNSS २०२३  चे कलम १७३(१) प्रमाने तसेच “Sindhu Janak Nagargoje vs The State Of Maharashtra on 8 August, 2023”व “Lalita Kumari v. State of U.P. & Ors. (2014)” माननीय सर्वोच्च न्यायालयाने दिलेल्या मार्गदर्शन तत्वानुसार दखलपात्र स्वरूपाचा फोजदारी गुन्हा IPC १८६० चे कलम ४२०,४०९,४१८,२०१,१०९, r/w ३४ &३७,१२०(ब),१६६,१७५,१७६,१८८,२१७  व  अन्य कलमा अंतर्गत सर्व जबाबदार व्यक्ति,लोकसेवक विरोधात फोजदारी गुन्हा दाखल करण्यात यावा. त्यासाठी लेखी फिर्याद दीली असे.-Firyad Refer email  PDF of 86 page for all documents and pdf copy attached', 'Firyad Refer email PDF of 86 page.pdf', '/uploads/complaint_files/2025-05-31/20250531203830/Firyad Refer email PDF of 86 page.pdf', '2025-05-31 20:38:30', 1, 'sadar takrari babat pc sham hatkar yana mahit dili ahe ', 21, '2025-05-31 22:25:26'),
(240, '20252403855', 'विवेक गजानन देवकर', '९९६०६००९९९', 'आदर्शनगर', 'जळगाव', 35, 'धरणगाव पोलीस ठाणे धरणगाव जि. जळगाव यांना दि.२४/५/२०२५ ला ईमेल वर तक्रार करून ही पाळधी दूरक्षेत्र पोलीस ठाणे पाळधी यांनी कार्यवाही केली नाही', 'मे.पोलीस निरीक्षक सा. घरणगाव  धरणगाव पोलीस ठाणे यांना सविनय परत तक्रार सादर करत आहे. माझी पाळधी बुद्रूक गट नं ८४/१ व ८४/२ मध्ये शेताची ट्रॕक्टर ने मशागत चालू असतांना असलम शेख याचा दुसरा मुलगा मुश्ताकशेख आसलमशेख याने माझ्या शेतात येऊन ट्रॕक्टर ड्रायव्हर आमर पावरा याला जीवे मारण्याची धमकी देऊन बाहेर काढले आहे. सदर शेत मी प्रशांत नाना धनगर जय भोले हाॕटेल यास तयार करण्यासाठी दिले आहे. (मो.८००७४८२१३८) असलम शेख चा  मुलगा मुश्ताकशेख याच्यावर त्वरित कारवाई करावी हा मुलगा तक्रारीत उल्लेख केलेल्या च्या मार्फत दहशत निर्माण करत आहे. मला शेतावर मशागत करतांना अडवणूक करत आहे. सदर मुश्ताक असलमशेख याने शेतावर येऊ नये असे प्रशांत नाना धनगर ला हाॕटेल वर येऊन सांगितले आहे. प्रशांत धनगर याने मला मोबाईल वरून सांगितले मी त्याला पोलीस तक्रार करायला सांगितले असता प्रशांत याने मला तक्रार करण्यासाठी सुचित केले आहे. सदर गुंड लोक आमच्या घरातील भांडणाचा गैरफायदा घेण्यासाठी माझ्या शेतावर आक्रमण कब्जा करण्याचा आहे. त्वरित कारवाई करावी असलमशेख वकिरण नन्नवरे आशपाक शेख यांचेवर तहसिलदार धरणगाव यांनी प्रतिबंबधक कारवाई होऊन सुध्दा काहीही फरक झाला नाही. यांच्यावर या पेक्षा कठोर सक्त कारवाई करण्यात यावी. ट्रॕक्टर ड्रायव्हर चा मोबाईल नंबर पत्ता प्रशांत धनगर याला माहीत आहे.तक्रारदार विवेक देवकर', '', '', '2025-06-01 10:38:54', 1, 'sadar event babat dharangaon ps che pso yana call karun kalvile aahe karita nond ', 21, '2025-06-01 10:55:51'),
(241, '20252410947', 'Rudra electrical', '7290003513', 'Jalgaon', 'Jalgaon', 1, 'Stolen', 'Meri NHAI ( national highway authority of India) me ek choti company hai mene in logo ko theke par kaam diya tha jiska payment bhi\r\nadvance kiya tha jitna inhone kaam kiya uska payment mene kar diya inke duara or paiso ki mang ki gyii mene kha jo tarika hai kaam\r\nkarne us hisab se kaam kijiye aapko paisa mil jayega or inhone kaam nhii kiya jaisa engineer ne batya inhone kaam band kar diya or\r\nmere jo saaman use kar rhe the bo lekkar bha se chale gaye or aab me aapna material bapas mang rha hu to mana kar rhe hai dene se\r\nmene jiske duara kaam diya gya uska naam, mahesh singh hai jo kaam kar rha tha jiske pass mera material tha bo suresh chand s/o\r\nhari sing,House no.-492/11,jeevan park ,sirshapur, north west delhi, delhi-110042 hai , mera jo saaman inke paas hai bo dilane ki kirpa\r\nkare aapki aati kirpa hogi', '', '', '2025-06-02 12:09:47', 1, 'JALGAON CITY PSO HC/ NANDALAL PATIL YANNA MAHITI DILI AAHE', 21, '2025-06-02 12:29:49'),
(242, '20252421201', 'Rudra electrical', '7290003513', 'Jalgaon', 'Jalgaon', 1, NULL, 'Meri NHAI ( national highway authority of India) me ek choti company hai mene in logo ko theke par kaam diya tha jiska payment bhi\r\nadvance kiya tha jitna inhone kaam kiya uska payment mene kar diya inke duara or paiso ki mang ki gyii mene kha jo tarika hai kaam\r\nkarne us hisab se kaam kijiye aapko paisa mil jayega or inhone kaam nhii kiya jaisa engineer ne batya inhone kaam band kar diya or\r\nmere jo saaman use kar rhe the bo lekkar bha se chale gaye or aab me aapna material bapas mang rha hu to mana kar rhe hai dene se\r\nmene jiske duara kaam diya gya uska naam, mahesh singh hai jo kaam kar rha tha jiske pass mera material tha bo suresh chand s/o\r\nhari sing,House no.-492/11,jeevan park ,sirshapur, north west delhi, delhi-110042 hai , mera jo saaman inke paas hai bo dilane ki kirpa\r\nkare aapki aati kirpa hogi', 'Screenshot_20250602_121107_OneDrive.jpg', '/uploads/complaint_files/2025-06-02/20250602121201/Screenshot_20250602_121107_OneDrive.jpg', '2025-06-02 12:12:01', 1, 'JALGAON CITY PSO HC/ NANDALAL PATIL YANNA MAHITI DILI AAHE ', 21, '2025-06-02 12:28:56'),
(243, '20252432325', 'इसरार शेख मुसा', '9021239211', 'पोलीस मुख्यालय जळगाव', 'जळगाव शहर', 5, NULL, 'काही दिवसापूर्वी एका महिलेचा फोन आला म्हणाली तुमचा नंबर आमच्या लकी ड्रा मध्ये सिलेक्ट झाला आहे २१हजाराचा मोबाईल ६हजार ला भेटेल... खोटे पार्सल पाठवून पैसे घेऊन घेतले..पैसे परत मागितले असता कोणतेही प्रतिसाद देत नाही मोबाईल बंद करून ठेवतात..६हजारची फसवणूक झाली.. कृपया पैसे परत मिळवून द्या प्लीज', '', '', '2025-06-03 13:23:25', 1, 'JILHAPETH PS CHE PSO HC/SANTOSH SONAWANE YANA MAHITI DILI AHE', 21, '2025-06-03 14:15:32'),
(244, '20252443428', 'तनवीर शेख मुसा /विकार शेख मुसा', '7841866514', 'पोलीस मुख्यालय जळगाव', 'जळगाव शहर', 6, '४महिने आम्हा दोघं भावांना काम करवून पगार दिला  नाही', 'निखिल उर्फ राहुल नागला रा एम आय डी सी गुलाब जमून फॅक्टरी याने ४महिने डेटा एन्ट्री चे काम करवून घेतले पगार मागितला असता अडीच वर्षांपासून फिरवत आहे.. कृपया आम्हा दोघं भावांचे 40हजार रुपये  पगार मिळवून द्यावा ही विनंती', '', '', '2025-06-03 13:34:28', 1, 'MIDC PS CHE PSO HC/SACHIN PATIL YANA MAHITI DILI AHE..', 21, '2025-06-03 14:15:03'),
(245, '20252451454', 'सुरेश समाधान पाटील', '8928429008', 'माळपिंप्री', 'माळपिंप्री ता.जामनेर', 26, 'मोबाईल व सिमकार्ड चोरी गेला असले बाबत', 'माझा मोबाईल विवो व्ही ५० कंपनीचा त्याचा आय.एम.ई.आय नं. ८६४६४१०७०९२३३१९ असा असुन त्यात जिओ कंपनीचे सिमकार्ड नं. ८९२८४२९००८ असे आज दिनांक ०३/०६/२०२५ रोजी दुपारी ४.३० मी. नेरी बाजारात पोलीस स्टेशन काही अंतरावर असतांना चोरीस गेला.', 'WhatsApp Image 2025-06-03 at 9.02.29 PM.pdf', '/uploads/complaint_files/2025-06-03/20250603211454/WhatsApp Image 2025-06-03 at 9.02.29 PM.pdf', '2025-06-03 21:14:54', 1, 'sadar event babat pso yana call karun kalile aahe karita nond ', 21, '2025-06-04 09:54:10'),
(246, '20252461048', 'जयदीप प्रकाश dever', '8308184891', 'विष्णू नगर', 'चाळीसगाव', 20, 'कॉल वर पैसे मागत होता', 'मला माझा फोन वर कॉल येत होते आणि पैसे मागणे चालू होते आणि तो मला धमकी पण देऊ लागला पैसे ताक नाही तर तुझी गाडी मी घेण्यस्तही येतो आहे असं मी कारण माझी गाडी हफ्त्यावर काढिली आहे आणि तिचे लोन श्री रॅम फिनान्स aahe', '', '', '2025-06-04 16:10:48', 1, 'SADAR  QR COD COMPLET BABAT CHALISGAON RURAL CHE PSO HC/2961 PRVIN SANGELY YANNA MAHITI KALAVILE AHE V TE YOGAY TI KARWAI KARIT AHET ', 21, '2025-06-04 17:49:13'),
(247, '20252473426', 'सुभाष सदाशिव राणे', '9423575075', 'जळगाव', 'जळगाव', 5, 'लेवा एज्युकेशनल युनियन, जळगांव संचलित डॉ. अण्णासाहेब जी.डी. बेंडाळे महिला महाविद्यालय (कनिष्ठ महाविद्यालय) जळगांव येथे झालेल्या बेकायदेशीर शिक्षक भरतीबाबत', 'लेवा एज्युकेशनल युनियन, जळगांव संचलित डॉ. अण्णासाहेब जी.डी. बेंडाळे महिला महाविद्यालय (कनिष्ठ महाविद्यालय) जळगांव येथे झालेल्या बेकायदेशीर शिक्षक भरतीबाबत..(सोबत PDF फाईल जोडली आहे.)', 'Adobe Scan 28-May-2025.pdf', '/uploads/complaint_files/2025-06-04/20250604193426/Adobe Scan 28-May-2025.pdf', '2025-06-04 19:34:26', 1, 'sadar takrar babat jilhapeth ps che pso wpn 3146/ suravna tayde yanna yatil takrardar yanchi mahiti v,mobile number dila ahe.te pudhil karvai karit ahe.baddal tyani kalvale ahe.', 21, '2025-06-04 22:33:29'),
(248, '20252480117', 'कांचन राधेशाम दाणी', '8080220375', 'विधीलिकित, गजानन वाडी, म्युनिसिपल हायस्कूल मैदानाच्या मागे, चैतन्य मसाले, भुसवळ रोड', 'फैजपूर, भुसावळ, जळगाव, महाराष्ट्र - 425503', 13, 'विषय: जीवे मारण्याची धमकी आणि मानसिक छळाबाबत तक्रार', '०६ जून २०२५ रोजी, अंदाजे रात्री ०९:०० - ०९:३० सुमारास, हर्षल यशवंत दाणी हा यशवंत नीलकंठ दाणी आणि ज्योती यशवंत दाणी यांचा मोठा मुलगा असून आणि एक अज्ञात व्यक्ती आमच्या घरात येऊन शिवीगाळ करत जोर-जोरात ओरडत, एकट्या बाई-माणसाच्या / माझ्या (कांचन राधेशाम दाणी) अंगावर धावत येऊन जर २ दिवसात घर आणि दुकान  खाली केले नाही तर जीवे मारायची धमकी दिली आहे. मला आणि माझ्या परिवाराला यशवंत नीलकंठ दाणी, ज्योती यशवंत दाणी, आणि धीरज यशवंत दाणी, यांच्या कडून सुद्धा धोका आहे.', 'कांचन राधेशाम दाणी.pdf', '/uploads/complaint_files/2025-06-07/20250607010117/कांचन राधेशाम दाणी.pdf', '2025-06-07 01:01:17', 1, 'similar event 20252491810', 21, '2025-06-07 07:43:57'),
(249, '20252491810', 'कांचन राधेशाम दाणी', '8080220375', 'विधीलिकित, गजानन वाडी, म्युनिसिपल हायस्कूल मैदानाच्या मागे, चैतन्य मसाले, भुसवळ रोड', 'फैजपूर, भुसावळ, जळगाव, महाराष्ट्र - 425503', 13, 'जीवे मारण्याची धमकी आणि मानसिक छळाबाबत तक्रार', 'मी, कांचन राधेशाम दाणी, राधेशाम नीलकंठ दाणी यांची पत्नी, विधीलिकित, गजानन वाडी, म्युनिसिपल हायस्कूल मैदानाच्या मागे, चैतन्य मसाले, भुसावळ रोड, फैजपूर, भुसावळ, जळगाव, महाराष्ट्र – ४२५५०३ येथे राहणार, हे पत्र लिहित आहे. माझ्या जीवाला धोका निर्माण झाला आहे, या गंभीर प्रकरणाबद्दल तुमचे तातडीने लक्ष वेधण्यासाठी मी प्रार्थना करते. मला माझ्या आणि माझ्या कुटुंबाच्या सुरक्षिततेबद्दल खूप काळजी वाटते आणि मी तातडीने पोलिस हस्तक्षेपाची मागणी करते.\r\n०६ जून २०२५ रोजी, अंदाजे रात्री ०९:०० - ०९:३० सुमारास, हर्षल यशवंत दाणी हा यशवंत नीलकंठ दाणी आणि ज्योती यशवंत दाणी यांचा मोठा मुलगा असून आणि एक अज्ञात व्यक्ती आमच्या घरात येऊन शिवीगाळ करत जोर-जोरात ओरडत, एकट्या बाई-माणसाच्या / माझ्या (कांचन राधेशाम दाणी) अंगावर धावत येऊन जर २ दिवसात घर आणि दुकान खाली केले नाही तर जीवे मारायची धमकी दिली आहे. मला आणि माझ्या परिवाराला यशवंत नीलकंठ दाणी, ज्योती यशवंत दाणी, आणि धीरज यशवंत दाणी, यांच्या कडून सुद्धा धोका आहे.\r\nमला वाटते की ही धमकी एक गंभीर बाब आहे आणि मला माझ्या जीवाची भीती आहे. त्यांनी १८ जून २०१७ साली सुद्धा माझे पती (राधेशाम नीलकंठ दाणी) आणि माझी मुलगी (दीपमाला राधेशाम दाणी) यांना मारहाण केली होती. तेव्हा सुद्धा आम्ही पोलीस तक्रार केली होती, पण त्याचा काहीच परिणाम झाला नाही. त्या नंतर सुद्धा त्यांनी बरेच वेळा आम्हाला त्रास दिला.  माझ्या पतीचे निधन वर्ष २०२० मध्ये झाले आणि त्या नंतर तर गुन्हेगारांना असे वाटायला लागले कि आता मला (कांचन राधेशाम दाणी) घरातून बाहेर काढू आणि घरावर ताबा करू. पण हे घर माझ्या पतीचे आणि माझे सुद्धा आहे.\r\nमी तुम्हाला विनंती करते की माझी तक्रार नोंदवा आणि माझी सुरक्षितता सुनिश्चित करण्यासाठी आणि न्याय मिळवून देण्यासाठी गुन्हेगाराविरुद्ध त्वरित कारवाई करा.', 'कांचन राधेशाम दाणी.pdf', '/uploads/complaint_files/2025-06-07/20250607011810/कांचन राधेशाम दाणी.pdf', '2025-06-07 01:18:10', 1, 'FAIJPUR PS CHE PC BHUSHAN THAKRE YANA MAHITI DILI AHE TASECH EMAIL KELA AHE..', 21, '2025-06-07 07:56:55');
