(250, '20252503720', 'नितीन निळकंठ किरंगे', '९११२२९०७६९', 'वडगांव आंबे', 'वडगांव आंबे', 25, 'शैक्षणिक  जनजागृती व प्रवेश बाबत  आमच्या शाळेतील शिक्षकांना दमदाटी तसेच मला फोनवरून शिक्षकाना गावात पाठवू नये', 'शैक्षणिक जागृती व विद्यार्थी प्रवेश बाबत आमच्या शाळेतील शिक्षक गावात फिरत असतांना त्यांना श्री संजय देवरे व हर्षल पाटील यांनी पालक भेटी घेऊ नये  अशी धमकी दिली व मला दि 30- 05 - 2025 रोजी ९ वाजून १३ मिनिटांनी फोन करून गावात शिक्षकांना विद्यार्थी प्रवेशा साठी पाठवू नये अशी धमकी दिली . तसेच  रस्त्याने घरी जातांना वडगांव बस स्टँड वर  मला व प्राथ  विद्यालयाचे मुख्या श्री खेमराज राठोड यांना तुम्हाला बघून  घेऊ तंगडे तोडून हातात देऊ अशी दमदाटी केली तसेच गावात पालकांना व विद्यार्थंना भेटण्यास  मज्जाव करून विद्यार्थ्यांना शालेय प्रवेशा पासून वंचित ठेऊन शासकिय कामात अडथळा आणला या बाबत.', 'Complaint .pdf', '/uploads/complaint_files/2025-06-07/20250607103719/Complaint .pdf', '2025-06-07 10:37:20', 1, 'SADR EVENT BABAT PIMPALGAON PS CHE PSO YANA KALVILE AAHE ', 21, '2025-06-07 13:42:29'),
