(256, '20252565527', 'swapnil sunil patil', '9730466146', 'jalgaon district', 'jalgaon', 1, 'murder karne, controvercy karne', '2016 pasun trass dene, satavne, tv vr lokan samor aanne, cell phone device vrun murder karne ha indian film industry madhala actor shahrukh khan and jalgaon politician madhe mili bhagat karto aahe ani mala trass deto aahe satvat aahe , murder karaycha prayatna karto aahe. tv vr lokan samor anne ani kahi karan nastanna controvercy karne he tyache prayatna aahe', 'IMG-20250517-WA0017.jpg', '/uploads/complaint_files/2025-06-12/20250612155527/IMG-20250517-WA0017.jpg', '2025-06-12 15:55:27', 1, 'jalgaon citi ps che pso yana kalvile aahe karita nond ', 21, '2025-06-13 09:55:55'),
(257, '20252574440', 'अभिषेक विजयराव इंगळे', '7888161899', 'दर्यापूर', 'दर्यापूर', 1, 'रिक्षाचालकाने केलेलं गैरवर्तन', 'मी काल जळगाव येथे RRB NTPC चा पेपर देण्यासाठी आलो असता या रिक्षा चालकाने मला सुट्टे पैसे दिले त्यामध्ये रंग लागलेल्या नोटा होत्या त्या घेण्यास मी नकार दिला असता सदरहू रिक्षा चालकाने वाद घालून मला शिवीगाळ केली कृपया कार्यवाही करावी', 'IMG20250611084112_copy_3072x4080.jpg', '/uploads/complaint_files/2025-06-12/20250612184440/IMG20250611084112_copy_3072x4080.jpg', '2025-06-12 18:44:40', 1, 'sadar event babat pso yana call karun mahiti dili aahe ', 21, '2025-06-13 09:46:38'),
(258, '20252582150', 'विवेक गजानन देवकर', '९९६०६००९९९', 'प्रतिक अपार्टमेंट फ्लॕट नं १ व २ डी-मार्ट जवळ आदर्शनगर जळगाव', 'जळगाव', 35, 'पाळधी बुद्रूक ता.धरणगाव येथील गट नं 84/1, 84/2 व गट नं 76 मधील शेतात असलमशेख जेऊर शेख शेतात पेरणी करतांना अडथळा व दडपण आणत आहे', 'सहाय्यक निरीक्षक सा.\r\nपाळधी दूरक्षेत्र पोलीस ठाणे पाळधी ता.धरणगाव. दि.13/06/2025\r\n\r\nपोलीस निरीक्षक \r\nधरणगाव पोलीस ठाणे (विभाग पाळधी) ता.धरणगाव \r\n\r\nअर्जदार :- विवेक गजानन देवकर प्रतिक अपार्टमेंट डी-मार्ट जवळ जळगाव 425002\r\n\r\nसविनय तक्रार अर्ज सादर करत आहे की... माझ्या वरील शेतात पेरणी ची कामे सुरू आहेत. वडील श्री गजानन देवकर व श्री श्रीनाथ देवकर यांच्या विरूध्द जळगाव शहर पोलीस ठाणे, लासलगाव पोलीस ठाणे, कफ परेड पोलीस ठाणे येथे बेकायदेशीर व फसवणूकी केल्याबद्दल फौजदारी तक्रारी दाखल आहेत त्याबाबत फौजदारी न्यायालयाने दखल घेऊन वडील श्री गजानन देवकर ,भाऊ श्रीनाथ देवकर व त्याचा मुलगा सनिल देवकर यांनी केलेल्या गुन्ह्यात दोषी आढळून आले आहे. त्याचा राग आल्यामुळे ते सर्वजण श्री असलम शेख जेऊर शेख व त्याची मुले माझ्या शेतातील मजूरांना हैराण करून पळवून लावतआहेत.माझ्या शेतावर येऊन अडथळा व दडपण आणत आहेत. असलम शेख व त्याच्या मुलांवर तहसिलदार धरणगाव यांनी प्रतिबंधक कारवाई करूनही फरक पडलेला नाही. आज मी स्वतःहून पाळधी दूरक्षेत्र पोलीस ठाणे येथे हे.काॕ.अर्जुन सा. यांना भेटून 7/12 उतारा दाखविला आहे.असलम शेख याच्यावर सक्त कारवाई करावी याबाबत तक्रार करायला आलो होतो. मी जळगावला राहात असल्यामुळे माझ्या शेतातील मजूर पाळधी पोलीस ठाणे येथे तक्रार करायला भिती वाटत आहे म्हणून मला जळगाव कळविण्यात आले आहे. तरी असलम शेख वर सक्त कारवाई करण्यात यावी ही विनंती. सोबत 7/12 चा उतारा देत आहे.\r\nतक्रारदार \r\nविवेक देवकर जळगाव', '20241224_174218 (1).jpg', '/uploads/complaint_files/2025-06-13/20250613162150/20241224_174218 (1).jpg', '2025-06-13 16:21:50', 1, 'similar event , already complaint keli ahe..', 21, '2025-06-13 17:06:26'),
