(263, '20252634746', 'Nilesh Namdeo Ubhale', '8329984521', 'Bhoje', 'bhoje', 25, 'पिंपळगाव हरे येथील FIR मधे चार्ज शीट धाखल झालेली होती परंतू R.C.C. 202/2022 न्यायालयाने माझी व माझी आई ची निर्दोष मुक्तता केलेली आहे', 'प्रति,\r\nसहायक पोलिस निरीक्षक पिंपळगाव हरे. पो.स्टे.\r\n\r\nअर्जदार –निलेश नामदेव उभाळे, वय -३३, व्यवसाय-सामाजिक कार्य  \r\n        मो. नं.८३२९९८४५२१ \r\n        रा.भोजे, ता. पाचोरा, जि. जळगाव. (महाराष्ट्र)-४२४२०३ \r\nमी  अर्जदार  विनंतीपुर्वक अर्ज देतो की, \r\nमी वरील ठिकाणी राहतो व मी समाजीक कार्य करतो. \r\nमाझ्या विरोधात पिंपळगाव हरे येथील FIR मधे चार्ज शीट धाखल झालेली होती परंतू R.C.C. 202/2022 न्यायालयाने माझी व माझी आई ची निर्दोष मुक्तता केलेली आहे व माझा भाऊ सतीष व वहिनी पूजा ह्याना म.उच्च न्यायालय औरंगाबाद खंडपीठ यांनी दोष मुक्त केलेले होते. \r\nमाझी आपनास विनंती आहे की सदरिल प्रकरण पोलिस स्टेशनला नोंद घेण्यात यावी.\r\n	     धन्यवाद...\r\n                 निलेश नामदेव उभाळे (अर्जदार)\r\n                 ईमेल द्वारे -nileshnubhale@gmail.com\r\n	      दि. 16/06/2025                                                                        \r\n\r\n    प्रत:-\r\n1)	म.पोलिस अधिक्षक,जलगाँव,		\r\n2)	म.उप-अधिक्षक पाचोरा विभाग,', '11zon_merged-PDF (5).pdf', '/uploads/complaint_files/2025-06-16/20250616094746/11zon_merged-PDF (5).pdf', '2025-06-16 09:47:46', 1, 'COMPLAINANT NEHMI QR CODE VAR TAKRAR KARIT ASTO..', 21, '2025-06-16 12:19:30'),
