(267, '20252675259', 'कल्याणी दिपक शिंपी', '8669163556', 'रामानंद नगर महादेव मंदिर भडगाव रोड', 'पाचोरा', 1, NULL, 'मला माझ्या नवऱ्याच्या घरी खुप त्रास दिली आहे माझा नवरा सासू सासरे यांनी माझा खुप शारीरिक व मानसिक छळ केला आहे माझा नवरा मला मारहाण व माझ्या नवर्याने माझी ईच्छा नसताना मला मारहाण करून माझ्या मांडीवर सिगरेट चे चटके देवून संबंध ठेवण्यास भाग पाडले आणि त्याचे मोबाईल फोन मधे व्हिडिओ केली आहे आणि माझ्या सासरे पण माझ्या वर बलात्कार करण्याचे प्रयत्न केले आहे माझा नवरा दिपक कैलास शिंपी.सासु संगीता पाटील व सासरे कांतिलाल पाटील यांच्या वर कडक कारवाई करावी', '', '', '2025-06-22 16:52:59', 1, 'सादर QR कोड मधील कॉलर यांना कोल करून विचारले असता कॉलर कॊलला उत्तर देत नाही कॉअल्लेर यांचा पत्ता पूर्ण नसून चुकीचा आहे तरी पुढील कार्यवाही करण्याची तजवीज ठेवून आहे ', 21, '2025-06-22 23:31:25'),
