(270, '20252700647', 'Smita Deshpande', '9960376424', 'AURANAGABA', 'AURANAGABA', 7, 'Chitting by Siddhesh Tours and Travels', 'I have paid Rs 18500/- online on 12th May 2025 for Nepal Yatra. I am not keeping well due to high BP  so I want to cancel the programme and want my money back. I have phoned the concern persons so many times but they are not lifting the phone calls  I have sent email regarding cancelation of my yatra which is going to start on 4th Aug 2025 but they are not replying. Hence I request to return my Rs 18500 back. I am a senior citizen lady aged 65 years and it is hard for me to go to bhusawal due health and age issues.', '', '', '2025-06-23 14:06:47', 1, 'QR COD COMLENT BABAT BHUSAWAL CITY  CHE PSO HC/660 DEEPAK PATIL YANNA  MAHITI KALAVILE AHE', 21, '2025-06-25 13:56:28'),
