(272, '20252723300', 'PIYUSH MANMAL SANCHETI', '9225121891', 'BHADGAON ROAD', 'PACHORA', 24, 'FINANCIAL FRAUD', 'Subject: Complaint of Land Mortgage Fraud,     I am writing to report a serious case of land mortgage fraud committed by Mr. Vikas Namdeo Patil and the former Talathi of Wadgaon Ambe. Without my knowledge or consent, they mortgaged my land to the Vikas Karyakari Society for a sum of Rs. 80,000. i Have tried to register the complain at Pachora Police Station, but the Sr. PI of Pachora Police station is not ready to register the complaint. \r\nDetails of the Incident:\r\n- Land Survey Number: 196/1 & \r\n- Land Location: Wadgaon Ambe\r\n- Date of Mortgage: June 2022\r\n- Amount: Rs. 80,000.', 'document_signed.pdf', '/uploads/complaint_files/2025-06-24/20250624143300/document_signed.pdf', '2025-06-24 14:33:00', 1, 'EMAIL VAR TAKRAR PATHAVLELI AAHE PSO YANNA MAHITI DILI AAHE', 21, '2025-06-25 10:12:55'),
(273, '20252731209', 'दिपक रमेश करोसिया', '9370160010', 'संचार नगर, ढाकेवाडी शेजारी जळगाव', 'जळगाव', 6, 'दिनांक 13/03/2025 रोजी तक्रार क्र. 20251013119 वर FIR दाखल करने बाबत', 'माननीय पोलीस अधीक्षक साहेब,\r\nजळगाव\r\n\r\nविषय: 1) दिनांक 13/03/2025 रोजी तक्रार क्र. 20251013119 वर FIR दाखल करने बाबत.\r\n(लोकसेवकाला खोटी माहिती देणे, पोलीस स्टेशन मध्ये खोटा गुन्हा दाखल करणे व एखाद्याला व्यक्तीला हेतुपुरस्कर पणे एखाद्या खोटया गुन्हामध्ये अडकविणे व नाहक वर्तमानपत्रांमध्ये बदनामी करणे बाबत)\r\n2) वरील तक्रारीवर कारवाईची प्रेस नोट देणेबाबत.\r\n\r\nअर्जदार: दिपक रमेश करोसिया, जिल्हा क्राईम रिपोर्टर (बुलंद पोलीस टाईम्स), संचार नगर, जळगाव, मोबाईल  9370160010.\r\n\r\nमाननीय महोदय, वरील तक्रारीनुसार श्री. परेश रामकृष्ण सनन्से राहणार संचार नगर, जळगाव, मोबाईल 9422276667 यांनी एमआयडीसी पोलीस स्टेशन मध्ये चारचाकी गाडीची काच फुटल्याची खोटी तक्रार दाखल करून त्याची खोटी बदनामी कारक बातमी जळगावच्या सर्व वर्तमानपत्रांमध्ये प्रसिद्ध करून आम्हा संचार नगरच्या रहिवाशांना नाहक पणे बदनाम केले आणि आम्हा नागरिकांना किंवा एखाद्या व्यक्तीला गुन्हा मध्ये अटकवण्याचा प्रयत्न केला. आपण केलेला तपासात हे सर्व समोर आले असेलच. \r\n\r\nवरील परेश रामकृष्ण सनन्से हा गृह खाते, बीएसएनएल, सरकारी कर्मचारी, वरिष्ठ अनुवादक, डॉक्टर... अशा उपाधी लावून, एक सरकारी कर्मचारी असताना असे बेजबाबदार कृत्य व विकृत कारस्थाने सतत करीत असतो. याआधी पण इतर नागरिकांच्या दारासमोर मुद्दाम चार चाकी लावून सार्वजनिक रस्ता अडवणे, मुद्दाम कुठलीही अडचण नसताना इतरांच्या दुचाकी सरकविणे , त्यांना मुद्दाम धक्का लावणे आणि इतर नागरिकांना सार्वजनिक रस्ता वापरण्यास मज्जाव करणे, वकिला कडून रहिवाशांना सार्वजनिक रस्ता वापरू नये म्हणून अनधिकृत नोटीस पाठविणे, वर्तमानपत्रामधिल कात्रण दाखवून कॉलनिची बदमानी चालू ठेवणे आणि नळ कनेक्शन घेण्यामध्ये अडकाठी आणणे, चांगल्या रस्त्यावरती वेस्ट मटेरियल रेती टाकून व्यत्यय आणणे, बीएसएनएल ऑफिस मधून पदाच्या दुरुपयोग करून ठराविक नंबर वर इतर लोकांची मोबाईल सेवा खंडित करणे असे उपद्रव परेश रामकृष्ण सनन्से व्यक्तीचे चालू असतात. वरील सर्व कृत्यांचा माझ्याकडे सबळ पुरावा आहे.\r\n\r\nकॉलनी मधील रहिवास व शेजार धर्म असल्यामुळे आम्ही लोकांनी याकडे वेळोवेळी दुर्लक्ष केले. परंतु याचा उपद्रव चालूच आहे. आपल्या समोर गाडीची काच फोडण्याचा घटनेवरून हे सिद्ध होते. आम्ही याआधी तीन वेळा भोसले व करोसिया यांनी एनसीआर व तक्रार दाखल केली होती. नंतर या व्यक्तीने माफी मागितली म्हणून ती परत घेण्यात आली.\r\n\r\nदि. 22-जुन-2025 रोजी जळगाव महानगर पालिकेची परवानगी न घेता वृक्ष/झाडांच्या फांद्या तोडत असतांना मी याचे फोटो व व्हिडीओ चित्रण केले म्हणून  दुपारी 01:30 pm च्या सुमारास परेश रामकृष्ण सनन्से यांने मला घाण शिवीगाळ केली. अजूनही काडीमात्र फरक या व्यक्ती मध्ये पडला नाही.\r\n\r\nआता मात्र याचा उपद्रव किंवा विकृती वाढतच आहे म्हणून या प्रकरणाची चौकशी करून परेश रामकृष्ण सनन्से व्यक्तीवर गुन्हा दाखल करावा व आम्हाला त्याबाबतची प्रेस नोट देण्यात यावी ही विनंती. जेणेकरून आमच्या संचार नगरच्या रहिवाशांची नाहक झालेली बदनामी हे पेपरामध्ये देवून आमचा निर्दोषपणा सिध्द होईल व  परेश रामकृष्ण सनन्से ह्याचा लबाडपणा, विकृत स्वभाव व गुन्हा हे लोकांसमोर येईल.\r\n\r\nवरील सर्व माहितीचे कागदपत्र सोबत जोडत आहे:\r\n1.खोटी बातमी छापण्याचे पेपर कात्रण\r\n2.नळ कनेक्शन अडकाठी\r\n3.रस्त्यावरती रेती टाकणे\r\n4. भोसलेची व अरुणा करोसिया यांची परेश रामकृष्ण सनन्से विरुध्द तक्रार, एनसीआर कॉपी \r\n5. बीएसएनएल ऑफिस मध्ये कार्यालयीन चौकशी एनसीआर कॉपी\r\n6. MIDC POLICE जळगावला सायबर कंप्लेंट केल्याची कॉपी\r\n7. एसपी ऑफिसला सायबर कंप्लेंट केल्याची कॉपी\r\n8. चार चाकी रस्त्यामध्ये लावणे \r\n९.  वकिला कडून खोट्या नोटीस पाठवल्याची प्रत\r\n\r\nJalgaon Police Web Site वर तक्रार दाखल करतांना Technical Problem असल्याने,\r\nदि. 23/06/2025 रोजी Whatsapp Number 9422210702 वर ही तक्रार पाठविली.\r\nव SP Office Jalgaon च्या ई-मेल वर ही पाठवीत आहे.\r\n\r\nधन्यवाद', 'SPOFFOK.pdf', '/uploads/complaint_files/2025-06-24/20250624181209/SPOFFOK.pdf', '2025-06-24 18:12:09', 1, 'SADAR QR CODE TAKRAR BABT MIDC PSO YANNA MAHITI DILI ASUN MIDC PS CHYA EMAIL ID VAR TAKRAR PATHAVLELI AAHE ', 21, '2025-06-25 10:08:11'),
(274, '20252744514', 'दिलीप सोनू बाणाईत', '9881745028', 'प्लॉट नंबर १२७ म्हाडा कॉलनी एमआयडीसी एरिया जळगांव', 'जळगाव', 6, 'खिडक्या बनवण्यासाठी पैसे घेतले व काम करत नाहीये', 'संजय राजपूत राजे संभाजी नगर श्रीकृष्ण मंदीराजवळ खेडी यांनी फसवणूक केल्याबद्दल', 'takrar.pdf', '/uploads/complaint_files/2025-06-25/20250625234513/takrar.pdf', '2025-06-25 23:45:14', 1, 'midc che pso kumbar yenna phone varun mahiti dili aahe babat nond', 21, '2025-06-26 10:52:50'),
(275, '20252750809', 'विशाल परशुराम कोळी व प्रतिभा दिलीप जाधव', '9834822754', 'कजगाव', 'कजगाव', 21, 'आंतरजातीय विवाह केला असून माझे आई वडील यांचहेकडून लग्नाला नकार होता त्यामुळे त्यांच्याकडून आमच्या जीवाला धोका आहे', 'महोदय मी लग्नापूर्वी प्रतिभा दिलीप जाधव लग्नानंतर विशाल परशुराम कोळी व मी विशाल परशुराम कोळी रा .दोन्ही सध्या कजगाव ता. भडगाव तरी आम्ही दोघांनी संमती प्रमाणे स्वखुशीने लग्न केले असून आंतरजातीय विवाह केला आहे त्यामुळे मुलीच्या घरचे यांचा तीव्र विरोध आहे तरी आम्ही दोन्हीही सज्ञान असून भारतीय कायदा प्रमाणे वयाने पूर्ण असून  हिंदू रितीरिवाजाने लग्न केले असून त्याबाबाबत  आम्ही श्री वर्णेश्वर मंदिर संस्था अमळनेर येथे लग्न दिनांक २५/०६/२०२५ येथे केले असून त्याबाबत फोटो नोटेरी आणि घोषणापत्र केले असून आम्ही लग्न कुणाच्याही दबाव खाली केले नसून स्वतः आमच्या इच्छे प्रेमाने केले आहे तरी आम्हा दोघांना मुलीच्या परिवारापासून धोका आहे तरी ते राहणार दळवेल ता. पारोळा येथील रहिवाशी आहेत त्यांचे नाव दिलीप लुका जाधव व त्यांचे कुटुंब तरी आम्हाला योग्य ती मदत करावी हि नम्र विनंती', 'IMG20250626115305.jpg', '/uploads/complaint_files/2025-06-26/20250626160809/IMG20250626115305.jpg', '2025-06-26 16:08:09', 1, 'bhadgaon pso asi iqbal shaikh yana tracking no complant name mobile no nature of coplaint mahiti dili asun bhadgaon pso pudhil karvahi karit ahe babat nond', 21, '2025-06-26 18:53:00'),
(276, '20252765354', 'प्रेमराज  तुकाराम  वाघ', '8806660525', 'आनंद  शांती  नगर प्लॉट १७५/५  गट १२५  विवेकानंद  शाळेजवळ', 'सावखेडे  शिवार   जळगाव', 6, 'अपघात  होऊन  गाडीचे.   नुकसान. झाल्याबद्दल', 'महोदय , आम्ही परिवार  सोबत   29  जून 2025  4.30. ला मोहाडी रोड     येथून   घरी जात असताना होंडा एक्टिव्हा  गाडी    महाराष्ट्र १९ सी टी ००१७  या  गाडीने.  माझ्या.  चारचाकी  वाहन   क्रमांक.   महाराष्ट्र १९ डी जे ९७३७  या  गाडीला  मागुन  धक्का   देऊन  नुकसान केले.  तरी  वाहन  चालक.  दानिश खान  मोबाईल  7058037031  व  त्यांच्या मित्र   कडून.  नुकसान भरपाई देण्यासाठी.   तक्रार दाखल करण्यात.  यावी.   ही.   विनंती .', '', '', '2025-06-30 10:53:54', 1, 'sadr takrar babat midc ps che pso hc/2845 promad ladvanjari yana call karun mahiti dili aahe karita nond ', 21, '2025-06-30 12:44:40'),
(277, '20252774711', 'विजय बाबुलाल दाणेज', '9822438457', '७७ विसाजी नगर , होम गार्ड ऑफिस मागे', 'जळगाव', 5, 'माझे घर लगत रस्त्यावरील वाळू , सिमेंट , चोरी गेले आणि शासकीय मालमत्ता मध्ये अपहार आणि भ्रस्टाचार झाले म्हणून अज्ञात इसम विरुद्ध गुन्हा दाखल होणे बाबत', 'माझे घर लगत रस्त्यावरील वाळू , सिमेंट , चोरी गेले आणि शासकीय मालमत्ता मध्ये अपहार आणि भ्रस्टाचार झाले म्हणून अज्ञात इसम विरुद्ध गुन्हा दाखल  व्ह्यवा  म्हणून तक्रार दाखल करीत आहे .', '', '', '2025-06-30 12:47:11', 1, 'sadar qr cod comlent babat jilhapeth pso naresh sonawane yanna phon karun qr cod comlent che mahiti dili ahe v te karwai karit ahe babat kalaavile varun nond', 21, '2025-06-30 14:57:14'),
(278, '20252785802', 'चेतन पंडीत पाटील', '7821932828', 'कासारखेडा', 'मुक्ताईनगर', 15, 'जबरदस्ती शेत पेरणी', 'माझे शेत हे कासारखेडा शिवारात असून त्याचा खरेदी बाबद आम्ही वरणगाव येथील सावकार श्री मोहन यांच्याकडून मोहन यांच्याकडून आम्ही शेत साठी आम्ही दोन लाख रुपये रक्कम घेतली होती. त्याचा दरवर्षी आम्ही व्याजदर त्याला देत होते. तरीही त्यावेळेस जर देत असतानाही त्यांनी आमच्या शेतातील पीक कपाशी यावरती तणनाशक फवारले होते त्यामुळे आम्हाला खूप आर्थिक नुकसान झाले. त्यानंतर त्यांनी ते शेत परस्पर समोरच्या माणसाला विकलं त्याचे नाव हरजीत सिंग (लव्ह शेठ ) फौजी ढाबा. राहणार वरणगांव. याच्या नावावरती केली आणि त्यांनी आम्हाला त्या शेताचे दहा लाख मागितले तेवढी रक्कम आमच्याकडे नव्हती त्याच्यामुळे त्यांनी शेत परस्पर तिसऱ्या माणसाच्या नावावरती केला तो आमच्या गावा शेजारचा अतुल युवराज पाटील राहणार चांगदेव या व्यक्तीने शेत नावावर केलेला आणि त्याने नं सांगता शेत पेरले आणि जीवे मारण्याची धमकी दिली...', '', '', '2025-06-30 19:58:02', 1, 'yatil takrardar yanchi mahiti muktainagar ps che pso HC 2750/ chandrakant bodade yanna dili ahe.te yogya ti karvai karit ahe.', 21, '2025-06-30 20:54:29');
