(2, 2, 'पाचोरा येथे पोलीस निवासस्थान व पोलीस स्टेशन चा भूमिपूजन सोहळा', 'uploads/initiatives/', 'uploads/initiatives/g2_4.jpg', 1, 1, '2021-08-28 12:30:33', 1, '2021-08-28 12:33:45'),
