(4, 2, '08 मार्च 2025 रोजी जागतिक महिला दिन', 'uploads/initiatives/', 'uploads/initiatives/g4_1.jpg', 1, 1, '2021-08-28 12:30:33', 1, '2021-08-28 12:33:45'),
(5, 2, 'जागतिक महिला दिन', 'uploads/initiatives/', 'uploads/initiatives/g5_1.jpg', 1, 0, '2025-03-28 05:47:07', 0, '2025-03-28 05:47:07'),
(6, 2, 'मा.पोलीस अधीक्षक श्री डॉ.महेश्वर रेड्डी, मा. अपर पोलीस अधीक्षक अशोक नखाते यांनी जळगाव  शहरातील ईदगाह मैदान येथे रमजान ईद निमित्ताने सामुहिक नमाज पठण करणाऱ्या मुस्लिम बांधवांना पोलीस प्रशासना तर्फे पुष्पगुच्छ देवून ईदच्या शुभेच्छा दिल्या..', 'uploads/gallery/2021/रमजान_ईद/', 'uploads/gallery/2021/रमजान_ईद/Thumbnail/202504011619041002.jpg', 1, 1, '2025-04-01 16:19:12', 0, '0000-00-00 00:00:00'),
(7, 2, 'कायदा व सुव्यवस्थेबरोबरच नागरिकांना मुलभूत सुविधा उपलब्ध करून देण्याकरीता जिल्हा नियोजन समितीमार्फत जळगाव पोलीस दलाकरीता चार चाकी वाहने पोलीस ठाण्यांकरीता उपलब्ध करून दिलेले आहेत.', 'uploads/gallery/2021/चार_चाकी/', 'uploads/gallery/2021/चार_चाकी/Thumbnail/Thumb_20250401175411.jpg', 1, 1, '2025-04-01 17:54:11', 0, '0000-00-00 00:00:00'),
(8, 2, 'नवीन पोलीस वसाहत या ठिकाणी डॉ. बाबासाहेब आंबेडकर जयंती निमित्त प्रतिमेला पुष्पहार अर्पण करून मा.पोलीस अधीक्षक डॉ.महेश्वर रेड्डी , अशोक नखाते अप्पर पोलीस अधीक्षक जळगाव  व  संदीप गावित , उपविभागीय पोलीस अधिकारी, जळगाव विभाग  यांनी विनम्र अभिवादन केले..', 'uploads/gallery/2025/नवीन_पोलीस/', 'uploads/gallery/2025/नवीन_पोलीस/Thumbnail/Thumb_20250418154841.jpg', 1, 1, '2025-04-18 15:48:41', 1, '2025-04-18 15:53:27');
