INSERT INTO `master_initiatives` (`MINT_ID`, `MINT_Lang`, `MINT_Title`, `MINT_Path`, `MINT_Status`, `MINT_Added_By`, `MINT_Added_Date`, `MINT_Updated_By`, `MINT_Updated_Date`) VALUES
(1, 2, 'जिल्ह्यातील पोलिस कर्मचार्‍यांकडून आरोग्याशी संबंधित सर्व माहिती संकलित करण्यासाठी धुळे जिल्हा पोलीस दलाने पुढाकार घेत निरामय - पोलीस पर्सन साठी  हे अँप्लिकेशन तयार करून घेण्यात आले आहे. सदर अँप्लिकेशन मध्ये पोलिस कर्मचारी त्यांच्या आजाराची माहिती नियमितपणे अद्ययावत करू शकतात, जेणेकरुन सर्व आरोग्याशी संबंधित इतिहास जतन केला जाईल.\nया साथीच्या परिस्थितीत, आवश्यक सेवा म्हणून पोलिस काम करत असतात आणि नियमितपणे जनतेशी संपर्कात असतात, म्हणूनच प्रत्येक पोलिस कर्मचाऱ्यांची आरोग्य माहिती रेकॉर्डवर असणे आवश्यक असते. या माहितीची नोंद ठेवण्यासाठी आणि त्यांचे विश्लेषण करण्यास निरामय - पोलीस पर्सन साठी  मदत करते.पारोळा पोलीस स्टेशन जळगाव येथे  होळी, धुलीवंदन ,रंगपंचमी सणानिमित्त पोलीस पाटील यांची मीटिंग घेण्यात येऊन योग्य त्या सूचना देण्यात आल्या..', 'uploads/initiatives/6.jpg', 1, 1, '2020-06-30 20:17:19', 1, '2020-07-01 12:38:10'),
(2, 2, 'अमळनेर पोलीस स्टेशन येथे सर्व उपस्थित पोलीस पाटील यांचे कडून आगामी होळी, धुलीवंदन, रंगपंचमी, शिवजयंती (तिथी प्रमाणे), रमजान ईद बाबत माहिती जाणून घेतली. तसेच  गावातील अवैध धंदे, ग्राम सुरक्षा दल, गावात ग्रामपंचायत अथवा लोकसहभागातून सीसीटीव्ही कॅमेरे बसविणे याबाबत आव्हान देखील करण्यात आले.', 'uploads/initiatives/7.jpg', 1, 1, '2020-07-01 12:39:20', 0, '0000-00-00 00:00:00'),
(3, 1, 'होळी आणि धुलीवंदनाच्या दिवशी बंदोबस्तात व्यस्त असल्यामुळे धुलीवंदनाचा आनंद लूटू न शकलेल्या जळगाव पोलीस दलासाठी आज विशेष धुलीवंदनाचा कार्यक्रमाचे आयोजन करण्यात आले.', 'uploads/initiatives/8.jpg', 1, 1, '2020-07-01 18:31:13', 1, '2020-07-01 19:47:11'),
(4, 2, 'जळगाव जिल्हा हिंदू नववर्ष गुढी पाडवा व रमजान ईद अनुषंगाने रूट मार्च', 'uploads/initiatives/9.jpg', 1, 1, '2020-07-12 10:20:15', 1, '2020-07-12 10:21:14'),
(5, 2, 'जळगाव जिल्हा पोलीस दलातर्फे रमजान ईद, श्रीराम नवमी, हनुमान जयंती, गुढीपाडवा, डॉ.बाबासाहेब आंबेडकर जयंतीनिमित्त मंगळवारी सरदार वल्लभभाई पटेल सभागृहात शांतता कमिटीची बैठक आयोजित करण्यात आली होती.', 'uploads/initiatives/10.jpg', 1, 1, '2020-07-27 11:12:28', 0, '0000-00-00 00:00:00'),
(6, 1, 'मा.पोलीस अधीक्षक श्री डॉ.महेश्वर रेड्डी, मा. अपर पोलीस अधीक्षक अशोक नखाते यांनी जळगाव  शहरातील ईदगाह मैदान येथे रमजान ईद निमित्ताने सामुहिक नमाज पठण करणाऱ्या मुस्लिम बांधवांना पोलीस प्रशासना तर्फे पुष्पगुच्छ देवून ईदच्या शुभेच्छा दिल्या..', 'uploads/initiatives/initiative_eid.jpg', 1, 1, '2025-04-01 06:27:28', 1, '2025-04-01 06:27:28');
