(1, 2, 'घरफोडीच्या मुद्देमालासह ०४ आरोपी जेरबंद - स्थानिक गुन्हे शाखा, धुळे पोलिसांची कामगिरी', 'गेल्या काही दिवसांपासून शिरपूर शहर व परिसरात चोऱ्या व घरफोड्या मध्ये वाढ झाल्याने पोलीस अधीक्षक, धुळे यांनी स्था.गु.शा धुळे चे अधिकारी व कर्मचारी याना त्यास प्रतिबंध करून गुन्हे उघडकीस आणण्याच्या सक्त सूचना दिल्या होत्या. \r\nशिरपूर शहर पो.स्टे.  असलेल्या घरफोडी चोरीचा स्थानिक गुन्हे शाखा, धुळे समांतर तपस करत असताना गोपनीय माहिती प्राप्त झाली की, मोहाला, ता. सेंधवा जि.  बडवानी, मध्यप्रदेश येथील काही लोक धुळे जिल्ह्यातील शेतावर जागले म्हणून काम करत असून त्यांच्याकडे त्यांचे काही नातेवाईक पाहुणे म्हणून येतात व पुन्हा जाताना चोरी करून जातात. त्या अनुषंगाने माहिती घेता मोहाला गावातील जतन मोरे व कुवरसिंह मोरे यांनी त्यांचे साथिदाराच्या मदतीने शिरपूर तालुक्यातील करवंद, वाघाडी व अर्थे गावात घरफोडी चोरी केल्याची खात्रीशीर खबर मिळाली. त्या अनुषंगाने सदर संशयितांचा शोध घेता ते पोलिसांची चाहूल लागल्याने मोहाला गावातून पळून जाऊन त्यांची राहण्याची ठिकाणे सतत बदलत होते. त्यामुळे त्यांना पकडणे मोठे आव्हान होते. दरम्यान आज गोपनीय बातमीदारातर्फे बातमी मिळाली की, सदरचे आरोपी हे त्यांचे साथीदारांसह नरव्हाळ, ता.जि. धुळे येथील एका शेताजवळील तिखी तलगत लपून बसले आहेत. त्यावरून पथकाने सादर ठिकाणी सापाळा लावून त्यांचा शिताफीने पाठलाग करून (१) जतन रुमसिंग मोरे, वय - २१ वर्षे, (२) कुवरसिंग सूरसिंग मोरे, वय - २२ वर्षे, व (३) लालसिंग रेन्या तडवी, वय - २० वर्षे, सर्व राहणार मोहाला, ता. सेंधवा जि. बडवानी, मध्यप्रदेश याना ताब्यात घेतले. त्यांच्याकडे मिळालेली मोटारसायकल, चांदीचे दागिने व मोबाइल इत्यादी मुद्देमाल जप्त करून त्यांचे कडे अधिक चौकशी केली असता त्यांनी चोरीतील सोन्याचे दागिने आजच (४) सोनू उर्फ जितेंद्र अशोक सोनार, वय - ३० वर्षे, व्यवसाय - सोनारकाम, रा. घर क्र. ४४, मेहरूण, ता.जि. जळगाव यास विकल्याचे सांगितल्याने तात्काळ त्याचा शोध घेऊन त्यास पारोळा चौफुली, धुळे येथे पकडून त्याचे कब्जातून चोरीचे विकत घेतलेल्या सोन्यासह एकूण ४,८७,५२३ /- रुपये किमतीचा मुद्देमाल जप्त करण्यात आला असून शिरपूर शहर पोलीस स्टेशनला दाखल भाग गु.र.नं - १४५/२०२०, १८८/२०२० व १९७/२०२० भा.द.वि कलाम ४५७, ३८० प्रमाणे दाखल ०३ घरफोडी चोरीचे गुन्हे उघडकीस आणले आहेत.\r\nसदरची कार्यवाही ही. माननीय अधीक्षक श्री. चिन्मय पंडित, पार पोलीस अधीक्षक डॉ. प्रशांत बच्छाव यांचे मार्गदर्शनाखाली स्था.गु.शा. धुळे चे पोलीस निरीक्षक श्री. शिवाजी बुधवंत, पोलिस उप-निरीक्षक - हनुमान उगले, पो.हे.कॉ. संजय पाटील, रफिक पठाण, श्रीकांत पाटील, महेंद्र कापुरे. पो.ना प्रभाकर बैसाणे, कुणाल पानपाटील, गौतम सपकाळे, उमेश पाटील, रविकिरण राठोड, विशाल पाटील, तुषार पारधी, मयूर पाटील, योगेश जगताप, दीपक पाटील, व कैलास महाजन यांनी केली आहे.', '2020-10-09', 'uploads/stories/2020-10-09/202010131750137782.jpg', 'uploads/stories/2020-10-09/2010131750136572.pdf', 1, 1, '2020-10-13 17:50:13', 1, '2020-10-13 18:22:11'),
(2, 2, 'दोंडाईचा पोलिसांनी सोशल मीडिया च्या साहाय्याने शोधली हरविलेली मुले', 'दोंडाईचा पोलिसांनी सोशल मीडिया च्या साहाय्याने शोधली हरविलेली मुले', '2021-01-07', 'uploads/stories/2021-01-07/202103061357129010.jpg', '', 1, 1, '2021-03-06 13:57:12', 0, '0000-00-00 00:00:00');
