(12, 2, 'मुंबई ते नागपूर हायवे वरील 3 मजुरांना चिरडून टाकणाऱ्या  डंपर  शोध घेत 23 वर्षीय आरोपीला नशिराबाद पोलिसांकडून अटक', 'uploads/press/250313134851.pdf', '2025-03-13', 1, 1, '2025-03-13 13:48:51', 0, '0000-00-00 00:00:00'),
(13, 1, 'मा.डॉ.श्री.महेश्वर रेड्डी पोलीस अधीक्षक जळगाव मा.श्री.अशोक नखाते अपर पोलीस अधीक्षक जळगाव, उपविभागीय पोलीस अधिकारी, श्री कृष्णकांत पिंगळे, यांच्या मार्गदर्शनाखाली पो. कॉ. उमाकांत पाटील, नेमणूक SDPO कार्यालय भुसावल पो.कॉ.प्रशांत परदेशी,पो.कॉ.जावेद शहा, पो.कॉ.राहुल वानखेडे बाजारपेठ', 'uploads/press/250403132315.pdf', '2025-03-13', 1, 22, '2025-04-03 13:23:15', 0, '0000-00-00 00:00:00'),
(14, 1, 'माननीय डॉ. महेश्वर रेड्डी, पोलीस अधीक्षक जळगाव श्री अशोक नखाते अपर पोलीस अधीक्षक जळगाव यांचे मार्गदर्शनाखाली कोंबिंग ऑपरेशन राबवून अवैधरीत्या दारू तसेच गावठी हातभट्टी दारूचे ठिकाणे उध्वस्त करून कारवाई करण्यात आली. कारवाईचे सत्र मा. उपविभागीय पोलीस अधिकारी श्री संदीप गावित, एमआयडीसी पो स्टे, जळगाव शहर पो स्टे, रामानंदनगर पो स्टे, शनिपेठ पो स्टे, जळगाव शहर पो स्टे, जळगाव तालुका या सर्व पोस्टे प्रभारी अधिकारी सर्व अंमलदार ,आरसीपी पथक, क्यूआरटी पथक यांनी राबविल्याने होळी आणि धुलीवंदन सण शांततेत साजरा झाला', 'uploads/press/250403133749.pdf', '2025-03-16', 1, 22, '2025-04-03 13:37:49', 0, '0000-00-00 00:00:00'),
(15, 1, 'अमळनेर पोलीस स्टेशनचे अधिकारी व कर्मचारी यांची कामगिरी....\r\nबस मध्ये सोने चोरी करणाऱ्या महिलांना अटक करून सोने हस्तगत\r\nमा.पोलीस अधीक्षकश्री महेश्वर रेड्डी, मा.अपर पोलीस अधीक्षक श्रीमती कविता नेरकर,मा.उपविभागीय पोलीस अधिकारी श्री विनायक कोते यांच्या मार्गदर्शनाखाली व मा.परी.पोलीस उपधिक्षक श्री.केदार बारबोले यांच्या आदेशान्वये सदर कारवाई गुन्हे शोध पथकातील पोलीस उपनिरीक्षक नामदेव बोरकर पो.हे.कॉ.मिलिंद सोनार,पो.कॉ.विनोद संदानशिव,पो.कॉ.प्रशांत पाटील,पो.कॉ निलेश मोरे,पो.कॉ उज्वलकुमार म्हस्के,पो.कॉ.अमोल पाटील,पो.कॉ.गणेश पाटील, महिला होमगार्ड नीलम पाटील, यांनी केली.तसेच नेत्र कार्यालय जळगाव येथील पो.कॉ पंकज खडसे, पो.कॉ कुंदनसिंग बयास,तसेच पो.कॉ गौरव पाटील,पो.कॉ मिलिंद जाधव यांनी तांत्रिक मदत केली आहे', 'uploads/press/250403134133.pdf', '2025-03-17', 1, 22, '2025-04-03 13:41:33', 0, '0000-00-00 00:00:00'),
(16, 1, 'गुन्ह्यातील फरार आरोपी कडून एमआयडीसी पोलीस स्टेशनचे अधिकारी व कर्मचारी यांनी चोरीच्या मोटर सायकल केल्या हस्तगत....', 'uploads/press/250403134607.pdf', '2025-03-19', 1, 22, '2025-04-03 13:46:07', 0, '0000-00-00 00:00:00'),
(17, 1, 'रस्त्यावर उभे असणारे वाहनांमधून रात्रीच्या वेळी डिझेल चोरी करणाऱ्या आरोपी एमआयडीसी पोलिसांनी केली अटक....', 'uploads/press/250403134907.pdf', '2025-03-23', 1, 22, '2025-04-03 13:49:07', 0, '0000-00-00 00:00:00'),
(18, 1, 'कजगाव तालुका भडगाव शिवारात शेतात मंदिरात चोरी करणाऱ्या आरोपींना भडगाव पोलीस स्टेशन चे अधिकारी व कर्मचारी यांच्याकडून मुद्देमालासह केले अटक..', 'uploads/press/250403135139.pdf', '2025-03-23', 1, 22, '2025-04-03 13:51:39', 0, '0000-00-00 00:00:00'),
(19, 1, 'जळगाव जिल्हा पोलीस दलातर्फे रमजान ईद, श्रीराम नवमी, हनुमान जयंती, गुढीपाडवा, डॉ.बाबासाहेब आंबेडकर जयंतीनिमित्त मंगळवारी सरदार वल्लभभाई पटेल सभागृहात शांतता कमिटीची बैठक', 'uploads/press/250403135609.pdf', '2025-03-26', 1, 22, '2025-04-03 13:56:09', 0, '0000-00-00 00:00:00'),
(20, 1, 'खुनाच्या गुन्ह्यातील जन्मठेपेची शिक्षा भोगत असलेला 19 वर्षापासून फरार बंदी कैदीस स्थानिक गुन्हे शाखेकडून अटक...\r\nसदरची कारवाई ही मा.डॉ.श्री.महेश्वर रेड्डी पोलीस अधीक्षक जळगाव, मा.श्रीमती कविता नेरकर,अपर पोलीस अधीक्षक चाळीसगाव,मा.श्री बबन आव्हाड वरिष्ठ पो.निरी.स्थानिक गुन्हे', 'uploads/press/250403135900.pdf', '2025-03-28', 1, 22, '2025-04-03 13:59:00', 0, '0000-00-00 00:00:00'),
